 (69,'Isometric Neck Exercise - Front And Back','\n        <p>\n        </p><p></p><ol><li> With your head and neck in a neutral position (normal position with head erect facing forward), place both of your hands on the front side of your head.</li>\r\n\r\n	<li> Now gently push forward as you contract the neck muscles but resisting any movement of your head.  Start with slow tension and increase slowly.  Keep breathing normally as you execute this contraction.</li>\r\n\r\n	<li> Hold for the recommended number of seconds.</li>\r\n\r\n	<li> Now release the tension slowly.</li>\r\n\r\n	<li> Rest for the recommended amount of time and repeat with your hands placed on the back side of your head.</li>\r\n</ol><p><strong>Variations:</strong> You can also do this exercise by placing your hands on the sides of your head.  First do one side and then the next.</p>\n    \n',1,613,614,0,2,68,'http://www.bodybuilding.com/exercises/detail/view/name/isometric-neck-exercise-front-and-back',1,'6.2',3,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/27/Male/m/27_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/27/Male/m/27_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/27/Female/m/27_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/27/Female/m/27_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (70,'Isometric Neck Exercise - Sides','\n        <p>\n        </p><p></p><ol><li> With your head and neck in a neutral position (normal position with head erect facing forward), place your left hand on the left side of your head.</li>\r\n\r\n	<li> Now gently push towards the left as you contract the left neck muscles but resisting any movement of your head.  Start with slow tension and increase slowly.  Keep breathing normally as you execute this contraction.</li>\r\n\r\n	<li> Hold for the recommended number of seconds.</li>\r\n\r\n	<li> Now release the tension slowly.</li>\r\n\r\n	<li> Rest for the recommended amount of time and repeat with your right hand placed on the right side of your head.</li>\r\n</ol><p><strong>Variations:</strong> You can also do this exercise by placing your hands to the front and then to the back of your head.  First do one side and then the next.</p>\n    \n',1,615,616,1,2,68,'http://www.bodybuilding.com/exercises/detail/view/name/isometric-neck-exercise-sides',1,'6.8',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/28/Male/m/28_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/28/Male/m/28_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/28/Female/m/28_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/28/Female/m/28_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (71,'Lying Face Down Plate Neck Resistance','\n        <p>\n        </p><p></p><ol><li> Lie face down with your whole body straight on a flat bench while holding a weight plate behind your head.  <strong>Tip:</strong> You will need to position yourself so that your shoulders are slightly above the end of a flat bench in order for the upper chest, neck and face to be off the bench.  This will be your starting position.</li>\r\n\r\n	<li> While keeping the plate secure on the back of your head slowly lower your head (as in saying \"yes\") as you breathe in.</li>\r\n\r\n	<li> Raise your head back up to the starting position in a semi-circular motion as you breathe out.  Hold the contraction for a second.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> As with all exercises, refrain from using any sort of sudden or jerking motions.</p>\r\n\r\n<p><strong>Variation:</strong> You can opt to use no resistance at first.</p>\n    \n',1,59,60,0,2,51,'http://www.bodybuilding.com/exercises/detail/view/name/lying-face-down-plate-neck-resistance',1,'9.1',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/25/Male/m/25_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/25/Male/m/25_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/25/Female/m/25_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/25/Female/m/25_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (72,'Lying Face Up Plate Neck Resistance','\n        <p>\n        </p><p></p><ol><li> Lie face up with your whole body straight on a flat bench while holding a weight plate on top of your forehead.  <strong>Tip:</strong> You will need to position yourself so that your shoulders are slightly above the end of a flat bench in order for the traps, neck and head to be off the bench.  This will be your starting position.</li>\r\n\r\n	<li> While keeping the plate secure on your forehead slowly lower your head back in a semi-circular motion as you breathe in.</li>\r\n\r\n	<li> Raise your head back up to the starting position in a semi-circular motion as you breathe out.  Hold the contraction for a second.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> As with all exercises, refrain from using any sort of sudden or jerking motions.</p>\r\n\r\n<p><strong>Variation:</strong> You can opt to use no resistance at first.</p>\n    \n',1,61,62,1,2,51,'http://www.bodybuilding.com/exercises/detail/view/name/lying-face-up-plate-neck-resistance',1,'8.1',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/26/Male/m/26_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/26/Male/m/26_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/26/Female/m/26_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/26/Female/m/26_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (73,'Chin To Chest Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Get into a seated position on the floor.</li>\r\n<li> Place both hands at the rear of your head, fingers interlocked, thumbs pointing down and elbows pointing straight ahead. Slowly pull your head down to your chest. Hold for 20-30 seconds. </li>\r\n</ol>\n',1,547,548,0,2,67,'http://www.bodybuilding.com/exercises/detail/view/name/chin-to-chest-stretch',3,'3.6',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/467/Male/m/467_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/467/Male/m/467_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/467/Female/m/467_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/467/Female/m/467_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (74,'Neck-SMR','\n        <p>\n        </p><p>\r\n</p><ol><li>Using a muscle roller or a rolling pin, place the roller behind your head and against your neck. Make sure that you do not place the roller directly against the spine, but turned slightly so that the roller is pressed against the muscles to either side of the spine. This will be your starting position.</li>\r\n<li> Starting at the top of your neck, slowly roll down the muscles of your neck, pausing at points of tension for 10-30 seconds. </li>\r\n</ol>\n',1,549,550,1,2,67,'http://www.bodybuilding.com/exercises/detail/view/name/neck-smr',3,'2.3',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/628/Male/m/628_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/628/Male/m/628_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/628/Female/m/628_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/628/Female/m/628_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
 (75,'Side Neck Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Start with your shoulders relaxed, gently tilt your head towards your shoulder.</li>\r\n<li> Assist stretch with a gentle pull on the side of the head.</li>\r\n</ol>\n',1,551,552,2,2,67,'http://www.bodybuilding.com/exercises/detail/view/name/side-neck-stretch',1,'4.7',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Male/m/447_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Male/m/447_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Female/m/447_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Female/m/447_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Female/m/447_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/447/Female/m/447_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/6.gif'),
