 (77,'Traps','',1,618,619,1,1,66,'',0,'0.0',0,0,NULL,NULL),
 (78,'Barbell Shrug','        <p>\r\n        </p><p></p><ol><li>Stand up straight with your feet at shoulder width as you hold a barbell with both hands in front of you using a pronated grip (palms facing the thighs).  Tip: Your hands should be a little wider than shoulder width apart.  You can use wrist wraps for this exercise for a better grip. This will be your starting position.</li>\r\n\r\n<li>Raise your shoulders up as far as you can go as you breathe out and hold the contraction for a second.  Tip: Refrain from trying to lift the barbell by using your biceps.  </li>\r\n\r\n<li>Slowly return to the starting position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can also rotate your shoulders as you go up, going in a semicircular motion from front to rear. However this version is not good for people with shoulder problems.  In addition, this exercise can be performed with the barbell behind the back, with dumbbells by the side, a smith machine or with a shrug machine.</p>\r\n\r\n    \r\n',1,65,66,0,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-shrug',1,'8.1',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/97/Male/m/97_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/97/Male/m/97_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/97/Female/m/97_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/97/Female/m/97_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (79,'Cable Shrugs','\n        <p>\n        </p><p></p><ol><li> Grasp a cable bar attachment that is attached to a low pulley with a shoulder width or slightly wider overhand (palms facing down) grip.</li>\r\n\r\n	<li> Stand erect close to the pulley with your arms extended in front of you holding the bar. This will be your starting position.</li>\r\n\r\n	<li> Lift the bar by elevating the shoulders as high as possible as you exhale. Hold the contraction at the top for a second. <strong>Tip:</strong> The arms should remain extended at all times.  Refrain from using the biceps to help lift the bar.  Only the shoulders should be moving up and down.</li>\r\n\r\n	<li> Lower the bar back to the original position.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with bands, barbells or dumbbell.  You can also use a single handle and work one side at a time.</p>\n    \n',1,69,70,2,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/cable-shrugs',1,'8.3',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/133/Male/m/133_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/133/Male/m/133_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/133/Female/m/133_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/133/Female/m/133_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (80,'Calf-Machine Shoulder Shrug','\n        <p>\n        </p><p></p><ol><li> Position yourself on the calf machine so that the shoulder pads are above your shoulders. Your torso should be straight with the arms extended normally by your side. This will be your starting position.</li>\r\n\r\n	<li> Raise your shoulders up towards your ears as you exhale and hold the contraction for a full second.</li>\r\n\r\n	<li> Slowly return to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can use dumbbells, barbells, smith machines and pulley machines to perform shrugging motions.</p>\n    \n',1,71,72,3,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/calf-machine-shoulder-shrug',1,'8.9',1,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/184/Male/m/184_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/184/Male/m/184_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/184/Female/m/184_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/184/Female/m/184_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (81,'Clean Shrug','\n        <p>\n        </p><p>\r\n</p><ol><li>Begin with a shoulder width, double overhand or hook grip, with the bar hanging at the mid thigh position. Your back should be straight and inclined slightly forward.</li>\r\n<li> Shrug your shoulders towards your ears. While this exercise can usually by loaded with heavier weight than a clean, avoid overloading to the point that the execution slows down.</li>\r\n</ol>\n',1,73,74,4,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/clean-shrug',2,'7.5',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/673/Male/m/673_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/673/Male/m/673_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/673/Female/m/673_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/673/Female/m/673_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (82,'Kettlebell Sumo High Pull','\n        <p>\n        </p><p>\r\n</p><ol><li>Place a kettlebell on the ground between your feet. Position your feet in a wide stance, and grasp the kettlebell with two hands. Set your hips back as far as possible, with your knees  bent. Keep your chest and head up. This will be your starting position.</li>\r\n<li> Begin by extending the hips and knees, simultaneously pulling the kettlebell to your shoulders, raising your elbows as you do so. Reverse the motion to return to the starting position.</li>\r\n</ol>\n',1,77,78,6,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-sumo-high-pull',2,'8.8',2,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/645/Male/m/645_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/645/Male/m/645_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/645/Female/m/645_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/645/Female/m/645_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (83,'Leverage Shrug','\n        <p>\n        </p><p>\r\n</p><ol><li>Load the pins to an appropriate weight. Position yourself directly between the handles.</li>\r\n<li> Grasp the top handles with a comfortable grip, and then lower your hips as you take a breath. Look forward with your head and keep your chest up. </li>\r\n<li> Drive through the floor with your heels, extending your hips and knees as you rise to a standing position. Keep your arms straight throughout the movement, finishing with your shoulders back. This will be your starting position.</li>\r\n<li> Raise the weight by shrugging the shoulders towards your ears, moving straight up and down.</li>\r\n<li> Pause at the top of the motion, and then return the weight to the starting position.\r\n</li>\r\n</ol>\n',1,79,80,7,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/leverage-shrug',1,'0.0',4,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/898/Male/m/898_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/898/Male/m/898_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/898/Female/m/898_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/898/Female/m/898_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (84,'Smith Machine Shrug','\n        <p>\n        </p><p></p><ol><li> To begin, set the bar height on the smith machine around the middle of your thighs.  Once the correct height is chosen and the bar is loaded, grab the bar using a pronated grip (palms facing you) shoulder width apart from each other.</li>\r\n\r\n	<li> Lift the barbell up and fully extend your arms with your back straight.  This is the starting position.</li>\r\n\r\n	<li> While exhaling, elevate the bar by raising your shoulders until they come close to touching your ears.</li>\r\n\r\n	<li> Hold the contraction for a second before lowering the bar back down to the starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p> \r\n\r\n<p></p><ul><li> This exercise can be performed using a squat rack with a barbell.  However, be careful not to select a weight that is so heavy that it causes you to break good form as you do not have the support of the smith machine for this variation.  Too much weight can harm your back.</li>\r\n\r\n	<li> You can also use dumbbells to perform this exercise.</li>\r\n</ul>\n',1,81,82,8,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/smith-machine-shrug',1,'9.3',2,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/134/Male/m/134_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/134/Male/m/134_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/134/Female/m/134_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/134/Female/m/134_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (85,'Smith Machine Upright Row','\n        <p>\n        </p><p></p><ol><li> To begin, set the bar on the smith machine to a height that is around the middle of your thighs.  Once the correct height is chosen and the bar is loaded, grasp the bar using a pronated (palms forward) grip that is shoulder width apart.  You may need some wrist wraps if using a significant amount of weight.</li>\r\n\r\n	<li> Lift the barbell up and fully extend your arms with your back straight.  There should be a slight bend at the elbows.  This is the starting position.</li>\r\n\r\n	<li> Use your side shoulders to lift the bar as you exhale.  The bar should be close to the body as you move it up.  Continue to lift it until it nearly touches your chin.  <strong>Tip:</strong> Your elbows should drive the motion.  As you lift the bar, your elbows should always be higher than your forearms.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n	<li> Lower the bar back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Be very careful with how much weight you use in this exercise.  Too much weight leads to bad form, which in turn can cause shoulder injury.  I\'ve seen this too many times so please no jerking, swinging and cheating.  Also, if you suffer from shoulder problems, you may want to stay away from upright rows and substitute by some form of lateral raises.</p>\r\n\r\n<p><strong>Variations:</strong> This exercise can also be performed using a barbell, E-Z bar, straight bar attached to a low pulley and it can also be performed using dumbbells, though this later exercise should be reserved by the most advanced people that are well familiarized with correct execution.</p>\r\n\r\n<p>Same as the <a href=\"http://www.bodybuilding.com/fun/exercises.php?Name=Upright+Barbell+Row\">Upright Barbell Row</a> but with a Smith Machine.</p>\n    \n',1,83,84,9,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/smith-machine-upright-row',2,'7.8',2,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/78/Male/m/78_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/78/Male/m/78_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/78/Female/m/78_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/78/Female/m/78_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (86,'Snatch Shrug','\n        <p>\n        </p><p>\r\n</p><ol><li>Begin with a wide grip, with the bar hanging at the mid thigh position. You can use a hook or overhand grip. Your back should be straight and inclined slightly forward.</li>\r\n<li>  Shrug your shoulders towards your ears. While this exercise can usually by loaded with heavier weight than a snatch, avoid overloading to the point that the execution slows down.</li>\r\n</ol>\n',1,85,86,10,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/snatch-shrug',2,'6.3',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/718/Male/m/718_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/718/Male/m/718_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/718/Female/m/718_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/718/Female/m/718_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (87,'Standing Dumbbell Upright Row','\n        <p>\n        </p><p></p><ol><li>  Grasp a dumbbell in each hand with a pronated (palms forward) grip that is slightly less than shoulder width.  The dumbbells should be resting on top of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight.  This will be your starting position.</li>\r\n\r\n	<li>   Use your side shoulders to lift the dumbbells as you exhale.  The dumbbells should be close to the body as you move it up and the elbows should drive the motion.  Continue to lift them until they nearly touch your chin.  <strong>Tip:</strong> Your elbows should drive the motion.  As you lift the dumbbells, your elbows should always be higher than your forearms.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n	<li>  Lower the dumbbells back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li>  Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Be very careful with how much weight you use in this exercise.  Too much weight leads to bad form, which in turn can cause shoulder injury.  I\'ve seen this too many times so please no jerking, swinging and cheating.  Also, if you suffer from shoulder problems, you may want to stay away from upright rows and substitute by some form of lateral raises.</p>\r\n\r\n<p><strong>Variations:</strong> This exercise can also be performed using a straight bar attached to a low pulley and it can also be performed using an e-z bar.</p>\n    \n',1,87,88,11,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/standing-dumbbell-upright-row',2,'9.0',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/368/Male/m/368_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/368/Male/m/368_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/368/Female/m/368_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/368/Female/m/368_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (88,'Upright Cable Row','\n        <p>\n        </p><p></p><ol><li>  Grasp a straight bar cable attachment that is attached to a low pulley with a pronated (palms facing your thighs) grip that is slightly less than shoulder width.  The bar should be resting on top of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight.  This will be your starting position.</li>\r\n\r\n	<li>   Use your side shoulders to lift the cable bar as you exhale.  The bar should be close to the body as you move it up.  Continue to lift it until it nearly touches your chin.  <strong>Tip:</strong> Your elbows should drive the motion.  As you lift the bar, your elbows should always be higher than your forearms.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n	<li>  Lower the bar back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li>  Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Be very careful with how much weight you use in this exercise.  Too much weight leads to bad form, which in turn can cause shoulder injury.  I\'ve seen this too many times so please no jerking, swinging and cheating.  Also, if you suffer from shoulder problems, you may want to stay away from upright rows and substitute by some form of lateral raises.</p>\r\n\r\n<p><strong>Variations:</strong> This exercise can also be performed using a straight or e-z bar.  Another variation is to use dumbbells, though this later exercise should be reserved by the most advanced people that are well familiarized with correct execution.</p>\n    \n',1,89,90,12,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/upright-cable-row',2,'8.4',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/71/Male/m/71_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/71/Male/m/71_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/71/Female/m/71_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/71/Female/m/71_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (89,'Upright Row - With Bands','\n        <p>\n        </p><p></p><ol><li>  To begin, stand on an exercise band so that tension begins at arm\'s length.  Grasp the handles using a pronated (palms facing your thighs) grip that is slightly less than shoulder width.  The handles should be resting on top of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight.  This will be your starting position.</li>\r\n\r\n	<li>   Use your side shoulders to lift the handles as you exhale.  The handles should be close to the body as you move them up.  Continue to lift the handles until they nearly touches your chin.  <strong>Tip:</strong> Your elbows should drive the motion.  As you lift the handles, your elbows should always be higher than your forearms.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n	<li>  Lower the handles back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li>  Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed using a straight or e-z bar.  Another variation is to use dumbbells, though this later exercise should be reserved by the most advanced people that are well familiarized with correct execution.</p>\n    \n',1,91,92,13,2,52,'http://www.bodybuilding.com/exercises/detail/view/name/upright-row-with-bands',2,'6.8',2,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/261/Male/m/261_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/261/Male/m/261_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/261/Female/m/261_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/261/Female/m/261_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/11.gif'),
 (90,'Shoulders','',1,556,577,2,1,24,'',0,'0.0',0,0,NULL,NULL),
 (91,'Arm Circles','\n        <p>\n        </p><p></p><ol><li>Stand up and extend your arms straight out by the sides.  The arms should be parallel to the floor and perpendicular (90-degree angle) to your torso.  This will be your starting position.</li>\r\n\r\n<li>Slowly start to make circles of about 1 foot in diameter with each outstretched arm. Breathe normally as you perform the movement.</li>\r\n\r\n<li>Continue the circular motion of the outstretched arms for about ten seconds. Then reverse the movement, going the opposite direction.</li>\r\n</ol><p><strong>Tip:</strong> Ten second movements equal one set and each circle equals one repetition.</p>\r\n\r\n<p><strong>Variations:</strong> As you get stronger you can use some light resistance.</p>\n    \n',1,557,558,0,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/arm-circles',1,'5.2',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/497/Male/m/497_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/497/Male/m/497_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/497/Male/m/497_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/497/Female/m/497_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/497/Female/m/497_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (92,'Chair Upper Body Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Sit on the edge of a chair, gripping the back of it.</li>\r\n<li> Straighten your arms, keeping your back straight, and  pull your upper body forward so you feel a stretch. Hold for 20-30 seconds.</li>\r\n</ol>\n',1,559,560,1,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/chair-upper-body-stretch',3,'2.4',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/485/Male/m/485_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/485/Male/m/485_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/485/Female/m/485_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/485/Female/m/485_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (93,'Elbow Circles','\n        <p>\n        </p><p>\r\n</p><ol><li>Sit or stand with your feet slightly apart.</li>\r\n<li> Place your hands on your shoulders with your elbows at shoulder level and pointing out.</li>\r\n<li> Slowly make a circle with your elbows. Breathe out as you start the circle and breathe in as you complete the circle.</li>\r\n</ol>\n',1,561,562,2,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/elbow-circles',1,'4.7',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Male/m/498_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Male/m/498_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Female/m/498_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Female/m/498_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Female/m/498_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/498/Female/m/498_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (94,'Round The World Shoulder Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Stand up straight with your legs together, holding a bodybar or broomstick.</li>\r\n<li> Hold the pole behind your hips with a wider than shoulder width grip. Your palms should be down and your thumbs facing out.</li>\r\n<li> Slowly lift your arms up behind your head. Don\'t force it if it gets hard to lift further.</li>\r\n</ol>\n',1,563,564,3,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/round-the-world-shoulder-stretch',3,'3.0',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/435/Male/m/435_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/435/Male/m/435_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/435/Female/m/435_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/435/Female/m/435_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (95,'Seated Front Deltoid','\n        <p>\n        </p><p>\r\n</p><ol><li>Sit upright on the floor with your legs bent, your partner standing behind you. Stick your arms straight out to your sides, with your palms facing the ground. Attempt to move them as far behind you as possible, as your assistant holds your wrists. This will be your starting position. </li>\r\n<li>Keeping your elbows straight, attempt to move your arms to the front, with your partner gently restraining you to prevent any actual movement for 10-20 seconds.</li>\r\n<li> Now, relax your muscles and allow your partner to gently increase the stretch on the shoulders and chest. Hold for 10 to 20 seconds.</li>\r\n</ol>\n',1,565,566,4,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/seated-front-deltoid',3,'3.3',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/619/Male/m/619_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/619/Male/m/619_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/619/Female/m/619_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/619/Female/m/619_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (96,'Shoulder Circles','\n        <p>\n        </p><p>\r\n</p><ol><li>With shoulders relaxed and arms resting loosely at your sides (or in your lap if you\'re seated), gently roll your shoulders forward, up, back, and down.</li>\r\n<li> Reverse direction. You can do this exercise alternating shoulders or both at the same time.</li>\r\n</ol>\n',1,567,568,5,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/shoulder-circles',3,'0.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Male/m/496_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Male/m/496_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Female/m/496_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Female/m/496_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Female/m/496_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/496/Female/m/496_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (97,'Shoulder Raise','\n        <p>\n        </p><p>\r\n</p><ol><li>Relax your arms to your sides and raise your shoulders up toward your ears, then back down.</li>\r\n</ol>\n',1,569,570,6,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/shoulder-raise',3,'0.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/492/Male/m/492_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/492/Male/m/492_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/492/Female/m/492_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/492/Female/m/492_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (98,'Shoulder Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Reach your left arm across your body and hold it straight.</li>\r\n With your right hand, grasp your left elbow and pull it across your body towards your chest.\r\n</ol>\n',1,571,572,7,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/shoulder-stretch',3,'0.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Male/m/449_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Male/m/449_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Female/m/449_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Female/m/449_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Female/m/449_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/449/Female/m/449_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (99,'Side Wrist Pull','\n        <p>\n        </p><p>\r\n</p><ol><li>This stretch works best standing. Cross your left arm over the midline of your body and hold the left wrist in your right hand down at the level of your hips. Start the stretch with a bent left arm.</li>\r\n<li> Slowly straighten, pull, and lift it up to shoulder height, as pictured. Feel this stretch originate in your back, not your shoulders, and don\'t pull too hard on the shoulders joint. Switch sides.</li>\r\n</ol>\n',1,573,574,8,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/side-wrist-pull',1,'0.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/442/Male/m/442_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/442/Male/m/442_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/442/Female/m/442_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/442/Female/m/442_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (100,'Upward Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Extend both hands straight above your head, palms touching.</li>\r\n<li> Slowly push your hands up and back, keeping your back straight.</li>\r\n</ol>\n',1,575,576,9,2,90,'http://www.bodybuilding.com/exercises/detail/view/name/upward-stretch',3,'5.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/466/Male/m/466_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/466/Male/m/466_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/466/Female/m/466_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/466/Female/m/466_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (101,'Alternating Deltoid Raise','\n        <p>\n        </p><p>\r\n</p><ol><li>In a standing positin, hold a pair of dumbbells at your side.</li>\r\n<li> Keeping your elbows slightly bent, raise the weights directly in front of you to shoulder height, avoiding any swinging or cheating.</li>\r\n<li> Return the weights to your side.</li>\r\n<li> On the next repetition, raise the weights laterally, raising them out to your side to about shoulder height.</li>\r\n<li> Return the weights to the starting position and continue alternating to the front and side.\r\n</li>\r\n</ol>\n',0,95,96,30,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/alternating-deltoid-raise',1,'8.9',4,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Male/m/880_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Male/m/880_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Male/m/880_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Male/m/880_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Female/m/880_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Female/m/880_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Female/m/880_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/880/Female/m/880_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (102,'Alternating Hang Clean','\n        <p>\n        </p><p>\r\n</p><ol><li>Place two kettlebells between your feet. To get in the starting position, push your butt back and look straight ahead.</li>\r\n<li> Clean one kettlebell to your shoulder and hold on to the other kettlebell in a hanging position. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulders. \r\nRotate your wrist as you do so.</li> <li>Lower the cleaned kettlebell to a hanging position and clean the alternate kettlebell. Repeat. </li>\r\n</ol>\n',0,97,98,40,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/alternating-hang-clean',2,'3.7',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Male/m/544_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Male/m/544_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Male/m/544_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Female/m/544_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Female/m/544_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/544/Female/m/544_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (103,'Alternating Kettlebell Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you pull the kettlebells towards your shoulders. Rotate your wrists as you do so.</li>\r\n<li> Press one directly overhead by extending through the elbow, turning it so the palm faces forward while holding the other kettlebell stationary .</li>\r\n<li> Lower the pressed kettlebell to the starting position and immediately press with  your other arm.</li>\r\n</ol>\n',0,99,100,50,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/alternating-kettlebell-press',2,'7.8',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Male/m/504_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Male/m/504_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Male/m/504_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Female/m/504_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Female/m/504_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/504/Female/m/504_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (104,'Arnold Dumbbell Press','\n        <p>\n        </p><p></p><ol><li>Sit on an exercise bench with back support and hold two dumbbells in front of you at about upper chest level with your palms facing your body and your elbows bent. <strong>Tip:</strong> Your arms should be next to your torso.  The starting position should look like the contracted portion of a dumbbell curl.</li>\r\n\r\n<li>Now to perform the movement, raise the dumbbells as you rotate the palms of your hands  until they are facing forward.</li>\r\n\r\n<li>Continue lifting the dumbbells until your arms are extended above you in straight arm position.  Breathe out as you perform this portion of the movement.</li>\r\n\r\n<li>After a second pause at the top, begin to lower the dumbbells to the original position by rotating the palms of your hands towards you.  <strong>Tip:</strong> The left arm will be rotated in a counter clockwise manner while the right one will be rotated clockwise.  Breathe in as you perform this portion of the movement.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform the exercise standing up but that is not recommended for people with lower back issues.</p>\n    \n',0,101,102,60,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/arnold-dumbbell-press',2,'8.6',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/82/Male/m/82_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/82/Male/m/82_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/82/Female/m/82_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/82/Female/m/82_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (105,'Back Flyes - With Bands','\n        <p>\n        </p><p></p><ol><li>Run a band around a stationary post like that of a squat rack.</li>\r\n\r\n<li>Grab the band by the handles and stand back so that the tension in the band rises.</li>\r\n\r\n<li>Extend and lift the arms straight in front of you. Tip: Your arms should be straight and parallel to the floor while perpendicular to your torso.  Your feet should be firmly planted on the floor spread at shoulder width.  This will be your starting position.</li>\r\n\r\n<li>As you exhale, move your arms to the sides and back.  Keep your arms extended and parallel to the floor. Continue the movement until the arms are extended to your sides.</li>\r\n\r\n<li>After a pause, go back to the original position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong>  You can perform this exercise on a rear delt machine as well or using a pulley machine.</p>\n    \n',0,103,104,70,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/back-flyes-with-bands',2,'8.5',2,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/253/Male/m/253_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/253/Male/m/253_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/253/Female/m/253_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/253/Female/m/253_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (106,'Barbell Rear Delt Row','\n        <p>\n        </p><p></p><ol><li>Stand up straight while holding a barbell using a wide (higher than shoulder width) and overhand (palms facing your body) grip.</li>\r\n\r\n<li>Bend knees slightly and bend over as you keep the natural arch of your back. Let the arms hang in front of you as they hold the bar. Once your torso is parallel to the floor, flare the elbows out and away from your body.  Tip: Your torso and your arms should resemble the letter \"T\".  Now you are ready to begin the exercise.</li>\r\n\r\n<li>While keeping the upper arms perpendicular to the torso, pull the barbell up towards your upper chest as you squeeze the rear delts and you breathe out.  Tip: When performed correctly, this exercise should resemble a bench press in reverse.  Also, refrain from using your biceps to do the work.  Focus on targeting the rear delts; the arms should only act as hooks.</li>\r\n\r\n<li>Slowly go back to the initial position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise using a smith machine or a T-bar row. You can also use the low pulley as long as you use a wide grip bar attachment.</p>\r\n\n    \n',0,105,106,80,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-rear-delt-row',2,'8.9',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/307/Male/m/307_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/307/Male/m/307_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/307/Female/m/307_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/307/Female/m/307_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (107,'Barbell Shoulder Press','\n        <p>\n        </p><p></p><ol><li> Sit on a bench with back support in a squat rack. Position a barbell at a height that is just above your head.   Grab the barbell with a pronated grip (palms facing forward).</li>\r\n\r\n	<li>  Once you pick up the barbell with the correct grip width, lift the bar up over your head by locking your arms.  Hold at about shoulder level and slightly in front of your head.  This is your starting position.</li>\r\n\r\n	<li> Lower the bar down to the shoulders slowly as you inhale.</li>\r\n\r\n	<li> Lift the bar back up to the starting position as you exhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p> \r\n<p></p><ul><li> This exercise can also be performed standing.</li>\r\n</ul>\n',0,107,108,90,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-shoulder-press',2,'8.7',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/308/Male/m/308_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/308/Male/m/308_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/308/Female/m/308_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/308/Female/m/308_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (108,'Bent Over Dumbbell Rear Delt Raise With Head On Bench','\n        <p>\n        </p><p></p><ol><li>Stand up straight while holding a dumbbell in each hand and with an incline bench in front of you.</li>\r\n\r\n<li>While keeping your back straight and maintaining the natural arch of your back, lean forward until your forehead touches the bench in front of you.  Let the arms hang in front of you perpendicular to the ground. The palms of your hands should be facing each other and your torso should be parallel to the floor. This will be your starting position.</li>\r\n\r\n<li>Keeping your torso forward and stationary, and the arms straight with a slight bend at the elbows, lift the dumbbells straight to the side until both arms are parallel to the floor.  Exhale as you lift the weights.  Caution: avoid swinging the torso or bringing the arms back as opposed to the side.</li>\r\n\r\n<li>After a one second contraction at the top, slowly lower the dumbbells back to the starting position.</li>\r\n\r\n<li>Repeat the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed with cables or seating.</p>\r\n\n    \n',0,111,112,100,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/bent-over-dumbbell-rear-delt-raise-with-head-on-bench',1,'8.6',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/83/Male/m/83_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/83/Male/m/83_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/83/Female/m/83_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/83/Female/m/83_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (109,'Bent Over Low-Pulley Side Lateral','\n        <p>\n        </p><p></p><ol><li>Select a weight and hold the handle of the low pulley with your right hand.</li>\r\n\r\n<li>Bend at the waist until your torso is nearly parallel to the floor. Your legs should be slightly bent with your left hand placed on your lower left thigh.  Your right arm should be hanging from your shoulder in front of you and with a slight bend at the elbow. This will be your starting position.</li>\r\n\r\n<li>Raise your right arm, elbow slightly bent, to the side until the arm is parallel to the floor and in line with your right ear. Breathe out as you perform this step.</li>\r\n\r\n<li>Slowly lower the weight back to the starting position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and repeat the movement with the other arm.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with dumbbells or exercise bands.</p>\r\n\n    \n',0,113,114,110,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/bent-over-low-pulley-side-lateral',1,'8.9',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/73/Male/m/73_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/73/Male/m/73_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/73/Female/m/73_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/73/Female/m/73_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (110,'Bradford/Rocky Presses','\n        <p>\n        </p><p></p><ol><li>Sit on a Military Press Bench with a bar at shoulder level with a pronated grip (palms facing forward).  <strong>Tip:</strong> Your grip should be wider than shoulder width and it should create a 90-degree angle between the forearm and the upper arm as the barbell goes down. This is your starting position.</li>\r\n\r\n<li>Once you pick up the barbell with the correct grip, lift the bar up over your head by locking your arms.  </li>\r\n\r\n<li>Now lower the bar down to the back of the head slowly as you inhale.</li>\r\n\r\n<li>Lift the bar back up to the starting position as you exhale.</li>\r\n\r\n<li>Lower the bar down to the starting position slowly as you inhale. This is one repetition.</li>\r\n\r\n<li>Alternate in this manner until you complete the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> For more stress on the shoulders, only lift the bar until it is slightly above the head and then lower to the opposite side.  In this manner you keep more constant tension on the shoulders while minimizing triceps involvement.</p>\r\n\n    \n',0,115,116,120,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/bradfordrocky-presses',2,'8.0',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Male/m/291_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Male/m/291_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Male/m/291_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Female/m/291_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Female/m/291_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/291/Female/m/291_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (111,'Cable Internal Rotation','\n        <p>\n        </p><p></p><ol><li>Sit next to a low pulley sideways (with legs stretched in front of you or crossed) and grasp the single hand cable attachment with the arm nearest to the cable.  <strong>Tip:</strong> If you can adjust the pulley&acirc;&#128;&#153;s height, you can use a flat bench to sit on instead.</li>\r\n\r\n<li>Position the elbow against your side with the elbow bent at 90&Acirc;&deg; and the arm pointing towards the pulley.  This will be your starting position.</li>\r\n\r\n<li>Pull the single hand cable attachment toward your body by internally rotating your shoulder until your forearm is across your abs.  You will be creating an imaginary semi-circle.  <strong>Tip:</strong> The forearm should be perpendicular to your torso at all times.</li>\r\n\r\n<li>Slowly go back to the initial position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and then repeat the movement with the next arm.</li>\r\n</ol><p><strong>Caution:</strong> Do not use heavy weights for this exercise as if you use too much you risk rotator cuff injury.</p>\r\n\r\n<p><strong>Variations:</strong> You can use dumbbells for this movement as well as exercise bands.</p>\r\n\n    \n',0,117,118,130,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/cable-internal-rotation',2,'8.6',1,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/315/Male/m/315_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/315/Male/m/315_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/315/Female/m/315_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/315/Female/m/315_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (112,'Cable Rope Rear-Delt Rows','\n        <p>\n        </p><p></p><ol><li> Sit in the same position on a low pulley row station as you would if you were doing seated cable rows for the back.</li>\r\n\r\n	<li> Attach a rope to the pulley and grasp it with an overhand grip.  Your arms should be extended and parallel to the floor with the elbows flared out.</li>\r\n\r\n	<li> Keep your lower back upright and slide your hips back so that your knees are slightly bent.  This will be your starting position.</li>\r\n\r\n	<li> Pull the cable attachment towards your upper chest, just below the neck, as you keep your elbows up and out to the sides.  Continue this motion as you exhale until the elbows travel slightly behind the back. <strong>Tip:</strong> Keep your upper arms horizontal, perpendicular to the torso and parallel to the floor throughout the motion.</li>\r\n\r\n	<li> Go back to the initial position where the arms are extended and the shoulders are stretched forward. Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can also perform this exercise using exercise bands or dumbbells.  You can also perform this movement standing in front of a high pulley.</p>\n    \n',0,119,120,140,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/cable-rope-rear-delt-rows',2,'8.9',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/299/Male/m/299_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/299/Male/m/299_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/299/Female/m/299_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/299/Female/m/299_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (113,'Cable Seated Lateral Raise','\n        <p>\n        </p><p></p><ol><li> Stand in the middle of two low pulleys that are opposite to each other and place a flat bench right behind you (in perpendicular fashion to you; the narrow edge of the bench should be the one behind you).  Select the weight to be used on each pulley.</li>\r\n\r\n	<li> Now sit at the edge of the flat bench behind you with your feet placed in front of your knees.</li>\r\n\r\n	<li> Bend forward while keeping your back flat and rest your torso on the thighs.</li>\r\n\r\n	<li> Have someone give you the single handles attached to the pulleys.  Grasp the left pulley with the right hand and the right pulley with the left after you select your weight. The pulleys should run under your knees and your arms will be extended with palms facing each other and a slight bend at the elbows.  This will be the starting position.</li>\r\n\r\n	<li> While keeping the arms stationary, raise the upper arms to the sides until they are parallel to the floor and at shoulder height.  Exhale during the execution of this movement and hold the contraction for a second.</li>\r\n\r\n	<li> Slowly lower your arms to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions. <strong>Tip:</strong> Maintain upper arms perpendicular to torso and a fixed elbow position (10 degree to 30 degree angle) throughout exercise.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with exercise bands or dumbbells.</p>\n    \n',0,121,122,150,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/cable-seated-lateral-raise',1,'8.7',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/79/Male/m/79_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/79/Male/m/79_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/79/Female/m/79_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/79/Female/m/79_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif');
INSERT INTO `exercise_type` (`type_id`,`name`,`description`,`form_type`,`tree_left`,`tree_right`,`tree_order`,`tree_level`,`tree_parent_id`,`link`,`mechanics_type`,`rating`,`force_type`,`equipment`,`type_img`,`guide_img`) VALUES 
 (114,'Cable Shoulder Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Move the cables to the bottom of the towers and select an appropriate weight.</li>\r\n<li> Stand directly in between the uprights. Grasp the cables and hold them at shoulder height, palms facing forward. This will be your starting position.</li>\r\n<li> Keeping your head and chest up, extend through the elbow to press the handles directly over head.</li>\r\n<li> After pausing at the top, return to the starting position and repeat.\r\n</li>\r\n</ol>\n',0,123,124,160,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/cable-shoulder-press',2,'0.0',1,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/848/Male/m/848_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/848/Male/m/848_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/848/Female/m/848_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/848/Female/m/848_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (115,'Circus Bell','\n        <p>\n        </p><p>\r\n</p><ol><li>The circus bell is an oversized dumbbell with a thick handle. Begin with the dumbbell between your feet, and grip the handle with both hands.</li>\r\n<li> Clean the dumbbell by extending through your hips and knees to deliver the implement to the desired shoulder, letting go with the extra hand.</li>\r\n<li> Ensure that you get one of the dumbbell heads behind the shoulder to keep from being thrown off balance. To raise it overhead, dip by flexing the knees, and the drive upwards as you extend the dumbbell overhead, leaning slightly away from it as you do so.</li>\r\n<li> Carefully guide the bell back to the floor, keeping it under control as much as possible. It is best to perform this event on a thick rubber mat to prevent damage to the floor. </li>\r\n</ol>\n',0,125,126,170,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/circus-bell',2,'9.1',1,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Male/m/668_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Male/m/668_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Male/m/668_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Male/m/668_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Female/m/668_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Female/m/668_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/668/Female/m/668_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (116,'Clean and Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>With a barbell on the floor close to the shins, take an overhand or hook grip just outside the legs. Lower your hips with the weight focused on the heels, back  straight, head facing forward, chest up, with your shoulders just in front of the bar. This will be your starting position. </li>\r\n<li> Begin the first pull by driving through the heels, extending your knees. Your back angle should stay the same, and your arms should remain straight. Move the weight with control as you continue to above the knees.</li>\r\n<li> Next comes the second pull, the main source of acceleration for the clean. As the bar approaches the mid-thigh position, begin extending through the hips. In a jumping motion, accelerate by extending the hips, knees, and ankles, using speed to move the bar upward. There should be no need to actively pull through the arms to accelerate the weight; at the end of the second pull, the body should be fully extended, leaning slightly back, with the arms still extended.</li>\r\n<li> As full extension is achieved, transition into the third pull by aggressively shrugging and flexing the arms with the elbows up and out. At peak extension, aggressively pull yourself down, rotating your elbows under the bar as you do so. Receive the bar in a front squat position, the depth of which is dependent upon the height of the bar at the end of the third pull. The bar should be racked onto the protracted shoulders, lightly touching the throat with the hands relaxed. Continue to descend to the bottom squat position, which will help in the recovery.  </li>\r\n<li>Immediately recover by driving through the heels, keeping the torso upright and elbows up. Continue until you have risen to a standing position. </li>\r\n<li> The second phase is the jerk, which raises the weight overhead. Standing with the weight racked on the front of the shoulders, begin with the dip. With your feet directly under your hips, flex the knees without moving the hips backward. Go down only slightly, and reverse direction as powerfully as possible.</li>\r\n<li> Drive through the heels create as much speed and force as possible, and be sure to move your head out of the way as the bar leaves the shoulders.</li>\r\n<li> At this moment as the feet leave the floor, the feet must be placed into the receiving position as quickly as possible. In the brief moment the feet are not actively driving against the platform, the athletes effort to push the bar up will drive them down. The feet should be split, with one foot forward, and one foot back. Receive the bar with the arms locked out overhead. Return to a standing position. </li>\r\n</ol>\n',0,127,128,180,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/clean-and-jerk',2,'9.5',4,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Male/m/670_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Male/m/670_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Male/m/670_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Male/m/670_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Female/m/670_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Female/m/670_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Female/m/670_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/670/Female/m/670_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (117,'Crucifix','\n        <p>\n        </p><p>\r\n</p><ol><li>In the crucifix, you statically hold weights out to the side for time. While the event can be practiced using dumbbells, it is best to practice with one of the various implements used, such as axes and hammers, as it feels different.</li>\r\n<li> Begin standing, and raise your arms out to the side holding the implements. Your arms should be parallel to the ground. In competition, judges or sensors are used to let you know when you break parallel. Hold for as long as you can. Typically, the weights should be heavy enough that you fail in 30-60 seconds.</li>\r\n</ol>\n',0,129,130,190,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/crucifix',1,'0.0',3,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/675/Male/m/675_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/675/Male/m/675_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/675/Female/m/675_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/675/Female/m/675_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (118,'Cuban Press','\n        <p>\n        </p><p></p><ol><li> From a seated or standing position, hold a dumbbell in each hand with your shoulders rotated forward. Your arms should be fully extended next to your thighs with only a slight bend at the elbows and with the palms of your hands facing your thighs.  This will be your starting position.</li>\r\n\r\n	<li> Begin the movement by lifting the elbows up, as if performing a dumbbell upright row, until they are at shoulder height.  <strong>Tip:</strong> The torso and the upper arm should resemble the letter \"T\". Exhale as you perform this movement.</li>\r\n\r\n	<li> Once you reach this position, inhale and then externally rotate the dumbbells up while keeping the upper arms in the same level and exhaling.  Continue this movement until the forearms are perpendicular to the floor and the hands are pointing towards the ceiling. Inhale once you complete this movement.</li>\r\n\r\n	<li> Now press the dumbbells up over your head as if performing a shoulder press as you exhale.</li>\r\n\r\n	<li> Go back to the initial position as you breathe in by reversing the steps.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> You can also use a barbell.</p>\n    \n',0,131,132,200,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/cuban-press',2,'6.9',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Male/m/199_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Male/m/199_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Male/m/199_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Male/m/199_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Female/m/199_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Female/m/199_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Female/m/199_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/199/Female/m/199_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (119,'Double Kettlebell Alternating Hang Clean','\n        <p>\n        </p><p>\r\n</p><ol><li>Place two kettlebells between your feet. To get in the starting position, push your butt back and look straight ahead.</li>\r\n<li> Clean one kettlebell to your shoulder and hold on to the other kettlebell.</li>\r\n<li> With a fluid motion, lower the top kettlebell while driving the bottom kettlebell up. </li>\r\n</ol>\n',0,133,134,210,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/double-kettlebell-alternating-hang-clean',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Male/m/553_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Male/m/553_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Male/m/553_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Female/m/553_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Female/m/553_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/553/Female/m/553_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (120,'Double Kettlebell Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell by the handle in each hand.</li>\r\n<li> Clean the kettlebells to your shoulders by extending through the legs and hips as you pull the kettlebells towards your shoulders. Rotate your wrists as you do so, so that the palms face forward. This will be your starting position.</li>\r\n<li> Dip your body by bending the knees, keeping your torso upright.</li>\r\n<li> Immediately reverse direction, driving through the heels, in essence jumping to create momentum.</li>\r\n<li> As you do so, press the kettlebells overhead to lockout by extending the arms, using your body\'s momentum to move the weights.</li>\r\n<li> Return your feet to the ground in a split fashion, with one foot forward and one foot back.</li>\r\n<li> Keeping the weights overhead, return to a standing position, bringing your feet together. Lower the weights to perform the next repetition.</li>\r\n</ol>\n',0,135,136,220,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/double-kettlebell-jerk',2,'6.5',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/557/Male/m/557_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/557/Male/m/557_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/557/Male/m/557_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/557/Female/m/557_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/557/Female/m/557_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (121,'Double Kettlebell Push Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells to your shoulders. </li>\r\n<li>Squat down a few inches and reverse the motion rapidly. Use the momentum from the legs to drive the\r\nkettlebells overhead.</li>\r\n<li> Once the kettlebells are locked out, lower the kettlebells to your shoulders and repeat.</li>\r\n</ol>\n',0,137,138,230,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/double-kettlebell-push-press',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Male/m/532_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Male/m/532_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Male/m/532_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Female/m/532_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Female/m/532_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/532/Female/m/532_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (122,'Double Kettlebell Snatch','\n        <p>\n        </p><p>\r\n</p><ol><li>Place two kettlebells behind your feet. Bend your knees and sit back to pick up the kettlebells.</li>\r\n<li> Swing the kettlebells between your legs forcefully and reverse the direction.</li>\r\n<li> Drive through with your hips and lock the ketttlebells overhead in one uninterrupted motion. </li>\r\n</ol>\n',0,139,140,240,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/double-kettlebell-snatch',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Male/m/535_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Male/m/535_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Male/m/535_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Female/m/535_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Female/m/535_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/535/Female/m/535_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (123,'Dumbbell Incline Shoulder Raise','\n        <p>\n        </p><p></p><ol><li>Sit on an Incline Bench while holding a dumbbell on each hand on top of your thighs.</li>\r\n\r\n<li>Lift your legs up to kick the weights to your shoulders and lean back. Position the dumbbells above your shoulders with your arms extended.  The arms should be perpendicular to the floor with your palms facing forward and knuckles pointing towards the ceiling.  This will be your starting position.</li>\r\n\r\n<li>While keeping the arms straight and locked, lift the dumbbells by raising the shoulders from the bench as you breathe out.</li>\r\n\r\n<li>Bring back the dumbbells to the starting position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p>\r\n<strong>Variations:</strong> You can use a barbell or a smith machine in order to perform this exercise.\r\n</p>\n    \n',0,141,142,250,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-incline-shoulder-raise',1,'7.8',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/318/Male/m/318_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/318/Male/m/318_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/318/Female/m/318_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/318/Female/m/318_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (124,'Dumbbell Lying One-Arm Rear Lateral Raise','\n        <p>\n        </p><p></p><ol><li>While holding a dumbbell in one hand, lay with your chest down on a slightly inclined (around 15 degrees when measured from the floor) adjustable bench.  The other hand can be used to hold to the leg of the bench for stability.</li>\r\n\r\n<li>Position the palm of the hand that is holding the dumbbell in a neutral manner (palms facing your torso) as you keep the arm extended with the elbow slightly bent.  This will be your starting position.</li>\r\n\r\n<li>Now raise the arm with the dumbbell to the side until your elbow is at shoulder height and your arm is roughly parallel to the floor as you exhale. Tip: Maintain your arm perpendicular to the torso while keeping your arm extended throughout the movement.  Also, keep the contraction at the top for a second.</li>\r\n\r\n<li>Slowly lower the dumbbell to the starting position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p>\r\n<strong>Variations:</strong> You can perform this exercise with both arms at the same time and also keeping the palms of the hands facing back as opposed to facing your torso.\r\n</p>\n    \n',0,147,148,260,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-lying-one-arm-rear-lateral-raise',1,'9.3',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/319/Male/m/319_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/319/Male/m/319_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/319/Female/m/319_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/319/Female/m/319_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (125,'Dumbbell Lying Rear Lateral Raise','\n        <p>\n        </p><p></p><ol><li> While holding a dumbbell in each hand, lay with your chest down on a slightly inclined (around 15 degrees when measured from the floor) adjustable bench.</li>\r\n\r\n	<li> Position the palms of the hands in a neutral manner (palms facing your torso) as you keep the arms extended with the elbows slightly bent.  This will be your starting position.</li>\r\n\r\n	<li> Now raise the arms to the side until your elbows are at shoulder height and your arms are roughly parallel to the floor as you exhale. <strong>Tip:</strong> Maintain your arms perpendicular to the torso while keeping them extended throughout the movement.  Also, keep the contraction at the top for a second.</li>\r\n\r\n	<li> Slowly lower the dumbbells to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions and then switch to the other arm.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with just one arm and also keeping the palms of the hands facing back as opposed to facing your torso.</p>\n    \n',0,149,150,270,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-lying-rear-lateral-raise',1,'8.5',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/322/Male/m/322_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/322/Male/m/322_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/322/Female/m/322_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/322/Female/m/322_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (126,'Dumbbell One-Arm Shoulder Press','\n        <p>\n        </p><p></p><ol><li>Grab a dumbbell and either sit on a military press bench or a utility bench that has a back support on it as you place the dumbbells upright on top of your thighs or stand up straight.</li>\r\n\r\n<li>Clean the dumbbell up to bring it to shoulder height.  The other hand can be kept fully extended to the side, by the waist or grabbing a fixed surface.</li>\r\n\r\n<li>Rotate the wrist so that the palm of your hand is facing forward.  This is your starting position.</li>\r\n\r\n<li>As you exhale, push the dumbbell up until your arm is fully extended.</li>\r\n\r\n<li>After a second pause, slowly come down back to the starting position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and then switch arms.</li>\r\n</ol><p>\r\n<strong>Variations:</strong> You can perform the exercise standing or sitting on a regular flat bench.  For people with lower back problems, the version described is the recommended one.\r\n</p>\r\n<p>\r\nYou can also perform the exercise as Arnold Schwarzenegger used to do it, which is to start holding the dumbbells with a supinated grip (palms facing you) in front of your shoulders and then, as you start pushing up, you align the dumbbells in the starting position described on step 3 by rotating your wrists and touch the dumbbells at the top.  As you come down, then you would go back to the starting position by rotating the wrist throughout the lowering portion until the palms of your hands are facing you.  This variation is called the Arnold Press.  However, it is not recommended if you have rotator cuff problems.\r\n</p>\n    \n',0,151,152,280,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-one-arm-shoulder-press',2,'8.5',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/337/Male/m/337_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/337/Male/m/337_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/337/Female/m/337_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/337/Female/m/337_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (127,'Dumbbell One-Arm Upright Row','\n        <p>\n        </p><p></p><ol><li>Grab a dumbbell and stand up straight with your arm extended in front of you with a slight bend at the elbows and your back straight.  This will be your starting position. <strong>Tip:</strong> The dumbbell should be resting on top of your thigh with the palm of your hands facing your thighs.</li>\r\n\r\n<li>Keep the other hand can be kept fully extended to the side, by the waist or grabbing a fixed surface. This will be your starting position.</li>\r\n\r\n<li>Use your side shoulders to lift the dumbbell as you exhale.  The dumbbell should be close to the body as you move it up.  Continue to lift it until the dumbbell is nearly in line with your chin.  Tip: Your elbows should drive the motion.  As you lift the dumbbell, your elbow should always be higher than your forearm.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n<li>Lower the dumbbell back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and switch arms.</li>\r\n</ol><p>\r\n<strong>Caution:</strong> Be very careful with how much weight you use in this exercise.  Too much weight leads to bad form, which in turn can cause shoulder injury.  I\'ve seen this too many times so please no jerking, swinging and cheating.  Also, if you suffer from shoulder problems, you may want to stay away from upright rows and substitute by some form of lateral raises.\r\n</p>\r\n<p>\r\n<strong>Variations:</strong> This exercise can also be performed using a straight bar attached to a low pulley and it can also be performed using an e-z bar, cables and exercise band.\r\n</p>\n    \n',0,153,154,290,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-one-arm-upright-row',2,'7.3',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/325/Male/m/325_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/325/Male/m/325_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/325/Female/m/325_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/325/Female/m/325_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (128,'Dumbbell Raise','\n        <p>\n        </p><p></p><ol><li>Grab a dumbbell in each arm and stand up straight with your arms extended by your sides with a slight bend at the elbows and your back straight.  This will be your starting position. <strong>Tip:</strong> The dumbbell should be next to your thighs with the palm of your hands facing back.</li>\r\n\r\n<li>Use your side shoulders to lift the dumbbells as you exhale.  The dumbbells should be to the side of the body as you move them up.  Continue to lift it until the dumbbells are nearly in line with your chin.  <strong>Tip:</strong> Your elbows should drive the motion.  As you lift the dumbbell, your elbow should always be higher than your forearm.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n<li>Lower the dumbbells back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p>\r\n<strong>Caution:</strong> Be very careful with how much weight you use in this exercise.  Too much weight leads to bad form, which in turn can cause shoulder injury.  I\'ve seen this too many times so please no jerking, swinging and cheating.  Also, if you suffer from shoulder problems, you may want to stay away from this movement and substitute by some form of lateral raises.\r\n</p>\r\n<p>\r\n<strong>Variations:</strong> This exercise can also be performed using a straight bar attached to a low pulley and it can also be performed using an e-z bar, cables and exercise band.\r\n</p>\n    \n',0,155,156,300,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-raise',2,'8.3',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/327/Male/m/327_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/327/Male/m/327_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/327/Female/m/327_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/327/Female/m/327_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (130,'External Rotation','\n        <p>\n        </p><p></p><ol><li>Lie sideways on a flat bench with one arm holding a dumbbell and the other hand on top of the bench folded so that you can rest your head on it.</li>\r\n\r\n<li>Bend the elbows of the arm holding the dumbbell so that it creates a 90-degree angle between the upper arm and the forearm.  <strong>Tip:</strong> Keep the arm parallel to your torso.</li>\r\n\r\n<li>Now bend the elbow while keeping the upper arm stationary.  In this manner, the forearm will be parallel to the floor and perpendicular to your torso (Tip: So the forearm will be directly in front of you).  The upper arm will be stationary by your torso and should be parallel to the floor (aligned with your torso at all times).  This will be your starting position.</li>\r\n\r\n<li>As you breathe out, externally rotate your forearm so that the dumbbell is lifted up in a semicircle motion as you maintain the 90 degree angle bend between the upper arms and the forearm.  You will continue this external rotation until the forearm is perpendicular to the floor and the torso pointing towards the ceiling.  At this point you will hold the contraction for a second.</li>\r\n\r\n<li>As you breathe in, slowly go back to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and then switch to the other arm.</li>\r\n</ol><p><strong>Caution:</strong> There is no need to go heavy with this exercise.  Too much weight will cause rotator cuff injury.</p>\r\n\r\n<p><strong>Variations:</strong> You can perform this exercise standing and with cables.</p>\n    \n',0,161,162,320,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/external-rotation',1,'8.9',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/232/Male/m/232_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/232/Male/m/232_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/232/Female/m/232_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/232/Female/m/232_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (131,'External Rotation with Band','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nChoke the band around a post. The band should be at the same height as your elbow. Stand with your left side to the band a couple of feet away.</li>\r\n<li> Grasp the end of the band with your right hand, and keep your elbow pressed firmly to your side. We recommend you hold a pad or foam roll in place with your elbow to keep it firmly in position.</li>\r\n<li> With your upper arm in position, your elbow should be flexed to 90 degrees with your hand reaching across the front of your torso. This will be your starting position.</li>\r\n<li> Execute the movement by rotating your arm in a backhand motion, keeping your elbow in place.</li>\r\n<li> Continue as far as you are able, pause, and then return to the starting position. \r\n</li>\r\n</ol>\n',0,163,164,330,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/external-rotation-with-band',2,'0.0',4,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/868/Male/m/868_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/868/Male/m/868_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/868/Female/m/868_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/868/Female/m/868_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (132,'External Rotation with Cable','\n        <p>\n        </p><p>\r\n</p><ol><li>Adjust the cable to the same height as your elbow. Stand with your left side to the band a couple of feet away.</li>\r\n<li> Grasp the handle with your right hand, and keep your elbow pressed firmly to your side. We recommend you hold a pad or foam roll in place with your elbow to keep it firmly in position. </li>\r\n<li>With your upper arm in position, your elbow should be flexed to 90 degrees with your hand reaching across the front of your torso. This will be your starting position.</li>\r\n<li> Execute the movement by rotating your arm in a backhand motion, keeping your elbow in place. </li>\r\nContinue as far as you are able, pause, and then return to the starting position. \r\n\r\n</ol>\n',0,165,166,340,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/external-rotation-with-cable',1,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/869/Male/m/869_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/869/Male/m/869_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/869/Female/m/869_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/869/Female/m/869_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (133,'Face Pull','\n        <p>\n        </p><p>\r\n</p><ol><li>Facing a high pulley with a rope or dual handles attached, pull the weight directly towards your face, separating your hands as you do so. Keep your upper arms parallel to the ground.</li>\r\n</ol>\n',0,167,168,350,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/face-pull',2,'8.8',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/681/Male/m/681_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/681/Male/m/681_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/681/Female/m/681_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/681/Female/m/681_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (134,'Front Cable Raise','\n        <p>\n        </p><p></p><ol><li>Select the weight on a low pulley machine and grasp the single hand cable attachment that is attached to the low pulley with your left hand.</li>\r\n\r\n<li>Face away from the pulley and put your arm straight down with the hand cable attachment in front of your thighs at arms\' length with the palms of the hand facing your thighs.  This will be your starting position.</li>\r\n\r\n<li>While maintaining the torso stationary (no swinging), lift the left arm to the front with a slight bend on the elbow and the palms of the hand always faces down.  Continue to go up until you arm is slightly above parallel to the floor.  Exhale as you execute this portion of the movement and pause for a second at the top.</li>\r\n \r\n<li>Now as you inhale lower the arm back down slowly to the starting position.</li>\r\n \r\n<li>Once all of the recommended amount of repetitions have been performed for this arm, switch arms and perform the exercise with the right one.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can be performed also with dumbbells or an exercise band.</p>\r\n\n    \n',0,169,170,360,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/front-cable-raise',1,'8.6',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/75/Male/m/75_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/75/Male/m/75_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/75/Female/m/75_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/75/Female/m/75_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (136,'Front Incline Dumbbell Raise','\n        <p>\n        </p><p></p><ol><li>Sit down on an incline bench with the incline set anywhere between 30 to 60 degrees while holding a dumbbell on each hand. Tip: You can change the angle to hit the muscle a little differently each time.</li>\r\n\r\n<li>Extend your arms straight in front of you and have your palms facing down with the dumbbells raised about 1 inch above your thighs.  This will be your starting position.</li>\r\n\r\n<li>Slowly raise the dumbbells straight up until they are slightly above your shoulders, while keeping your elbows locked. Squeeze at the top for a second and make sure you breathe out during this portion of the movement.  <strong>Tip:</strong> Keep your head resting down against the bench and your legs on the floor at all times.</li>\r\n\r\n<li>Lower the arms back to the starting position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can use a barbell as well for this exercise.</p>\n    \n',0,173,174,380,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/front-incline-dumbbell-raise',1,'9.1',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/231/Male/m/231_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/231/Male/m/231_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/231/Female/m/231_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/231/Female/m/231_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (137,'Front Plate Raise','\n        <p>\n        </p><p></p><ol><li>While standing straight, hold a barbell plate in both hands at the 3 and 9 o\'clock positions. Your palms should be facing each other and your arms should be extended and locked with a slight bend at the elbows and the plate should be down near your waist in front of you as far as you can go.  <strong>Tip:</strong> The arms will remain in this position throughout the exercise.  This will be your starting position.</li>\r\n\r\n<li>Slowly raise the plate as you exhale until it is a little above shoulder level. Hold the contraction for a second. <strong>Tip:</strong> make sure that you do not swing the weight or bend at the elbows.  Your torso should remain stationary throughout the movement as well.</li>\r\n\r\n<li>As you inhale, slowly lower the plate back down to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can use dumbbells, barbells, cables or exercise bands to perform this movement.</p>\r\n\n    \n',0,175,176,390,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/front-plate-raise',1,'8.3',1,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/230/Male/m/230_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/230/Male/m/230_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/230/Female/m/230_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/230/Female/m/230_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (138,'Front Two-Dumbbell Raise','\n        <p>\n        </p><p></p><ol><li>Pick a couple of dumbbells and stand with a straight torso and the dumbbells on front of your thighs at arms length with the palms of the hand facing your thighs.  This will be your starting position.</li>\r\n\r\n<li>While maintaining the torso stationary (no swinging), lift the dumbbells to the front with a slight bend on the elbow and the palms of the hands always facing down.  Continue to go up until you arms are slightly above parallel to the floor.  Exhale as you execute this portion of the movement and pause for a second at the top.</li>\r\n\r\n<li>As you inhale, lower the dumbbells back down slowly to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed by alternating hands, meaning doing one repetition with the right arm, and then one with the left, back to the right, etc.  Also, you could use a barbell as well.</p>\r\n\n    \n',0,177,178,400,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/front-two-dumbbell-raise',1,'9.1',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/372/Male/m/372_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/372/Male/m/372_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/372/Female/m/372_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/372/Female/m/372_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (139,'Handstand Push-Ups','\n        <p>\n        </p><p></p><ol><li> With your back to the wall bend at the waist and place both hands on the floor at shoulder width.</li>\r\n\r\n	<li> Kick yourself up against the wall with your arms straight. Your body should be upside down with the arms and legs fully extended.  Keep your whole body as straight as possible.  <strong>Tip:</strong> If doing this for the first time, have a spotter help you.  Also, make sure that you keep facing the wall with your head, rather than looking down.</li>\r\n\r\n	<li> Slowly lower yourself to the ground as you inhale until your head almost touches the floor.  <strong>Tip:</strong> It is of utmost importance that you come down slow in order to avoid head injury.</li>\r\n\r\n	<li> Push yourself back up slowly as you exhale until your elbows are nearly locked.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Ensure that the floor surface is not slippery and also, if performing for the first time, use a spotter until you get good at this exercise.</p>\n    \n',0,179,180,410,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/handstand-push-ups',2,'7.9',1,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/227/Male/m/227_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/227/Male/m/227_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/227/Female/m/227_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/227/Female/m/227_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (140,'Iron Cross','\n        <p>\n        </p><p></p><ul><p>1. Stand with feet shoulder width apart holding a dumbbell in each hand.\r\n\r\n	</p><p>2. Now lift the arms to your sides so that your torso and the arms form the letter \"T\".  The arms should be parallel to the floor and perpendicular to each side of your torso.  The palms should be facing forward.  This will be your starting position.</p>\r\n\r\n	<p>3-a.  As you inhale slowly squat down by bending at the knees and holding the back erect as if you were going to sit on a chair.  Continue with the squat motion until your thighs are parallel to the floor.  <strong>Tip:</strong> Remember that the knees should never go past your toes.</p>\r\n\r\n	<p>3-b.  As you squat down, simultaneously bring the arms in front of you until the palms of the hands are facing each other.  <strong>Tip:</strong> This will look like a flat bench flye but performed standing up.  The arms will remain extended throughout the movement and only the shoulder joint will move.</p>\r\n\r\n	<p>4. Now start pressing with the ball of the foot mainly in order to go back to the initial position and simultaneously move the arms out away from your sides in order to form a giant \"T\" as you stand upright.  Exhale as you perform this movement.</p>\r\n\r\n	<p>5. Repeat for the recommended amount of repetitions.</p>\r\n</ul>\n',0,181,182,420,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/iron-cross',2,'8.1',4,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/195/Male/m/195_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/195/Male/m/195_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/195/Female/m/195_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/195/Female/m/195_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (141,'Jerk Balance','\n        <p>\n        </p><p>\r\n</p><ol><li>This drill helps you learn to drive yourself low enough during the jerk and corrects those who move backward during the movement. Begin with the bar racked in the jerk position, with the shoulders forward, torso upright, and the feet split slightly apart.</li>\r\n<li> Initiate the movement as you would a normal jerk, dipping at the knees while keeping your torso vertical, and driving back up forcefully, using momentum and not your arms to elevate the weight.</li>\r\n<li> Keep the rear foot in place, using it to drive your body forward into a full split as you jerk the weight. Recover by standing up with the weight overhead.</li>\r\n</ol>\n',0,183,184,430,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/jerk-balance',2,'0.0',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Male/m/694_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Male/m/694_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Male/m/694_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Male/m/694_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Female/m/694_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Female/m/694_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Female/m/694_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/694/Female/m/694_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (142,'Kettlebell Arnold Press','\n        <p>\n        </p><p>\r\n</p><ol><li> Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulder by extending through the legs and hips as you raise the kettlebell towards your shoulder. The palm should be facing inward.</li>\r\n<li> Looking straight ahead, press the kettlebell out and overhead, rotating your wrist so that your palm faces forward at the top of the motion.</li>\r\n<li>Return the kettlebell to the starting position, with the palm facing in.</li>\r\n</ol>\n',0,185,186,440,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-arnold-press-',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/512/Male/m/512_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/512/Male/m/512_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/512/Female/m/512_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/512/Female/m/512_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (143,'Kettlebell Seated Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Sit on the floor and spread your legs out comfortably.</li>\r\n<li> Clean one kettlebell to your shoulder.</li>\r\n<li> Press the kettlebell up and out until it is locked out overhead. Return to the starting position.</li>\r\n</ol>\n',0,187,188,450,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-seated-press',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/555/Male/m/555_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/555/Male/m/555_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/555/Female/m/555_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/555/Female/m/555_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (144,'Kettlebell Seesaw Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells two your shoulders. </li>\r\n<li>Press one kettlebell.</li>\r\n<li> Lower the kettlebell and immediately press the other kettlebell. Make sure to do the same amount of reps on both sides.</li>\r\n</ol>\n',0,189,190,460,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-seesaw-press',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/558/Male/m/558_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/558/Male/m/558_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/558/Male/m/558_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/558/Female/m/558_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/558/Female/m/558_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (145,'Kettlebell Thruster','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you pull the kettlebells towards your shoulders. Rotate your wrists as you do so. This will be your starting position.</li>\r\n<li> Begin to squat by flexing your hips and knees, lowering your hips between your legs. Maintain an upright, straight back as you descend as low as you can.</li>\r\n<li> At the bottom, reverse direction and squat by extending your knees and hips, driving through your heels. As you do so, press both kettlebells overhead by extending your arms straight up, using the momentum from the squat to help drive the weights upward.</li>\r\n<li> As you begin the next repetition, return the weights to the shoulders.</li>\r\n</ol>\n',0,191,192,470,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-thruster',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Male/m/641_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Male/m/641_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Male/m/641_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Female/m/641_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Female/m/641_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/641/Female/m/641_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (146,'Kettlebell Turkish Get-Up (Lunge style)','\n        <p>\n        </p><p>\r\n</p><ol><li>Lie on your back on the  floor and press a kettlebell to the top position by extending the elbow. Bend the knee on the same side as the kettlebell.</li>\r\n<li> Keeping the kettlebell locked out at all times, pivot to the opposite side and use your non- working arm to assist you in driving forward to the lunge position. Using your free hand, push yourself to a seated position, then progressing to one knee.</li>\r\n<li> While looking up at the kettlebell, slowly stand up. Reverse the motion back to the starting position and repeat. </li>\r\n</ol>\n',0,193,194,480,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-turkish-get-up-lunge-style',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Male/m/526_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Male/m/526_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Male/m/526_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Male/m/526_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Female/m/526_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Female/m/526_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Female/m/526_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/526/Female/m/526_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (147,'Kettlebell Turkish Get-Up (Squat style)','\n        <p>\n        </p><p>\r\n</p><ol><li>Lie on your back on the  floor and press a kettlebell to the top position by extending the elbow. Bend the knee on the same side as the kettlebell.</li>\r\n<li> Keeping the kettlebell locked out at all times, pivot to the opposite side and use your non- working arm to assist you in driving forward to the lunge position.</li>\r\n<li> Using your free hand, push yourself to a seated position, then progressing to your feet. While looking up at the kettlebell, slowly stand up. Reverse the motion back to the starting position and repeat. </li>\r\n</ol>\n',0,195,196,490,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-turkish-get-up-squat-style',2,'9.7',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Male/m/527_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Male/m/527_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Male/m/527_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Male/m/527_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Female/m/527_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Female/m/527_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Female/m/527_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/527/Female/m/527_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (148,'Lateral Raise - With Bands','\n        <p>\n        </p><p></p><ol><li> To begin, stand on an exercise band so that tension begins at arm\'s length.  Grasp the handles using a pronated (palms facing your thighs) grip that is slightly less than shoulder width.  The handles should be resting on the sides of your thighs. Your arms should be extended with a slight bend at the elbows and your back should be straight.  This will be your starting position.</li>\r\n\r\n	<li>  Use your side shoulders to lift the handles to the sides as you exhale.  Continue to lift the handles until they are slightly above parallel.  <strong>Tip:</strong> As you lift the handles, slightly tilt the hand as if you were pouring water and keep your arms extended.  Also, keep your torso stationary and pause for a second at the top of the movement.</li>\r\n\r\n	<li> Lower the handles back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed using dumbbells or a pulley machine.</p>\n    \n',0,197,198,500,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/lateral-raise-with-bands',1,'8.0',1,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/258/Male/m/258_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/258/Male/m/258_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/258/Female/m/258_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/258/Female/m/258_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (149,'Leverage Shoulder Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Load an appropriate weight onto the pins and adjust the seat for your height. The handles should be near the top  of the shoulders at the beginning of the motion. Your chest and head should be up and handles held with a pronated grip. This will be your starting position. </li>\r\n<li> Press the handles upward by extending through the elbow. </li>\r\n<li>After a brief pause at the top, return the weight to just above the start position, keeping tension on the muscles by not returning the weight to the stops until the set is complete.\r\n</li>\r\n</ol>\n',0,199,200,510,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/leverage-shoulder-press',2,'9.8',4,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/897/Male/m/897_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/897/Male/m/897_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/897/Female/m/897_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/897/Female/m/897_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (150,'Log Lift','\n        <p>\n         </p><p>\r\n</p><ol><li>Begin standing with the log in front of you. Grasp the handles, and begin to clean the log. As you are bent over to start the clean, attempt to get the log as high as possible, pulling it into your chest. Extend through the hips and knees to bring it up to complete the clean. </li>\r\n<li> Push your head back and look up, creating a shelf on your chest to rest the log. Begin the press by dipping, flexing slightly through the knees and reversing the motion. This push press will generate momentum to start the log moving vertically. Continue by extending through the elbows to press the log above your head. There are no strict rules on form, so use whatever techniques you are most efficient with. As the log is pressed, ensure that you push your head through on each repetition, looking forward.</li>\r\n<li> Repeat as many times as possible. Attempt to control the descent of the log as it is returned to the ground.  </li>\r\n</ol>\n',0,201,202,520,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/log-lift',2,'0.0',1,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/698/Male/m/698_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/698/Male/m/698_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/698/Male/m/698_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/698/Male/m/698_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (151,'Low Pulley Row To Neck','\n        <p>\n        </p><p></p><ol><li> Sit on a low pulley row machine with a rope attachment.</li>\r\n\r\n	<li> Grab the ends of the rope using a palms-down grip and sit with your back straight and your knees slightly bent.  <strong>Tip:</strong> Keep your back almost completely vertical and your arms fully extended in front of you.  This will be your starting position.</li>\r\n\r\n	<li> While keeping your torso stationary, lift your elbows and start bending them as you pull the rope towards your neck while exhaling.  Throughout the movement your upper arms should remain parallel to the floor.  <strong>Tip:</strong> Continue this motion until your hands are almost next to your ears (the forearms will not be parallel to the floor at the end of the movement as they will be angled a bit upwards) and your elbows are out away from your sides.</li>\r\n\r\n	<li> After holding for a second or so at the contracted position, come back slowly to the starting position as you inhale.  <strong>Tip:</strong> Again, during no part of the movement should the torso move.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> You can use a straight bar attachment as well or a bench and exercise bands.</p>\n    \n',0,203,204,530,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/low-pulley-row-to-neck',2,'8.8',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/156/Male/m/156_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/156/Male/m/156_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/156/Female/m/156_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/156/Female/m/156_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (152,'Lying One-Arm Lateral Raise','\n        <p>\n        </p><p></p><ol><li> While holding a dumbbell in one hand, lay with your chest down on a flat bench.  The other hand can be used to hold to the leg of the bench for stability.</li>\r\n\r\n	<li> Position the palm of the hand that is holding the dumbbell in a neutral manner (palms facing your torso) as you keep the arm extended with the elbow slightly bent.  This will be your starting position.</li>\r\n\r\n	<li> Now raise the arm with the dumbbell to the side until your elbow is at shoulder height and your arm is roughly parallel to the floor as you exhale. <strong>Tip:</strong> Maintain your arm perpendicular to the torso while keeping your arm extended throughout the movement.  Also, keep the contraction at the top for a second.</li>\r\n\r\n	<li> Slowly lower the dumbbell to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with both arms at the same time and also keeping the palms of the hands facing back as opposed to facing your torso.</p>\n    \n',0,205,206,540,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/lying-one-arm-lateral-raise',1,'7.0',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/165/Male/m/165_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/165/Male/m/165_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/165/Female/m/165_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/165/Female/m/165_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (153,'Lying Rear Delt Raise','\n        <p>\n        </p><p></p><ol><li> While holding a dumbbell in each hand, lay with your chest down on a flat bench.</li>\r\n\r\n	<li> Position the palms of the hands in a neutral manner (palms facing your torso) as you keep the arms extended with the elbows slightly bent.  This will be your starting position.</li>\r\n\r\n	<li> Now raise the arms to the side until your elbows are at shoulder height and your arms are roughly parallel to the floor as you exhale. <strong>Tip:</strong> Maintain your arms perpendicular to the torso while keeping them extended throughout the movement.  Also, keep the contraction at the top for a second.</li>\r\n\r\n	<li> Slowly lower the dumbbells to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions and then switch to the other arm.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with just one arm and also keeping the palms of the hands facing back as opposed to facing your torso.</p>\n    \n',0,207,208,550,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/lying-rear-delt-raise',1,'9.1',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/376/Male/m/376_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/376/Male/m/376_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/376/Female/m/376_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/376/Female/m/376_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (154,'Machine Shoulder (Military) Press','\n        <p>\n        </p><p></p><ol><li> Sit down on the Shoulder Press Machine and select the weight.</li>\r\n\r\n	<li> Grab the handles to your sides as you keep the elbows bent and in line with your torso.  This will be your starting position.</li>\r\n\r\n	<li>  Now lift the handles as you exhale and you extend the arms fully.  At the top of the position make sure that you hold the contraction for a second.</li>\r\n\r\n	<li> Lower the handles slowly back to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can use free weights (barbells and dumbbells) to perform this exercise on a military bench.</p>\n    \n',0,209,210,560,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/machine-shoulder-military-press',2,'7.6',1,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/74/Male/m/74_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/74/Male/m/74_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/74/Female/m/74_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/74/Female/m/74_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (155,'One-Arm Incline Lateral Raise','\n        <p>\n        </p><p></p><ol><li>Lie down sideways on an incline bench press with a dumbbell in the hand.  Make sure the shoulder is pressing against the incline bench and the arm is lying across your body with the palm around your navel.</li>\r\n\r\n<li>Hold a dumbbell in your uppermost arm while keeping it extended in front of you parallel to the floor.  This is your starting position.</li>\r\n\r\n<li>While keeping the dumbbell parallel to the floor at all times, perform a lateral raise. Your arm should travel straight up until it is pointing at the ceiling.  <strong>Tip:</strong> Exhale as you perform this movement. Hold the dumbbell in the position and feel the contraction in the shoulders for a second.</li>\r\n\r\n<li>While inhaling lower the weight across your body back into the starting position.</li>\r\n\r\n<li>Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n<li>Switch arms and repeat the movement.</li>\r\n</ol>\n',0,211,212,570,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-incline-lateral-raise',1,'9.2',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/170/Male/m/170_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/170/Male/m/170_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/170/Female/m/170_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/170/Female/m/170_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (156,'One-Arm Kettlebell Clean and Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell by the handle.</li>\r\n<li> Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. </li>\r\n<li> Dip your body by bending the knees, keeping your torso upright.</li>\r\n<li> Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body\'s momentum to move the weight.</li>\r\n<li> Receive the weight overhead by returning to a squat position underneath the weight.</li>\r\n<li> Keeping the weight overhead, return to a standing position. Lower the weight to the floor to perform the next repetition.</li>\r\n</ol>\n',0,213,214,580,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-clean-and-jerk-',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Male/m/643_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Male/m/643_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Male/m/643_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Male/m/643_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Female/m/643_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Female/m/643_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Female/m/643_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/643/Female/m/643_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (157,'One-Arm Kettlebell Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell by the handle. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. This will be your starting position.</li>\r\n<li> Dip your body by bending the knees, keeping your torso upright.</li>\r\n<li> Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body\'s momentum to move the weight. Receive the weight overhead by returning to a squat position underneath the weight. Keeping the weight overhead, return to a standing position.</li>\r\n<li> Lower the weight to perform the next repetition.</li>\r\n</ol>\n',0,215,216,590,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-jerk',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Male/m/514_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Male/m/514_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Male/m/514_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Male/m/514_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Female/m/514_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Female/m/514_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Female/m/514_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/514/Female/m/514_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif');
INSERT INTO `exercise_type` (`type_id`,`name`,`description`,`form_type`,`tree_left`,`tree_right`,`tree_order`,`tree_level`,`tree_parent_id`,`link`,`mechanics_type`,`rating`,`force_type`,`equipment`,`type_img`,`guide_img`) VALUES 
 (158,'One-Arm Kettlebell Military Press To The Side','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces inward. This will be your starting position.</li>\r\n<li>  Look at the kettlebell and press it up and out until it is locked out overhead.</li>\r\n<li> Lower the kettlebell back to your shoulder under control and repeat. Make sure to contract your lat, butt, and stomach forcefully for added stability and strength. </li>\r\n</ol>\n',0,217,218,600,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-military-press-to-the-side',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/517/Male/m/517_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/517/Male/m/517_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/517/Female/m/517_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/517/Female/m/517_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (159,'One-Arm Kettlebell Para Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean a kettlebell to your shoulder. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. This will be your starting position. </li>\r\n<li> Hold the kettlebell with the elbow out to the side, and press it up and out until it is locked out overhead.</li>\r\n<li> Lower the kettlebell back to your shoulder under control and repeat. Make sure to contract your lat, butt, and stomach forcefully for added stability and strength. </li>\r\n</ol>\n',0,219,220,610,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-para-press-',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/523/Male/m/523_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/523/Male/m/523_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/523/Female/m/523_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/523/Female/m/523_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (160,'One-Arm Kettlebell Push Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell by the handle. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. This will be your starting position. </li>\r\n<li>Dip your body by bending the knees, keeping your torso upright.</li>\r\n<li> Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body\'s momentum to move the weight. Lower the weight to perform the next repetition.</li>\r\n</ol>\n',0,221,222,620,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-push-press',2,'9.2',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/519/Male/m/519_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/519/Male/m/519_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/519/Male/m/519_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/519/Female/m/519_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/519/Female/m/519_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (161,'One-Arm Kettlebell Snatch','\n        <p>\n        </p><p>\r\n</p><ol><li>Place a kettlebell between your feet. Bend your knees and push your butt back to get in the proper starting position.</li>\r\n<li> Look straight ahead and swing the kettlebell back between your legs.</li>\r\n<li> Immediately reverse the direction and drive through with your hips and knees, accelerating the kettlebell upward.  As the kettlebell rises to your shoulder rotate your hand and punch  straight up, using momentum to receive the weight locked out overhead. </li>\r\n</ol>\n',0,223,224,630,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-snatch',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/520/Male/m/520_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/520/Male/m/520_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/520/Male/m/520_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/520/Female/m/520_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/520/Female/m/520_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (162,'One-Arm Kettlebell Split Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell by the handle. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulder. Rotate your wrist as you do so, so that the palm faces forward. This will be your starting position.</li> \r\n<li>Dip your body by bending the knees, keeping your torso upright. </li>\r\n<li>Immediately reverse direction, driving through the heels, in essence jumping to create momentum. As you do so, press the kettlebell overhead to lockout by extending the arms, using your body\'s momentum to move the weight.</li>\r\n<li> Receive the weight overhead by returning to a squat position underneath the weight, positioning one leg in front of you and one leg behind you.</li>\r\n<li> Keeping the weight overhead, return to a standing position and bring your feet together. Lower the weight to perform the next repetition.</li>\r\n</ol>\n',0,225,226,640,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-split-jerk',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/540/Male/m/540_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/540/Male/m/540_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/540/Male/m/540_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/540/Female/m/540_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/540/Female/m/540_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (163,'One-Arm Kettlebell Split Snatch','\n        <p>\n        </p><p>\r\n</p><ol><li>Hold a kettlebell  in one hand by the handle.</li>\r\n<li> Squat towards the floor, and then reverse the motion,  extending the hips, knees, and finally the ankles, to raise the kettlebell overhead.</li>\r\n<li> After fully extending the body, descend into a lunge position to receive the weights overhead, one leg forward and one leg back. Ensure you drive through with your hips and lock the ketttlebells overhead in one uninterrupted motion.</li> <li>Return to a standing position, holding the weight overhead, and bring the feet together. Lower the weight to return to the starting position.</li>\r\n</ol>\n',0,227,228,650,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-split-snatch-',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/537/Male/m/537_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/537/Male/m/537_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/537/Male/m/537_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/537/Female/m/537_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/537/Female/m/537_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (164,'One-Arm Side Laterals','\n        <p>\n        </p><p></p><ol><li>Pick a dumbbell and place it in one of your hands.  Your non lifting hand should be used to grab something steady such as an incline bench press.  Lean towards your lifting arm and away from the hand that is gripping the incline bench as this will allow you to keep your balance.</li>\r\n\r\n<li>Stand with a straight torso and have the dumbbell by your side at arm&acirc;&#128;&#153;s length with the palm of the hand facing you.  This will be your starting position.</li>\r\n\r\n<li>While maintaining the torso stationary (no swinging), lift the dumbbell to your side with a slight bend on the elbow and your hand slightly tilted forward as if pouring water in a glass.  Continue to go up until you arm is parallel to the floor.  Exhale as you execute this movement and pause for a second at the top.</li>\r\n\r\n<li>Lower the dumbbell back down slowly to the starting position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n\r\n<li>Switch arms and repeat the exercise.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed sitting down.</p>\r\n\n    \n',0,229,230,660,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-side-laterals',1,'9.3',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/173/Male/m/173_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/173/Male/m/173_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/173/Female/m/173_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/173/Female/m/173_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (166,'Push Press','\n        <p>\n        </p><p><strong>Beginning Position:</strong></p>\r\n\r\n<p></p><ul><li>Use the floor-to-shoulder lifting technique described in the <a href=\"exercises.php?Name=Power+Clean\">Power Clean</a> exercise to move the bar from the floor to the shoulders.</li>\r\n</ul><p><strong>Upward Movement Phase:</strong></p>\r\n\r\n<p></p><ul><li>Slightly flex the hips and knees, keeping torso erect.</li>\r\n<li>Immediately follow with an explosive push upward by extending the knees.</li>\r\n<li>Keep torso erect and tensed.</li>\r\n<li>At maximum hip and knee extension, shift body weight to balls of feet and extend ankle joints.</li>\r\n<li>At maximum plantar flexion, push bar from the shoulders.</li>\r\n<li>Push the bar with the arms to a fully extended elbow position overhead.</li>\r\n</ul><p><strong>Downward Movement Phase:</strong></p>\r\n\r\n<p></p><ul><li>Lower bar to shoulders.</li>\r\n<li>Flex hips and knees slightly as bar touches shoulders.</li>\r\n<li>Straighten the hips and knees before the upward movement phase begins again.</li>\r\n</ul><p><strong>Breathing:</strong></p>\r\n\r\n<p></p><ul><li>Exhale through the sticking point of the upward movement phase.</li>\r\n<li>Inhale during the downward movement phase.</li>\r\n</ul>\n',0,231,232,680,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/push-press',2,'9.4',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Male/m/186_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Male/m/186_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Male/m/186_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Female/m/186_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Female/m/186_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/186/Female/m/186_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (167,'Push Press - Behind the Neck','\n        <p>\n        </p><p>\r\n</p><ol><li>Standing with the weight racked on the back of the shoulders, begin with the dip. With your feet directly under your hips, flex the knees without moving the hips backward. Go down only slightly, and reverse direction as powerfully as possible. Drive through the heels create as much speed and force as possible, moving the bar in a vertical path.</li>\r\n<li> Using the momentum generated, finish pressing the weight overhead be extending through the arms.</li>\r\n<li> Return to the starting position, using your legs to absorb the impact. </li>\r\n</ol>\n',0,233,234,690,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/push-press-behind-the-neck',2,'7.3',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Male/m/708_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Male/m/708_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Male/m/708_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Female/m/708_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Female/m/708_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/708/Female/m/708_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (168,'Rack Delivery','\n        <p>\n        </p><p>\r\n</p><ol><li>This drill teaches the delivery of the barbell to the rack position on the shoulders. Begin holding a bar in the scarecrow position, with the upper arms parallel to the floor, and the forearms hanging down. Use a hook grip, with your fingers wrapped over your thumbs.</li>\r\n<li> Begin by rotating the elbows around the bar, delivering the bar to the shoulders. As your elbows come forward, relax your grip. The shoulders should be protracted, providing a shelf for the bar, which should lightly contact the throat.</li>\r\n<li> It is important that the bar stay close to the body at all times, as with a heavier load any distance will result in an unwanted collision. As the movement becomes smoother, speed and load can be increased before progressing further. </li>\r\n</ol>\n',0,235,236,700,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/rack-delivery',2,'0.0',4,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Male/m/709_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Male/m/709_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Male/m/709_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Female/m/709_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Female/m/709_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/709/Female/m/709_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (169,'Reverse Flyes','\n        <p>\n        </p><p></p><ol><li> To begin, lie down on an incline bench with the chest and stomach pressing against the incline.  Have the dumbbells in each hand with the palms facing each other (neutral grip).</li>\r\n\r\n	<li> Extend the arms in front of you so that they are perpendicular to the angle of the bench.  The legs should be stationary while applying pressure with the ball of your toes.  This is the starting position.</li>\r\n\r\n	<li> Maintaining the slight bend of the elbows, move the weights out and away from each other (to the side) in an arc motion while exhaling. <strong>Tip:</strong> Try to squeeze your shoulder blades together to get the best results from this exercise.</li>\r\n\r\n	<li> The arms should be elevated until they are parallel to the floor.</li>\r\n\r\n	<li> Feel the contraction and slowly lower the weights back down to the starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol>\n',0,237,238,710,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/reverse-flyes',1,'9.2',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/375/Male/m/375_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/375/Male/m/375_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/375/Female/m/375_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/375/Female/m/375_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (170,'Reverse Flyes With External Rotation','\n        <p>\n        </p><p></p><ol><li> To begin, lie down on an incline bench set at a 30-degree angle with the chest and stomach pressing against the incline.</li>\r\n\r\n	<li> Have the dumbbells in each hand with the palms facing down to the floor.  Your arms should be in front of you so that they are perpendicular to the angle of the bench. <strong>Tip:</strong> Your elbows should have a slight bend.  The legs should be stationary while applying pressure with the ball of your toes (your heels should not be touching the floor).  This is the starting position.</li>\r\n\r\n	<li> Maintaining the slight bend of the elbows, move the weights out and away from each other in an arc motion while exhaling.</li>\r\n\r\n	<li> As you lift the weight, your wrist should externally rotate by 90-degrees so that you go from a palms down (pronated) grip to a palms facing each other (neutral) grip. <strong>Tip:</strong> Try to squeeze your shoulder blades together to get the best results from this exercise.</li>\r\n\r\n	<li> The arms should be elevated until they are level with the head.</li>\r\n\r\n	<li> Feel the contraction and slowly lower the weights back down to the starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol>\n',0,239,240,720,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/reverse-flyes-with-external-rotation',1,'9.2',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/239/Male/m/239_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/239/Male/m/239_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/239/Female/m/239_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/239/Female/m/239_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (171,'Reverse Machine Flyes','\n        <p>\n        </p><p>\r\n</p><ol><li>Adjust the handles so that they are fully to the rear. Make an appropriate weight selection and adjust the seat height so the handles are at shoulder level. Grasp the handles with your hands facing inwards. This will be your starting position.</li>\r\n<li> In a semicircular motion, pull your hands out to your side and back, contracting your rear delts.</li>\r\n<li> Keep your arms slightly bent throughout the movement, with all of the motion occurring at the shoulder joint.</li>\r\n<li> Pause at the rear of the movement, and slowly return the weight to the starting position.\r\n</li>\r\n</ol>\n',0,241,242,730,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/reverse-machine-flyes',1,'0.0',4,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/912/Male/m/912_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/912/Male/m/912_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/912/Female/m/912_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/912/Female/m/912_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (172,'Seated Barbell Military Press','\n        <p>\n        </p><p></p><ol><li> Sit on a Military Press Bench with a bar behind your head and either have a spotter give you the bar (better on the rotator cuff this way) or pick it up yourself carefully with a pronated grip (palms facing forward).  <strong>Tip:</strong> Your grip should be wider than shoulder width and it should create a 90-degree angle between the forearm and the upper arm as the barbell goes down.</li>\r\n\r\n	<li>  Once you pick up the barbell with the correct grip length, lift the bar up over your head by locking your arms.  Hold at about shoulder level and slightly in front of your head.  This is your starting position.</li>\r\n\r\n	<li> Lower the bar down to the collarbone slowly as you inhale.</li>\r\n\r\n	<li> Lift the bar back up to the starting position as you exhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p> \r\n<p></p><ul><li> This exercise can also be performed standing but those with lower back problems are better off performing this seated variety.</li>\r\n\r\n	<li> The behind the neck variation is not recommended for people with shoulder problems as it can be hard on the rotator cuff due to the hyperextension created by bringing the bar behind the neck.</li>\r\n</ul>\n',0,243,244,740,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/seated-barbell-military-press',2,'9.3',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/382/Male/m/382_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/382/Male/m/382_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/382/Female/m/382_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/382/Female/m/382_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (173,'Seated Bent-Over Rear Delt Raise','\n        <p>\n        </p><p></p><ol><li> Place a couple of dumbbells looking forward in front of a flat bench.</li>\r\n\r\n	<li> Sit on the end of the bench with your legs together and the dumbbells behind your calves.</li>\r\n\r\n	<li> Bend at the waist while keeping the back straight in order to pick up the dumbbells.  The palms of your hands should be facing each other as you pick them.  This will be your starting position.</li>\r\n\r\n	<li> Keeping your torso forward and stationary, and the arms slightly bent at the elbows, lift the dumbbells straight to the side until both arms are parallel to the floor.  Exhale as you lift the weights.  (Note: avoid swinging the torso or bringing the arms back as opposed to the side.)</li>\r\n\r\n	<li> After a one second contraction at the top, slowly lower the dumbbells back to the starting position.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> This exercise can also be performed standing but those with lower back problems are better off performing this seated variety.</p>\n    \n',0,245,246,750,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/seated-bent-over-rear-delt-raise',1,'9.0',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/377/Male/m/377_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/377/Male/m/377_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/377/Female/m/377_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/377/Female/m/377_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (174,'Seated Cable Shoulder Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Adjust the weight to an appropriate amount and be seated, grasping the handles. Your upper arms should be about 90 degrees to the body, with your head and chest up. The elbows should also be bent to about 90 degrees. This will be your starting position.</li>\r\n<li> Begin by extending through the elbow, pressing the handles together above your head.</li>\r\n<li>After pausing at the top, return the handles to the starting position. Ensure that you maintain tension on the cables. </li>\r\n<li>  You can also execute this movement with your back off the pad and alternate hands.\r\n</li>\r\n</ol>\n',0,247,248,760,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/seated-cable-shoulder-press',2,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/871/Male/m/871_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/871/Male/m/871_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/871/Female/m/871_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/871/Female/m/871_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (175,'Seated Dumbbell Press','\n        <p>\n        </p><p></p><ol><li> Grab a couple of dumbbells and sit on a military press bench or a utility bench that has a back support on it as you place the dumbbells upright on top of your thighs.</li>\r\n\r\n	<li> Clean the dumbbells up one at a time by using your thighs to bring the dumbbells up to shoulder height at each side.</li>\r\n\r\n	<li> Rotate the wrists so that the palms of your hands are facing forward.  This is your starting position.</li>\r\n\r\n	<li> As you exhale, push the dumbbells up until they touch at the top.</li>\r\n\r\n	<li> After a second pause, slowly come down back to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p> \r\n<p></p><ul><li> You can perform the exercise standing or sitting on a regular flat bench.  For people with lower back problems, the version described is the recommended one.</li>\r\n\r\n	<li> You can also perform the exercise as Arnold Schwarzenegger used to do it, which is to start holding the dumbbells with a supinated grip (palms facing you) in front of your shoulders and then, as you start pushing up, you align the dumbbells in the starting position described on step 3 by rotating your wrists and touch the dumbbells at the top.  As you come down, then you would go back to the starting position by rotating the wrist throughout the lowering portion until the palms of your hands are facing you.  This variation is called the Arnold Press.  However, it is not recommended if you have rotator cuff problems.</li>\r\n</ul>\n',0,249,250,770,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/seated-dumbbell-press',2,'8.2',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/364/Male/m/364_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/364/Male/m/364_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/364/Female/m/364_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/364/Female/m/364_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (176,'Seated Side Lateral Raise','\n        <p>\n        </p><p></p><ol><li>  Pick a couple of dumbbells and sit at the end of a flat bench with your feet firmly on the floor. Hold the dumbbells with your palms facing in and your arms straight down at your sides at arms\' length.  This will be your starting position.</li>\r\n\r\n	<li>  While maintaining the torso stationary (no swinging), lift the dumbbells to your side with a slight bend on the elbow and the hands slightly tilted forward as if pouring water in a glass.  Continue to go up until you arms are parallel to the floor.  Exhale as you execute this movement and pause for a second at the top.</li>\r\n\r\n	<li> Lower the dumbbells back down slowly to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed standing up.</p>\n    \n',0,251,252,780,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/seated-side-lateral-raise',1,'8.3',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/378/Male/m/378_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/378/Male/m/378_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/378/Female/m/378_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/378/Female/m/378_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (177,'See-Saw Press (Alternating Side Press)','\n        <p>\n        </p><p></p><ol><li> Grab a dumbbell with each hand and stand up erect.</li>\r\n\r\n	<li> Clean (lift) the dumbbells to the chest/shoulder level and then rotate your wrists so that your palms are facing towards you as if you were getting ready to perform an Arnold Press. This will be your starting position.</li>\r\n\r\n	<li> Now start extending your left arm overhead as you rotate the wrist so that the palm of your hand faces forward as you go up.  Your elbows should come out also as you lift the weight.  Simultaneously, you will also be bending from your hip to your opposite side. <strong>Tip:</strong> If you perform the exercise correctly, is should look as if you are trying to reach for something overhead on the right hand side of your body, but with your left arm.  Breathe out as you perform this movement.</li>\r\n\r\n	<li> Once you reach the top position breathe in.  Then, with the weight fully extended overhead and you bent over to your right hand side, begin the movement to the left side.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Be extremely careful with the weight used as using a weight that you cannot control can cause back injury.</p>\n    \n',0,253,254,790,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/see-saw-press-alternating-side-press',2,'7.6',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Male/m/197_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Male/m/197_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Male/m/197_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Female/m/197_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Female/m/197_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/197/Female/m/197_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (178,'Shoulder Press - With Bands','\n        <p>\n        </p><p></p><ol><li>  To begin, stand on an exercise band so that tension begins at arm\'s length.  Grasp the handles and lift them so that the hands are at shoulder height at each side.</li>\r\n\r\n	<li> Rotate the wrists so that the palms of your hands are facing forward.  Your elbows should be bent, with the upper arms and forearms in line to the torso.  This is your starting position.</li>\r\n\r\n	<li> As you exhale, lift the handles up until your arms are fully extended overhead.</li>\r\n</ol>\n',0,255,256,800,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/shoulder-press-with-bands',2,'8.0',1,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/259/Male/m/259_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/259/Male/m/259_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/259/Female/m/259_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/259/Female/m/259_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (179,'Side Lateral Raise','\n        <p>\n        </p><p></p><ol><li> Pick a couple of dumbbells and stand with a straight torso and the dumbbells by your side at arms length with the palms of the hand facing you.  This will be your starting position.</li>\r\n\r\n	<li>  While maintaining the torso in a stationary position (no swinging), lift the dumbbells to your side with a slight bend on the elbow and the hands slightly tilted forward as if pouring water in a glass.  Continue to go up until you arms are parallel to the floor.  Exhale as you execute this movement and pause for a second at the top.</li>\r\n\r\n	<li> Lower the dumbbells back down slowly to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> This exercise can also be performed sitting down.</p>\n    \n',0,257,258,810,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/side-lateral-raise',1,'9.0',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/373/Male/m/373_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/373/Male/m/373_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/373/Female/m/373_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/373/Female/m/373_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (180,'Smith Incline Shoulder Raise','\n        <p>\n        </p><p></p><ol><li> Place an incline bench underneath the smith machine.  Place the barbell at a height that you can reach when lying down and your arms are almost fully extended.  Once the weight you need is selected, lie down on the incline bench and make sure your shoulders are aligned right under the barbell.</li>\r\n\r\n	<li> Using a shoulder width pronated (palms forward) grip, lift the bar from the rack and hold it straight over you with a slight bend at the elbows.  This will be your starting position.</li>\r\n\r\n	<li> As you breathe out, lift the bar up until your arms are fully extended.  <strong>Note:</strong> The contraction should be felt around the shoulders.</li>\r\n\r\n	<li> After a second pause, bring the bar back down to the starting position as you breathe in.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n	<li> When you are done, place the bar back in the rack.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with dumbbells or a barbell.</p>\n    \n',0,259,260,820,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/smith-incline-shoulder-raise',1,'0.0',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/329/Male/m/329_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/329/Male/m/329_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/329/Female/m/329_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/329/Female/m/329_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (181,'Smith Machine Overhead Shoulder Press','\n        <p>\n        </p><p></p><ol><li> To begin, place a flat bench (or preferably one with back support) underneath a smith machine.  Position the barbell at a height so that when seated on the flat bench, the arms must be almost fully extended to reach the barbell.</li>\r\n\r\n	<li> Once you have the correct height, sit slightly in behind the barbell so that there is an imaginary straight line from the tip of your nose to the barbell.  Your feet should be stationary.  Grab the barbell with the palms facing forward, unlock it and lift it up so that your arms are fully extended.  This is the starting position.</li>\r\n\r\n	<li> Slowly begin to lower the barbell until it is level with your chin while inhaling.</li>\r\n\r\n	<li> Then lift the barbell back to the starting position using your shoulders while exhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> You can use dumbbells or a barbell to perform this exercise.</p>\n    \n',0,261,262,830,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/smith-machine-overhead-shoulder-press',2,'8.7',1,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/76/Male/m/76_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/76/Male/m/76_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/76/Female/m/76_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/76/Female/m/76_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (182,'Standing Barbell Press Behind Neck','\n        <p>\n        </p><p></p><ol><li> This exercise is best performed inside a squat rack for easier pick up of the bar.  To begin, first set the bar on a rack that best matches your height.  Once the correct height is chosen and the bar is loaded, step under the bar and place the back of your shoulders (slightly below the neck) across it.</li>\r\n\r\n	<li> Hold on to the bar using both arms at each side and lift it off the rack by first pushing with your legs and at the same time straightening your torso.</li>\r\n\r\n	<li> Step away from the rack and position your legs using a shoulder width medium stance with the toes slightly pointed out. Your back should be kept straight while performing this exercise. This will be your starting position.</li>\r\n\r\n	<li> Elevate the barbell overhead by fully extending your arms while breathing out.</li>\r\n\r\n	<li> Hold the contraction for a second and lower the barbell back down to the starting position by inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Performing this exercise can cause serious injury if not performed properly.  Make sure to keep your back straight when lowering and lifting the barbell.</p>\n    \n',0,263,264,840,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-barbell-press-behind-neck',2,'7.7',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/381/Male/m/381_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/381/Male/m/381_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/381/Female/m/381_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/381/Female/m/381_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (183,'Standing Dumbbell Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Standing with your feet shoulder width apart, take a dumbbell in each hand. Raise the dumbbells to head height, the elbows out and about 90 degrees. This will be your starting position.</li>\r\n<li> Maintaining strict technique with no leg drive or leaning back, extend through the elbow to raise the weights together directly above your head.</li>\r\n<li> Pause, and slowly return the weight to the starting position.\r\n</li>\r\n</ol>\n',0,265,266,850,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-dumbbell-press-',2,'0.0',4,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/920/Male/m/920_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/920/Male/m/920_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/920/Female/m/920_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/920/Female/m/920_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (184,'Standing Dumbbell Straight-Arm Front Delt Raise Above Head','\n        <p>\n        </p><p></p><ol><li> Hold the dumbbells in front of your thighs, palms facing your thighs.</li>\r\n\r\n	<li>  Keep your arms straight with a slight bend at the elbows but keep them locked. This will be your starting position.</li>\r\n\r\n	<li>  Raise the dumbbells in a semicircular motion to arm\'s length overhead as you exhale.</li>\r\n\r\n	<li>  Slowly return to the starting position using the same path as you inhale.</li>\r\n\r\n	<li>  Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> You can perform this exercise with a barbell or by alternating dumbbells.</p>\n    \n',0,267,268,860,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-dumbbell-straight-arm-front-delt-raise-above-head',1,'8.8',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/374/Male/m/374_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/374/Male/m/374_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/374/Female/m/374_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/374/Female/m/374_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (185,'Standing Front Barbell Raise Over Head','\n        <p>\n        </p><p></p><ol><li> To begin, stand straight with a barbell in your hands.  You should grip the bar with palms facing down and a closer than shoulder width grip apart from each other.</li>\r\n\r\n	<li> Your feet should be shoulder width apart from each other.  Your elbows should be slightly bent.  This is the starting position.</li>\r\n\r\n	<li> Lift the barbell up until it is directly over your head while exhaling.  Make sure to keep your elbows slightly bent when performing each repetition.</li>\r\n\r\n	<li> Once you feel the contraction, begin to lower the barbell back down to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed with dumbbells in each hand or by using a close or wide grip with the barbell.  By alternating the widths of your grip, you will be able to contract different parts of the shoulders for an overall better physique.</p>\n    \n',0,269,270,870,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-front-barbell-raise-over-head',1,'7.3',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/379/Male/m/379_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/379/Male/m/379_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/379/Female/m/379_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/379/Female/m/379_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (186,'Standing Low-Pulley Deltoid Raise','\n        <p>\n        </p><p></p><ol><li> Start by standing to the right side of a low pulley row.  Use your left hand to come across the body and grab a single handle attached to the low pulley with a pronated grip (palms facing down).  Rest your arm in front of you.  Your right hand should grab the machine for better support and balance.</li>\r\n\r\n	<li> Make sure that your back is erect and your feet are shoulder width apart from each other.  This is the starting position.</li>\r\n\r\n	<li> Begin to use the left hand and come across your body out until it is elevated to shoulder height while exhaling.</li>\r\n\r\n	<li> Feel the contraction at the top for a second and begin to slowly lower the handle back down to the original starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n\r\n	<li> Switch arms and repeat the exercise.</li>\r\n</ol>\n',0,271,272,880,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-low-pulley-deltoid-raise',1,'8.9',1,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/72/Male/m/72_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/72/Male/m/72_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/72/Female/m/72_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/72/Female/m/72_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (187,'Standing Military Press','\n        <p>\n        </p><p></p><ol><li> Start by placing a barbell that is about chest high on a squat rack.  Once you have selected the weights, grab the barbell using a pronated (palms facing forward) grip.  Make sure to grip the bar wider than shoulder width apart from each other.</li>\r\n\r\n	<li> Slightly bend the knees and place the barbell on your collar bone.  Lift the barbell up keeping it lying on your chest.  Take a step back and position your feet shoulder width apart from each other.</li>\r\n\r\n	<li> Once you pick up the barbell with the correct grip length, lift the bar up over your head by locking your arms.  Hold at about shoulder level and slightly in front of your head.  This is your starting position.</li>\r\n\r\n	<li> Lower the bar down to the collarbone slowly as you inhale.</li>\r\n\r\n	<li> Lift the bar back up to the starting position as you exhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p>\r\n \r\n<p></p><ul><li> This exercise can also be performed sitting as those with lower back problems are better off performing this seated variety.</li>\r\n\r\n	<li> The behind the neck variation is not recommended for people with shoulder problems as it can be hard on the rotator cuff due to the hyperextension created by bringing the bar behind the neck.</li>\r\n\r\n	<li> Another option is to use dumbbells when performing this exercise for better isolation.</li>\r\n</ul>\n',0,273,274,890,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-military-press',2,'9.1',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/370/Male/m/370_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/370/Male/m/370_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/370/Female/m/370_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/370/Female/m/370_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (188,'Standing Palm-In One-Arm Dumbbell Press','\n        <p>\n        </p><p></p><ol><li> Start by having a dumbbell in one hand with your arm fully extended to the side using a neutral grip. Use your other arm to hold on to an incline bench to keep your balance.</li>\r\n\r\n	<li> Your feet should be shoulder width apart from each other.  Now slowly lift the dumbbell up until you create a 90 degree angle with your arm. <strong>Note:</strong> Your forearm should be perpendicular to the floor.  Continue to maintain a neutral grip throughout the entire exercise.</li>\r\n\r\n	<li> Slowly lift the dumbbell up until your arm is fully extended.  This the starting position.</li>\r\n\r\n	<li> While inhaling lower the weight down until your arm is at a 90 degree angle again.</li>\r\n\r\n	<li> Feel the contraction for a second and then lift the weight back up towards the starting position while exhaling.  Remember to hold on to the incline bench and keep your feet positioned to keep balance during the exercise.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n\r\n	<li> Switch arms and repeat the exercise.</li>\r\n</ol><p><strong>Variation:</strong> This exercise can be performed with dumbbells in each arm as the dumbbells will help to keep you balanced.  This is another great way to add variety to your routines and keep them interesting.</p>\n    \n',0,275,276,900,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-palm-in-one-arm-dumbbell-press',2,'9.3',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/366/Male/m/366_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/366/Male/m/366_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/366/Female/m/366_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/366/Female/m/366_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (189,'Standing Palms-In Dumbbell Press','\n        <p>\n        </p><p></p><ol><li> Start by having a dumbbell in each hand with your arm fully extended to the side using a neutral grip. Your feet should be shoulder width apart from each other.  Now slowly lift the dumbbells up until you create a 90 degree angle with your arms. <strong>Note:</strong> Your forearms should be perpendicular to the floor. This the starting position.</li>\r\n\r\n	<li> Continue to maintain a neutral grip throughout the entire exercise.  Slowly lift the dumbbells up until your arms are fully extended.  </li>\r\n\r\n	<li> While inhaling lower the weights down until your arm is at a 90 degree angle again.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> This exercise can be performed with a dumbbell in one arm and another holding on to an incline bench.  This is another great way to add variety to your routines and keep them interesting.</p>\n    \n',0,277,278,910,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/standing-palms-in-dumbbell-press',2,'0.0',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/367/Male/m/367_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/367/Male/m/367_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/367/Female/m/367_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/367/Female/m/367_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (190,'Two-Arm Kettlebell Clean','\n        <p>\n        </p><p>\r\n</p><ol><li>Place two kettlebells between your feet. To get in the starting position, push your butt back and look straight ahead.</li>\r\n<li> Clean the kettlebells to your shoulders by extending through the legs and hips as you raise the kettlebells towards your shoulders. Rotate your wrists as you do so. </li>\r\n<li> Lower the kettlebells back to the starting position and repeat.</li>\r\n</ol>\n',0,279,280,920,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/two-arm-kettlebell-clean',2,'0.0',2,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/529/Male/m/529_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/529/Male/m/529_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/529/Female/m/529_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/529/Female/m/529_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (191,'Two-Arm Kettlebell Jerk','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you swing the kettlebells towards your shoulders. Rotate your wrists as you do so, so that the palms face forward. Squat down a few inches and reverse the motion rapidly driving both kettlebells overhead. Immediately after the initial push, squat down again and get under the kettlebells. Once the kettlebells are locked out, stand upright to complete the exercise.\r\n\n    </li></ol>\n',0,281,282,930,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/two-arm-kettlebell-jerk',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/528/Male/m/528_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/528/Male/m/528_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/528/Female/m/528_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/528/Female/m/528_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (192,'Two-Arm Kettlebell Military Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean two kettlebells to your shoulders. Clean the kettlebells to your shoulders by extending through the legs and hips as you swing the kettlebells towards your shoulders. Rotate your wrists as you do so, so that the palms face forward.</li>\r\n<li>  Press the kettlebells up and out. As the kettlebells pass your head, lean into the weights so that the kettlebells are racked behind your head. Make sure to contract your lats, butt, and stomach for added stability. </li>\r\n</ol>\n',0,283,284,940,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/two-arm-kettlebell-military-press',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/530/Male/m/530_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/530/Male/m/530_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/530/Female/m/530_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/530/Female/m/530_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (193,'Upright Barbell Row','\n        <p>\n        </p><p></p><ol><li>Grasp a barbell with an overhand grip that is slightly less than shoulder width.  The bar should be resting on the top of your thighs with your arms extended and a slight bend in your elbows.  Your back should also be straight.  This will be your starting position.</li>\r\n\r\n<li>Now exhale and use the sides of your shoulders to lift the bar, raising your elbows up and to the side.  Keep the bar close to your body as you raise it.  Continue to lift the bar until it nearly touches your chin. Tip: Your elbows should drive the motion, and should always be higher than your forearms.  Remember to keep your torso stationary and pause for a second at the top of the movement.</li> \r\n\r\n<li>Lower the bar back down slowly to the starting position.  Inhale as you perform this portion of the movement.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed using a straight bar attached to a low pulley and it can also be performed using dumbbells, though this later exercise should be reserved by people that are well familiarized with correct execution.</p>\n    \n',0,285,286,950,2,53,'http://www.bodybuilding.com/exercises/detail/view/name/upright-barbell-row',2,'8.8',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/365/Male/m/365_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/365/Male/m/365_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/365/Female/m/365_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/365/Female/m/365_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (194,'Shoulders','',0,620,625,4,1,66,'',0,'0.0',0,0,'',''),
 (195,'Backward Medicine Ball Throw','\n        <p>\n        </p><p>\r\n</p><ol><li>This exercise is best done with a partner. If you lack a partner, the ball can be thrown and retrieved or thrown against a wall.</li>\r\n<li> Begin standing a few meters in front of your partner, both facing the same direction. Begin holding the ball between your legs.</li>\r\n<li> Squat down and then forcefully reverse direction, coming to full extension and you toss the ball over your head to your partner.</li>\r\n<li> Your partner can then roll the ball back to you. Repeat for the desired number of repetitions.\r\n</li>\r\n</ol>\n',0,621,622,10,2,194,'http://www.bodybuilding.com/exercises/detail/view/name/backward-medicine-ball-throw',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/764/Male/m/764_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/764/Male/m/764_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/764/Female/m/764_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/764/Female/m/764_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (196,'Return Push from Stance','\n        <p>\n        </p><p>\r\n</p><ol><li>You will need a partner for this drill.</li>\r\n<li> Begin in an athletic 2 or 3 point stance.</li>\r\n<li> At the signal, move into a position to receive the pass from your partner.</li>\r\n<li> Catch the medicine ball with both hands and immediately throw it back to your partner.</li>\r\n<li> You can modify this drill by running different routes.\r\n</li>\r\n</ol>\n',0,623,624,20,2,194,'http://www.bodybuilding.com/exercises/detail/view/name/return-push-from-stance',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Male/m/811_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Male/m/811_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Male/m/811_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Male/m/811_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Female/m/811_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Female/m/811_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Female/m/811_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/811/Female/m/811_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/12.gif'),
 (197,'Chest','',0,626,645,5,1,66,'',0,'0.0',0,0,'',''),
 (198,'Chest Push (multiple response)','\n        <p>\n        </p><p>\r\n</p><ol><li>Begin in a kneeling position facing a wall or utilize a partner. Hold the ball with both hands tight into the chest.</li>\r\n<li> Execute the pass by exploding forward and outward with the hips while pushing the ball as hard as possible.</li>\r\n<li> Follow through by falling forward, catching yourself with your hands. </li>\r\n<li>Immediately return to an upright position. Repeat for the desired number of repetitions.\r\n</li>\r\n</ol>\n',0,627,628,10,2,197,'http://www.bodybuilding.com/exercises/detail/view/name/chest-push-multiple-response',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/769/Male/m/769_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/769/Male/m/769_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/769/Male/m/769_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/769/Female/m/769_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/769/Female/m/769_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (199,'Chest Push (single response)','\n        <p>\n        </p><p>\r\n</p><ol><li>Begin in a kneeling position holding the medicine ball with both hands tightly into the chest.</li>\r\n<li> Execute the pass by exploding forward and outward with the hips while pushing the ball as far as possible. </li>\r\n<li>Follow through by falling forward, catching yourself with your hands. \r\n</li>\r\n</ol>\n',0,629,630,20,2,197,'http://www.bodybuilding.com/exercises/detail/view/name/chest-push-single-response',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/770/Male/m/770_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/770/Male/m/770_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/770/Male/m/770_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/770/Female/m/770_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/770/Female/m/770_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (200,'Chest Push from 3 point stance','\n        <p>\n        </p><p>\r\n</p><ol><li>Begin in a three point stance, squatted down with your back flat and one hand on the ground. Place the medicine ball directly in front of you.</li>\r\n<li> To begin, take your first step as you pull the ball to your chest, positioning both hands to prepare for the throw.</li>\r\n<li> As you execute the second step, explosively release the ball forward as hard as possible. \r\n</li>\r\n</ol>\n',0,631,632,30,2,197,'http://www.bodybuilding.com/exercises/detail/view/name/chest-push-from-3-point-stance',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/771/Male/m/771_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/771/Male/m/771_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/771/Male/m/771_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/771/Male/m/771_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/771/Female/m/771_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/771/Female/m/771_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/771/Female/m/771_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (201,'Chest Push with Run Release','\n        <p>\n        </p><p>\r\n</p><ol><li>Begin in an athletic stance with the knees bent, hips back, and back flat. Hold the medicine ball near your legs. This will be your starting position.</li>\r\n<li> While taking your first step draw the medicine ball into your chest.</li>\r\n<li> As you take the second step, explosively push the ball forward, immediately sprinting for 10 yards after the release. If you are really fast, you can catch your own pass!\r\n</li>\r\n</ol>\n',0,633,634,40,2,197,'http://www.bodybuilding.com/exercises/detail/view/name/chest-push-with-run-release',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/772/Male/m/772_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/772/Male/m/772_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/772/Male/m/772_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/772/Male/m/772_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/772/Female/m/772_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/772/Female/m/772_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/772/Female/m/772_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/772/Female/m/772_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (202,'Drop Push','\n        <p>\n        </p><p>\r\n</p><ol><li>Position low boxes or other platforms 2-3 feet apart.</li>\r\n<li> Move to a pushup position between them, supporting yourself by placing your hands on the boxes.</li>\r\n<li> With good posture, drop from the platforms by pressing up and moving your hands to shoulder width, cushioning your landing by absorbing the impact through the arm.\r\n</li>\r\n</ol>\n',0,635,636,50,2,197,'http://www.bodybuilding.com/exercises/detail/view/name/drop-push',2,'0.0',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/779/Male/m/779_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/779/Male/m/779_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/779/Male/m/779_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/779/Male/m/779_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/779/Female/m/779_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/779/Female/m/779_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/779/Female/m/779_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (203,'Incline Push-Up Depth Jump','\n        <p>\n        </p><p>\r\n</p><ol><li>For this drill you will need a box about 12 inches high, and two thick mats or aerobics steps. </li>\r\n<li>Place the steps just outside of your shoulders, and place your feet on top of the box so that you are in an incline pushup position, your hands just inside the steps. This will be your starting position.</li>\r\n<li> Begin by bending at the elbows to lower your body, quickly reversing position to push your body off of the ground. As you leave the ground, move your hands onto the steps, bending your elbows to absorb the impact.</li>\r\n<li> Repeat the motion to return to the starting position.\r\n</li>\r\n</ol>\n',0,637,638,60,2,197,'http://www.bodybuilding.com/exercises/detail/view/name/incline-push-up-depth-jump',2,'0.0',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/789/Male/m/789_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/789/Male/m/789_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/789/Male/m/789_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/789/Male/m/789_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (204,'Isometric Chest Squeezes','\n        <p>\n        </p><p></p><ol><li> While either seating or standing, bend your arms at a 90-degree angle and place the palms of your hands together in front of your chest. <strong>Tip:</strong> Your hands should be open with the palms together and fingers facing forward (perpendicular to your torso).</li>\r\n\r\n	<li> Push both hands against each other as you contract your chest.  Start with slow tension and increase slowly.  Keep breathing normally as you execute this contraction.</li>\r\n\r\n	<li> Hold for the recommended number of seconds.</li>\r\n\r\n	<li> Now release the tension slowly.</li>\r\n\r\n	<li> Rest for the recommended amount of time and repeat.</li>\r\n</ol><p><strong>Variations:</strong> While you can perform this exercise with the hands right in front of you, you can also change the angle by having the hands at a 45 degree angle above parallel or below.</p>\n    \n',0,639,640,70,2,197,'http://www.bodybuilding.com/exercises/detail/view/name/isometric-chest-squeezes',2,'6.8',3,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/92/Male/m/92_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/92/Male/m/92_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/92/Female/m/92_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/92/Female/m/92_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (205,'Medicine Ball Chest Pass','\n        <p>\n        </p><p>\r\n</p><ol><li>You will need a partner for this exercise. Lacking one, this movement can be performed against a wall.</li>\r\n<li> Begin facing your partner holding the medicine ball at your torso with both hands.</li>\r\n<li> Pull the ball to your chest, and reverse the motion by extending through the elbows. For sports applications, you can take a step as you throw.</li>\r\n<li> Your partner should catch the ball, and throw it back to you.</li>\r\n<li> Receive the throw with both hands at chest height.\r\n</li>\r\n</ol>\n',0,641,642,80,2,197,'http://www.bodybuilding.com/exercises/detail/view/name/medicine-ball-chest-pass',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/801/Male/m/801_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/801/Male/m/801_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/801/Female/m/801_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/801/Female/m/801_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif');
INSERT INTO `exercise_type` (`type_id`,`name`,`description`,`form_type`,`tree_left`,`tree_right`,`tree_order`,`tree_level`,`tree_parent_id`,`link`,`mechanics_type`,`rating`,`force_type`,`equipment`,`type_img`,`guide_img`) VALUES 
 (206,'Plyo Push-up','\n        <p>\n        </p><p>\r\n\r\n</p><ol><li>Move into a prone position on the floor, supporting your weight on your hands and toes.</li>\r\n<li> Your arms should be fully extended with the hands around shoulder width. Keep your body straight throughout the movement. This will be your starting position.</li>\r\n<li> Decend by flexing at the elbow, lowering your chest towards the ground.</li>\r\n<li> At the bottom, reverse the motion by pushing yourself up through elbow extension as quickly as possible. Attempt to push your upper body up until your hands leave the ground.</li>\r\n<li> Return to the starting position and repeat the exercise.</li>\r\n<li> For added difficulty, add claps into the movement while you are air borne.\r\n</li>\r\n</ol>\n',0,643,644,90,2,197,'http://www.bodybuilding.com/exercises/detail/view/name/plyo-push-up',2,'0.0',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/910/Male/m/910_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/910/Male/m/910_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/910/Male/m/910_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/910/Female/m/910_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/910/Female/m/910_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/910/Female/m/910_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (207,'Chest','',0,578,591,5,1,24,'',0,'0.0',0,0,'',''),
 (208,'Behind Head Chest Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li> Sit upright on the floor with your partner behind you. </li> \r\n<li> Place your hands behind your hand, and push your elbows back as far as you can. Your partner should hold your elbows. This will be your starting position. </li>\r\n<li> Gently attempt to pull your elbows forward with your hands still behind your head for 10 or more seconds. Your partner should prevent your elbows from moving. </li>\r\n<li> Now, relax your muscles and have your partner gently pull the elbows back as far as it comfortable for you. Be sure to let your partner know when the stretch is adequate to prevent overstretching or injury.\r\n</li>\r\n</ol>\n',0,579,580,10,2,207,'http://www.bodybuilding.com/exercises/detail/view/name/behind-head-chest-stretch',1,'4.3',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/582/Male/m/582_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/582/Male/m/582_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/582/Female/m/582_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/582/Female/m/582_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (209,'Chest And Front Of Shoulder Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Start off by standing with your legs together, holding a bodybar or a broomstick.</li>\r\n<li> Take a slightly wider than shoulder width grip on the pole and hold it in front of you with your palms facing down.</li>\r\n<li> Carefully lift the pole up and behind your head.</li>\r\n</ol>\r\n Remain aware of your lower body alignment. Keep your stomach muscles tucked in and your lower back muscles contracted to avoid arching your lower back.\n    \n',0,581,582,20,2,207,'http://www.bodybuilding.com/exercises/detail/view/name/chest-and-front-of-shoulder-stretch',1,'3.6',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/421/Male/m/421_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/421/Male/m/421_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/421/Female/m/421_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/421/Female/m/421_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (210,'Chest Stretch on Stability Ball','\n        <p>\n        </p><p>\r\n</p><ol><li>Get on your hands and knees next to an exercise ball.</li>\r\n<li> Place your elbows on top of the ball, keeping your arm out to your side. This will be your starting position.</li>\r\n<li> Lower your torso towards the floor, keeping your elbow on top of the ball. Hold the stretch for 20-30 seconds, and repeat with the other arm.</li>\r\n</ol>\n',0,583,584,30,2,207,'http://www.bodybuilding.com/exercises/detail/view/name/chest-stretch-on-stability-ball',1,'5.0',4,7,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/584/Male/m/584_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/584/Male/m/584_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/584/Female/m/584_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/584/Female/m/584_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (211,'Downward Facing Balance','\n        <p>\n        </p><p>\r\n</p><ol><li>Lie facedown on top of an exercise ball. </li>\r\n<li>While resting on your stomach on the ball, walk your hands forward along the floor and lift your legs, extending your elbows and knees.</li>\r\n</ol>\n',0,585,586,40,2,207,'http://www.bodybuilding.com/exercises/detail/view/name/downward-facing-balance',1,'3.8',1,7,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/422/Male/m/422_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/422/Male/m/422_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/422/Female/m/422_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/422/Female/m/422_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (212,'Dynamic Chest Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Stand with your hands together, arms extended directly in front of you. This will be your starting position.</li>\r\n<li> Keeping your arms straight, quickly move your arms back as far as possible and back in again, similar to an exaggerated clapping motion. Repeat 5-10 times, increasing speed as you do so. </li>\r\n</ol>\n',0,587,588,50,2,207,'http://www.bodybuilding.com/exercises/detail/view/name/dynamic-chest-stretch',3,'6.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/587/Male/m/587_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/587/Male/m/587_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/587/Female/m/587_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/587/Female/m/587_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/587/Female/m/587_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/587/Female/m/587_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (213,'Elbows Back','\n        <p>\n        </p><p>\r\n</p><ol><li>Stand up straight.</li> \r\n<li> Place both hands on your lower back, fingers pointing downward and elbows out.</li>\r\n<li>Then gently pull your elbows back aiming to touch them together.</li>\r\n</ol>\n',0,589,590,60,2,207,'http://www.bodybuilding.com/exercises/detail/view/name/elbows-back',1,'6.3',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/465/Male/m/465_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/465/Male/m/465_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/465/Female/m/465_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/465/Female/m/465_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (214,'Alternating Floor Press','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nLie on the floor with two kettlebells next to your shoulders.</li>\r\n<li> Position one in place on your chest and then the other, gripping the kettlebells on the handle with the palms facing forward.</li>\r\n<li> Extend both arms, so that the kettlebells are being held above your chest. Lower one kettlebell, bringing it to your chest  and turn the wrist in the direction of the locked out kettlebell.</li>\r\n<li> Raise the kettlebell and repeat on the opposite side. </li>\r\n</ol>\n',0,289,290,10,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/alternating-floor-press',2,'4.9',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/534/Male/m/534_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/534/Male/m/534_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/534/Male/m/534_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/534/Female/m/534_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/534/Female/m/534_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/534/Female/m/534_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (215,'Around The Worlds','\n        <p>\n        </p><p></p><ol><li>Lay down on a flat bench holding a dumbbell in each hand with the palms of the hands facing towards the ceiling. <strong>Tip:</strong> Your arms should be parallel to the floor and next to your thighs.  To avoid injury, make sure that you keep your elbows slightly bent.  This will be your starting position.</li>\r\n\r\n<li>Now move the dumbbells by creating a semi-circle as you displace them from the initial position to over the head.  All of the movement should happen with the arms parallel to the floor at all times. Breathe in as you perform this portion of the movement.</li>\r\n<li>Reverse the movement to return the weight to the starting position as you exhale. </li>\r\n</ol><p><strong>Variations:</strong> None</p>\r\n\n    \n',0,291,292,20,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/around-the-worlds',2,'7.3',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/277/Male/m/277_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/277/Male/m/277_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/277/Female/m/277_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/277/Female/m/277_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (216,'Barbell Bench Press - Medium Grip','\n        <p>\n        </p><p></p><ol><li>Lie back on a flat bench.  Using a medium width grip (a grip that creates a 90-degree angle in the middle of the movement between the forearms and the upper arms), lift the bar from the rack and hold it straight over you with your arms locked.  This will be your starting position.</li>\r\n\r\n<li>From the starting position, breathe in and begin coming down slowly until the bar touches your middle chest.</li>\r\n\r\n<li>After a brief pause, push the bar back to the starting position as you breathe out.  Focus on pushing the bar using your chest muscles.  Lock your arms and squeeze your chest in the contracted position at the top of the motion, hold for a second and then start coming down slowly again. Tip: Ideally, lowering the weight should take about twice as long as raising it.</li>\r\n\r\n<li>Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n<li>When you are done, place the bar back in the rack.</li>\r\n</ol><p><strong>Caution:</strong></p>\r\n\r\n<p>If you are new at this exercise, it is advised that you use a spotter.  If no spotter is available, then be conservative with the amount of weight used.</p>\r\n\r\n<p>Also, beware of letting the bar drift too far forward.  You want the bar to touch your middle chest and nowhere else.</p>\r\n\r\n<p>Don\'t bounce the weight off your chest.  You should be in full control of the barbell at all times.</p>\n    \n',0,293,294,30,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-bench-press-medium-grip',2,'8.8',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/360/Male/m/360_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/360/Male/m/360_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/360/Female/m/360_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/360/Female/m/360_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (217,'Barbell Incline Bench Press - Medium Grip','\n        <p>\n        </p><p></p><ol><li> Lie back on an incline bench.  Using a medium-width grip (a grip that creates a 90-degree angle in the middle of the movement between the forearms and the upper arms), lift the bar from the rack and hold it straight over you with your arms locked.  This will be your starting position.</li>\r\n\r\n	<li> As you breathe in, come down slowly until you feel the bar on you upper chest.</li>\r\n\r\n	<li> After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles.  Lock your arms in the contracted position, squeeze your chest, hold for a second and then start coming down slowly again.  <strong>Tip:</strong> it should take at least twice as long to go down than to come up.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n	<li> When you are done, place the bar back in the rack.</li>\r\n</ol><p><strong>Caution:</strong> If you are new at this exercise, it is advised that you use a spotter.  If no spotter is available, then be conservative with the amount of weight used.  Also, beware of letting the bar drift too far forward.  You want the bar to fall on your upper chest and nowhere else.</p>\r\n\r\n<p><strong>Variations:</strong> You can use several angles on the incline bench if the one you are using is adjustable.</p>\n    \n',0,295,296,40,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-incline-bench-press-medium-grip',2,'8.7',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/369/Male/m/369_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/369/Male/m/369_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/369/Female/m/369_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/369/Female/m/369_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (218,'Barbell Incline Shoulder Raise','\n        <p>\n        </p><p></p><ol><li>Lie back on an Incline Bench.  Using a medium width grip (a grip that is slightly wider than shoulder width), lift the bar from the rack and hold it straight over you with your arms straight.  This will be your starting position.</li>\r\n\r\n<li>While keeping the arms straight, lift the bar by protracting your shoulder blades, raising the shoulders from the bench as you breathe out.</li>\r\n\r\n<li>Bring back the bar to the starting position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can use dumbbells or a smith machine in order to perform this exercise.</p>\r\n\n    \n',0,297,298,50,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-incline-shoulder-raise',2,'6.8',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/306/Male/m/306_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/306/Male/m/306_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/306/Female/m/306_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/306/Female/m/306_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (219,'Bench Press - With Bands','\n        <p>\n        </p><p></p><ol><li>Using a flat bench secure a band under the leg of the bench that is nearest to your head.</li>\r\n\r\n<li>Once the band is secure, grab it by both handles and lie down on the bench.</li>\r\n\r\n<li>Extend your arms so that you are holding the band handles in front of you at shoulder width.</li>\r\n\r\n<li>Once at shoulder width, rotate your wrists forward so that the palms of your hands are facing away from you.  This will be your starting position.</li>\r\n\r\n<li>Bring down the handles slowly until your elbow forms a 90 degree angle.  Keep full control at all times.</li>\r\n \r\n<li>As you breathe out, bring the handles up using your pectoral muscles.  Lock your arms in the contracted position, squeeze your chest, hold for a second and then start coming down slowly.  Tip: It should take at least twice as long to go down than to come up.</li>\r\n\r\n<li>Repeat the movement for the prescribed amount of repetitions of your training program.</li>\r\n</ol><p><strong>Variations:</strong> You can also use a pulley machine, dumbbells or a barbell for this exercise.</p>\r\n\n    \n',0,299,300,60,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/bench-press-with-bands',2,'5.3',1,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/254/Male/m/254_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/254/Male/m/254_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/254/Female/m/254_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/254/Female/m/254_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (220,'Bent-Arm Dumbbell Pullover','\n        <p>\n        </p><p></p><ol><li>Place a dumbbell standing up on a flat bench.\r\n\r\n</li><li>Ensuring that the dumbbell stays securely placed at the top of the bench, lie perpendicular to the bench (torso across it as in forming a cross) with only your shoulders lying on the surface.  Hips should be below the bench and legs bent with feet firmly on the floor.  The head will be off the bench as well.</li>\r\n\r\n<li>Grasp the dumbbell with both hands and hold it straight over your chest with a bend in your arms.  Both palms should be pressing against the underside one of the sides of the dumbbell.  This will be your starting position. <strong>Caution:</strong> Always ensure that the dumbbell used for this exercise is secure.  Using a dumbbell with loose plates can result in the dumbbell falling apart and falling on your face.</li>\r\n\r\n<li>While keeping your arms locked in the bent arm position, lower the weight slowly in an arc behind your head while breathing in until you feel a stretch on the chest.</li>\r\n\r\n<li>At that point, bring the dumbbell back to the starting position using the arc through which the weight was lowered and exhale as you perform this movement.</li>\r\n\r\n<li>Hold the weight on the initial position for a second and repeat the motion for the prescribed number of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> If you are new to this movement, have a spotter hand you the weight instead.  If not, please ensure that the dumbbell does not fall on you as you arrange your torso to perform the exercise on the bench.</p>\r\n\r\n<p>Also, as I already mentioned, ensure that the dumbbell used is in perfect working condition.  Old dumbbells in need of welding should never be used to perform this exercise.</p>\r\n\r\n<p><strong>Variations:</strong></p>\r\n\r\n<p></p><ul><li>You can perform this exercise using a barbell or an e-z bar instead of dumbbells.</li>\r\n<li>Also, if using dumbbells like Powerblocks&acirc;&#132;&cent;, just use a dumbbell on each hand with the palms of your hands facing each other.</li>\r\n</ul>\n',0,301,302,70,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/bent-arm-dumbbell-pullover',2,'7.8',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/40/Male/m/40_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/40/Male/m/40_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/40/Female/m/40_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/40/Female/m/40_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (222,'Cable Chest Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Adjust the weight to an appropriate amount and be seated, grasping the handles. Your upper arms should be about 45 degrees to the body, with your head and chest up. The elbows should be bent to about 90 degrees. This will be your starting position.</li>\r\n<li> Begin by extending through the elbow, pressing the handles together straight in front of you. Keep your shoulder blades retracted as you execute the movement.</li>\r\n<li>After pausing at full extension, return to th starting position, keeping tension on the cables. </li>\r\n<li> You can also execute this movement with your back off the pad, at an incline or decline, or alternate hands.\r\n</li>\r\n</ol>\n',0,305,306,90,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/cable-chest-press',2,'8.7',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/870/Male/m/870_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/870/Male/m/870_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/870/Female/m/870_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/870/Female/m/870_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (223,'Cable Crossover','\n        <p>\n        </p><p></p><ol><li>To get yourself into the starting position, place the pulleys on a high position (above your head), select the resistance to be used and hold the pulleys in each hand.</li>\r\n\r\n<li>Step forward in front of an imaginary straight line between both pulleys while pulling your arms together in front of you.  Your torso should have a small forward bend from the waist.  This will be your starting position.</li>\r\n \r\n<li>With a slight bend on your elbows in order to prevent stress at the biceps tendon, extend your arms to the side (straight out at both sides) in a wide arc until you feel a stretch on your chest.  Breathe in as you perform this portion of the movement.  Tip: Keep in mind that throughout the movement, the arms and torso should remain stationary; the movement should only occur at the shoulder joint.</li>\r\n\r\n<li>Return your arms back to the starting position as you breathe out.  Make sure to use the same arc of motion used to lower the weights.</li>\r\n\r\n<li>Hold for a second at the starting position and repeat the movement for the prescribed amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can vary the point in front of you where your arms meet.</p>\n    \n',0,307,308,100,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/cable-crossover',1,'9.0',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/132/Male/m/132_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/132/Male/m/132_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/132/Female/m/132_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/132/Female/m/132_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (224,'Chain Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Begin by connecting the chains to the cable handle attachments. Position yourself on the flat bench in the same position as for a dumbbell press. Your wrists should be pronated and arms perpendicular to the floor. This will be your starting position.</li>\r\n<li> Lower the chains by flexing the elbows, unloading some of the chain onto the floor. </li>\r\n<li>Continue until your elbow forms a 90 degree angle, and then reverse the motion by extending through the elbow to lockout.</li>\r\n</ol>\n',0,309,310,110,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/chain-press',2,'5.8',1,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/734/Male/m/734_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/734/Male/m/734_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/734/Female/m/734_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/734/Female/m/734_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (225,'Cross Over - With Bands','\n        <p>\n        </p><p></p><ol><li> Secure an exercise band around a stationary post.</li>\r\n\r\n	<li> While facing away from the post, grab the handles on both ends of the band and step forward enough to create tension on the band.</li>\r\n\r\n	<li> Raise your arms to the sides, parallel to the floor, perpendicular to your torso (your torso and the arms should resemble the letter \"T\") and with the palms facing forward.  Have them extended with a slight bend at the elbows.  This will be your starting position.</li>\r\n\r\n	<li> While keeping your arms straight, bring them across your chest in a semicircular motion to the front as you exhale and flex your pecs.  Hold the contraction for a second.</li>\r\n\r\n	<li> Slowly return to the starting position as you inhale.</li>\r\n\r\n	<li> Perform for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can also be performed using pulleys.</p>\n    \n',0,311,312,120,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/cross-over-with-bands',2,'8.0',2,1,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/257/Male/m/257_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/257/Male/m/257_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/257/Female/m/257_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/257/Female/m/257_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (226,'Decline Barbell Bench Press','\n        <p>\n        </p><p></p><ol><li> Secure your legs at the end of the decline bench and slowly lay down on the bench.</li>\r\n\r\n	<li> Using a medium width grip (a grip that creates a 90-degree angle in the middle of the movement between the forearms and the upper arms), lift the bar from the rack and hold it straight over you with your arms locked.  The arms should be perpendicular to the floor.  This will be your starting position. <strong>Tip:</strong> In order to protect your rotator cuff, it is best if you have a spotter help you lift the barbell off the rack.</li>\r\n\r\n	<li> As you breathe in, come down slowly until you feel the bar on your lower chest.</li>\r\n\r\n	<li> After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles.  Lock your arms and squeeze your chest in the contracted position, hold for a second and then start coming down slowly again.  <strong>Tip:</strong> It should take at least twice as long to go down than to come up).</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n	<li> When you are done, place the bar back in the rack.</li>\r\n</ol><strong>Caution:</strong>\r\n \r\n<p></p><ul><li> If you are new at this exercise, it is advised that you use a spotter.  If no spotter is available, then be conservative with the amount of weight used.</li>\r\n\r\n	<li> Also, beware of letting the bar drift too far forward.  You want the bar to touch your lower chest and nowhere else.</li>\r\n\r\n	<li> Don\'t bounce the weight off your chest.  You should be in full control of the barbell at all times.</li>\r\n</ul><p><strong>Variations:</strong> You can also use dumbbells or exercise bands to perform this exercise.</p>\n    \n',0,313,314,130,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/decline-barbell-bench-press',2,'8.6',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/34/Male/m/34_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/34/Male/m/34_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/34/Male/m/34_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/34/Male/m/34_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/34/Female/m/34_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/34/Female/m/34_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/34/Female/m/34_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (227,'Decline Dumbbell Bench Press','\n        <p>\n        </p><p></p><ol><li> Secure your legs at the end of the decline bench and lie down with a dumbbell on each hand on top of your thighs. The palms of your hand will be facing each other.</li>\r\n\r\n	<li> Once you are laying down, move the dumbbells in front of you at shoulder width.</li>\r\n\r\n	<li> Once at shoulder width, rotate your wrists forward so that the palms of your hands are facing away from you.  This will be your starting position.</li>\r\n\r\n	<li> Bring down the weights slowly to your side as you breathe out.  Keep full control of the dumbbells at all times. <strong>Tip:</strong> Throughout the motion, the forearms should always be perpendicular to the floor.</li>\r\n\r\n	<li> As you breathe out, push the dumbbells up using your pectoral muscles.  Lock your arms in the contracted position, squeeze your chest, hold for a second and then start coming down slowly.  <strong>Tip:</strong> It should take at least twice as long to go down than to come up..</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions of your training program.</li>\r\n</ol><p><strong>Caution:</strong> When you are done, do not drop the dumbbells next to you as this is dangerous to your rotator cuff in your shoulders and others working out around you.</p>  \r\n\r\n<p>If using really heavy weights, it is best if a partner gives them to you as you lay down.</p>\r\n\r\n<p><strong>Variations:</strong> You can use an exercise band or a barbell to perform this exercise.</p>\r\n\r\n<p>Similar to the <a href=\"http://www.bodybuilding.com/fun/exercises.php?Name=Dumbbell+Bench+Press\">Dumbbell Bench Press</a> but on a decline bench. This works more of the lower chest.</p>\n    \n',0,315,316,140,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/decline-dumbbell-bench-press',2,'7.8',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/51/Male/m/51_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/51/Male/m/51_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/51/Female/m/51_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/51/Female/m/51_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (228,'Decline Dumbbell Flyes','\n        <p>\n        </p><p></p><ol><li> Secure your legs at the end of the decline bench and lie down with a dumbbell on each hand on top of your thighs. The palms of your hand will be facing each other.</li>\r\n\r\n	<li> Once you are laying down, move the dumbbells in front of you at shoulder width.  The palms of the hands should be facing each other and the arms should be perpendicular to the floor and fully extended. This will be your starting position.</li>\r\n\r\n	<li> With a slight bend on your elbows in order to prevent stress at the biceps tendon, lower your arms out at both sides in a wide arc until you feel a stretch on your chest.  Breathe in as you perform this portion of the movement.  <strong>Tip:</strong> Keep in mind that throughout the movement, the arms should remain stationary; the movement should only occur at the shoulder joint.</li>\r\n\r\n	<li> Return your arms back to the starting position as you squeeze your chest muscles and breathe out.  <strong>Tip:</strong> Make sure to use the same arc of motion used to lower the weights.</li>\r\n\r\n	<li> Hold for a second at the contracted position and repeat the movement for the prescribed amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> You may want to use a palms facing forward version for different stimulation.</p>\n    \n',0,317,318,150,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/decline-dumbbell-flyes',2,'8.9',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/36/Male/m/36_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/36/Male/m/36_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/36/Female/m/36_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/36/Female/m/36_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (229,'Dips - Chest Version','\n        <p>\n        </p><p></p><ol><li>For this exercise you will need access to parallel bars.  To get yourself into the starting position, hold your body at arms length (arms locked) above the bars.</li>\r\n\r\n<li>While breathing in, lower yourself slowly with your torso leaning forward around 30 degrees or so and your elbows flared out slightly until you feel a slight stretch in the chest.</li>\r\n\r\n<li>Once you feel the stretch, use your chest to bring your body back to the starting position as you breathe out. Tip: Remember to squeeze the chest at the top of the movement for a second.</li>\r\n\r\n<li>Repeat the movement for the prescribed amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p>\r\n\r\n<p>If you are new at this exercise and do not have the strength to perform it, use a dip assist machine if available.  These machines use weight to help you push your bodyweight.</p>\r\n\r\n<p>Otherwise, a spotter holding your legs can help.</p>\r\n\r\n<p>More advanced lifters can add weight to the exercise by using a weight belt that allows the addition of weighted plates.</p>\n    \n',0,319,320,160,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/dips-chest-version',2,'8.9',1,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/145/Male/m/145_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/145/Male/m/145_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/145/Female/m/145_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/145/Female/m/145_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (230,'Dumbbell Bench Press','\n        <p>\n        </p><p></p><ol><li>Lie down on a flat bench with a dumbbell in each hand resting on top of your thighs. The palms of your hands will be facing each other.</li>\r\n\r\n<li>Then, using your thighs to help raise the dumbbells up, lift the dumbbells one at a time so that you can hold them in front of you at shoulder width.</li>\r\n\r\n<li>Once at shoulder width, rotate your wrists forward so that the palms of your hands are facing away from you.  The dumbbells should be just to the sides of your chest, with your upper arm and forearm creating a 90 degree angle.  Be sure to maintain full control of the dumbbells at all times.  This will be your starting position.</li>\r\n\r\n<li>Then, as you breathe out, use your chest to push the dumbbells up.  Lock your arms at the top of the lift and squeeze your chest, hold for a second and then begin coming down slowly. Tip: Ideally, lowering the weight should take about twice as long as raising it.</li>\r\n\r\n<li>Repeat the movement for the prescribed amount of repetitions of your training program.</li>\r\n</ol><p><strong>Caution:</strong> When you are done, do not drop the dumbbells next to you as this is dangerous to your rotator cuff in your shoulders and others working out around you.</p>\r\n\r\n<p>Just lift your legs from the floor bending at the knees, twist your wrists so that the palms of your hands are facing each other and place the dumbbells on top of your thighs.  When both dumbbells are touching your thighs simultaneously push your upper torso up (while pressing the dumbbells on your thighs) and also perform a slight kick forward with your legs (keeping the dumbbells on top of the thighs).  By doing this combined movement, momentum will help you get back to a sitting position with both dumbbells still on top of your thighs.  At this moment you can place the dumbbells on the floor.</p>\r\n\r\n<p><strong>Variations:</strong></p>\r\n\r\n<p>Another variation of this exercise is to perform it with the palms of the hands facing each other.</p> \r\n\r\n<p>Also, you can perform the exercise with the palms facing each other and then twisting the wrist as you lift the dumbbells so that at the top of the movement the palms are facing away from the body.  I personally do not use this variation very often as it seems to be hard on my shoulders.</p>\n    \n',0,321,322,170,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-bench-press',2,'9.0',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/1/Male/m/1_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/1/Male/m/1_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/1/Female/m/1_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/1/Female/m/1_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (231,'Dumbbell Flyes','\n        <p>\n        </p><p></p><ol><li> Lie down on a flat bench with a dumbbell on each hand resting on top of your thighs. The palms of your hand will be facing each other.</li>\r\n\r\n	<li> Then using your thighs to help raise the dumbbells, lift the dumbbells one at a time so you can hold them in front of you at shoulder width with the palms of your hands facing each other.  Raise the dumbbells up like you\'re pressing them, but stop and hold just before you lock out. This will be your starting position.</li>\r\n\r\n	<li> With a slight bend on your elbows in order to prevent stress at the biceps tendon, lower your arms out at both sides in a wide arc until you feel a stretch on your chest.  Breathe in as you perform this portion of the movement.  <strong>Tip:</strong> Keep in mind that throughout the movement, the arms should remain stationary; the movement should only occur at the shoulder joint.</li>\r\n\r\n	<li> Return your arms back to the starting position as you squeeze your chest muscles and breathe out.  <strong>Tip:</strong> Make sure to use the same arc of motion used to lower the weights.</li>\r\n\r\n	<li> Hold for a second at the contracted position and repeat the movement for the prescribed amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You may want to use a palms facing forward version for different stimulation.</p>\n    \n',0,323,324,180,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-flyes',1,'8.8',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/12/Male/m/12_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/12/Male/m/12_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/12/Female/m/12_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/12/Female/m/12_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (232,'Extended Range One-Arm Kettlebell Floor Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Lie on the floor and position a kettlebell for one arm to press. The kettlebell should be held by the handle. The leg on the same side that you are pressing should be bent, with the knee crossing over the midline of the body.</li>\r\n<li> Press the kettlebell by extending the elbow and adducting the arm, pressing it above your body. Return to the starting position.</li>\r\n</ol>\n',0,325,326,190,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/extended-range-one-arm-kettlebell-floor-press',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/510/Male/m/510_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/510/Male/m/510_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/510/Female/m/510_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/510/Female/m/510_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (233,'Flat Bench Cable Flyes','\n        <p>\n        </p><p></p><ol><li>Position a flat bench between two low pulleys so that when you are laying on it, your chest will be lined up with the cable pulleys.</li>\r\n\r\n<li>Lay flat on the bench and keep your feet on the ground.</li>\r\n\r\n<li>Have someone hand you the handles on each hand.  You will grab each single handle attachment with a palms up grip.</li>\r\n\r\n<li>Extend your arms by your side with a slight bend on your elbows.  Tip: You will keep this bend constant through the whole movement.   Your arms should be parallel to the floor.  This is your starting position.</li>\r\n\r\n<li>Now start lifting the arms in a semi-circle motion directly in front of you by pulling the cables together until both hands meet at the top of the movement.  Squeeze your chest as you perform this motion and breathe out during this movement.  Also, hold the contraction for a second at the top.  <strong>Tip:</strong> When performed correctly, at the top position of this movement, your arms should be perpendicular to your torso and the floor touching above your chest.</li>\r\n\r\n<li>Slowly come back to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> Can also be done on an incline or decline bench, or with dumbbells or an exercise band.</p>\r\n\n    \n',0,327,328,200,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/flat-bench-cable-flyes',1,'7.9',1,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/162/Male/m/162_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/162/Male/m/162_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/162/Female/m/162_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/162/Female/m/162_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (234,'Forward Drag with Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Attach a dual handled chain or rope attachment to the sled. You should be facing away from the sled, holding a handle in each hand.</li>\r\n<li> Begin the movement by moving forward for one step. Leaning forward, extend through the legs and hips to move, pausing with each step to extend through the elbows, pressing your hands forward. Step forward until you return to the start position prepared to press.</li>\r\n</ol>\n',0,329,330,210,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/forward-drag-with-press',2,'0.0',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/736/Male/m/736_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/736/Male/m/736_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/736/Female/m/736_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/736/Female/m/736_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (235,'Front Raise And Pullover','\n        <p>\n        </p><p></p><ol><li>Lie on a flat bench while holding a barbell using a palms down grip that is about 15 inches apart.</li>\r\n\r\n<li>Place the bar on your upper thighs, extend your arms and lock them while keeping a slight bend on the elbows.  This will be your starting position.</li>\r\n\r\n<li>Now raise the weight using a semicircular motion and keeping your arms straight as you inhale.  Continue the same movement until the bar is on the other side above your head . (Tip: the bar will travel approximately 180-degrees).  At this point your arms should be parallel to the floor with the palms of your hands facing the ceiling.</li>\r\n\r\n<li>Now return the barbell to the starting position by reversing the motion as you exhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can use dumbbells also to perform this exercise.</p>\r\n\n    \n',0,331,332,220,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/front-raise-and-pullover',2,'8.2',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/273/Male/m/273_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/273/Male/m/273_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/273/Female/m/273_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/273/Female/m/273_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (236,'Hammer Grip Incline DB Bench Press','\n        <p>\n        </p><p></p><ol><li> Lie back on an incline bench with a dumbbell on each hand on top of your thighs. The palms of your hand will be facing each other.</li>\r\n\r\n	<li> By using your thighs to help you get the dumbbells up, clean the dumbbells one arm at a time so that you can hold them at shoulder width.</li>\r\n\r\n	<li> Once at shoulder width, keep the palms of your hands with a neutral grip (palms facing each other).  Keep your elbows flared out with the upper arms in line with the shoulders (perpendicular to the torso) and the elbows bent creating a 90-degree angle between the upper arm and the forearm.  This will be your starting position.</li>\r\n\r\n	<li> Now bring down the weights slowly to your side as you breathe in.  Keep full control of the dumbbells at all times.</li>\r\n\r\n	<li> As you breathe out, push the dumbbells up using your pectoral muscles.  Lock your arms in the contracted position, hold for a second and then start coming down slowly.  <strong>Tip:</strong> It should take at least twice as long to go down than to come up.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n	<li> When you are done, place the dumbbells back in your thighs and then on the floor. This is the safest manner to dispose of the dumbbells.</li>\r\n</ol><p><strong>Variations:</strong>  You can use several angles on the incline bench if the bench you are using is adjustable.  Another variation of this exercise is to perform it with the palms of the hands facing forward (which is the traditional manner).  Also, you can perform the exercise with the palms facing each other and then twisting the wrist as you lift the dumbbells so that at the top of the movement the palms are facing away from the body.  I personally do not use this variation very often as it seems to be hard on my shoulders.</p>\n    \n',0,333,334,230,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/hammer-grip-incline-db-bench-press',2,'8.6',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/60/Male/m/60_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/60/Male/m/60_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/60/Female/m/60_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/60/Female/m/60_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (237,'Incline Cable Flye','\n        <p>\n        </p><p></p><ol><li> To get yourself into the starting position, set the pulleys at the floor level (lowest level possible on the machine that is below your torso).</li>\r\n\r\n	<li> Place an incline bench (set at 45 degrees) in between the pulleys, select a weight on each one and grab a pulley on each hand.</li>\r\n\r\n	<li> With a handle on each hand, lie on the incline bench and bring your hands together at arms length in front of your face.  This will be your starting position.</li>\r\n\r\n	<li> With a slight bend of your elbows (in order to prevent stress at the biceps tendon), lower your arms out at both sides in a wide arc until you feel a stretch on your chest.  Breathe in as you perform this portion of the movement.  <strong>Tip:</strong> Keep in mind that throughout the movement, the arms should remain stationary.  The movement should only occur at the shoulder joint.</li>\r\n\r\n	<li> Return your arms back to the starting position as you squeeze your chest muscles and exhale.  Hold the contracted position for a second.  <strong>Tip:</strong> Make sure to use the same arc of motion used to lower the weights.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> You can vary the angle of the bench in order to target the upper chest at slightly different angles.</p>\n    \n',0,335,336,240,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/incline-cable-flye',1,'9.1',1,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/181/Male/m/181_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/181/Male/m/181_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/181/Female/m/181_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/181/Female/m/181_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (238,'Incline Dumbbell Bench With Palms Facing In','\n        <p>\n        </p><p></p><ol><li> Lie back on an incline bench with a dumbbell on each hand on top of your thighs. The palms of your hand will be facing each other.</li>\r\n\r\n	<li> By using your thighs to help you get the dumbbells up, clean the dumbbells one arm at a time so that you can hold them at shoulder width.</li>\r\n\r\n	<li> Once at shoulder width, keep the palms of your hands with a neutral grip (palms facing each other).  Keep your elbows flared out with the upper arms in line with the shoulders (perpendicular to the torso) and the elbows bent creating a 90-degree angle between the upper arm and the forearm.  This will be your starting position.</li>\r\n\r\n	<li> Now bring down the weights slowly to your side as you breathe in.  Keep full control of the dumbbells at all times.</li>\r\n\r\n	<li> As you breathe out, push the dumbbells up using your pectoral muscles.  Lock your arms in the contracted position, hold for a second and then start coming down slowly.  <strong>Tip:</strong> It should take at least twice as long to go down than to come up.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n	<li> When you are done, place the dumbbells back in your thighs and then on the floor. This is the safest manner to dispose of the dumbbells.</li>\r\n</ol><p><strong>Variations:</strong>  You can use several angles on the incline bench if the bench you are using is adjustable.  Another variation of this exercise is to perform it with the palms of the hands facing forward (which is the traditional manner).  Also, you can perform the exercise with the palms facing each other and then twisting the wrist as you lift the dumbbells so that at the top of the movement the palms are facing away from the body.  I personally do not use this variation very often as it seems to be hard on my shoulders.</p>\n    \n',0,337,338,250,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/incline-dumbbell-bench-with-palms-facing-in',2,'7.6',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/37/Male/m/37_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/37/Male/m/37_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/37/Female/m/37_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/37/Female/m/37_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (239,'Incline Dumbbell Flyes','\n        <p>\n        </p><p></p><ol><li> Hold a dumbbell on each hand and lie on an incline bench that is set to an incline angle of no more than 30 degrees.</li>\r\n\r\n	<li> Extend your arms above you with a slight bend at the elbows.</li>\r\n\r\n	<li> Now rotate the wrists so that the palms of your hands are facing you.  <strong>Tip:</strong> The pinky fingers should be next to each other.  This will be your starting position.</li>\r\n\r\n	<li> As you breathe in, start to slowly lower the arms to the side while keeping the arms extended and while rotating the wrists until the palms of the hand are facing each other. <strong>Tip:</strong> At the end of the movement the arms will be by your side with the palms facing the ceiling.</li>\r\n\r\n	<li> As you exhale start to bring the dumbbells back up to the starting position by reversing the motion and rotating the hands so that the pinky fingers are next to each other again.  <strong>Tip:</strong> Keep in mind that the movement will only happen at the shoulder joint and at the wrist.  There is no motion that happens at the elbow joint.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform regular flyes and also twisting flyes where your initial position starts with the thumbs facing each other instead of the pinky.</p>\n    \n',0,339,340,260,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/incline-dumbbell-flyes',2,'8.9',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/38/Male/m/38_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/38/Male/m/38_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/38/Female/m/38_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/38/Female/m/38_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (240,'Incline Dumbbell Flyes - With A Twist','\n        <p>\n        </p><p></p><ol><li> Hold a dumbbell in each hand and lie on an incline bench that is set to an incline angle of no more than 30 degrees.</li>\r\n\r\n	<li> Extend your arms above you with a slight bend at the elbows.</li>\r\n\r\n	<li> Now rotate the wrists so that the palms of your hands are facing you.  <strong>Tip:</strong> The pinky fingers should be next to each other.  This will be your starting position.</li>\r\n\r\n	<li> As you breathe in, start to slowly lower the arms to the side while keeping the arms extended and while rotating the wrists until the palms of the hand are facing each other. <strong>Tip:</strong> At the end of the movement the arms will be by your side with the palms facing the ceiling.</li>\r\n\r\n	<li> As you exhale start to bring the dumbbells back up to the starting position by reversing the motion and rotating the hands so that the pinky fingers are next to each other again.  <strong>Tip:</strong> Keep in mind that the movement will only happen at the shoulder joint and at the wrist.  There is no motion that happens at the elbow joint.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform regular flyes and also twisting flyes where your initial position starts with the thumbs facing each other instead of the pinky.</p>\n    \n',0,341,342,270,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/incline-dumbbell-flyes-with-a-twist',2,'8.3',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/50/Male/m/50_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/50/Male/m/50_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/50/Female/m/50_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/50/Female/m/50_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (241,'Incline Dumbbell Press','\n        <p>\n        </p><p></p><ol><li>Lie back on an incline bench with a dumbbell in each hand atop your thighs. The palms of your hands will be facing each other.</li>\r\n\r\n<li>Then, using your thighs to help push the dumbbells up, lift the dumbbells one at a time so that you can hold them at shoulder width.</li>\r\n\r\n<li>Once you have the dumbbells raised to shoulder width, rotate your wrists forward so that the palms of your hands are facing away from you.  This will be your starting position.</li>\r\n\r\n<li>Be sure to keep full control of the dumbbells at all times.  Then breathe out and push the dumbbells up with your chest.</li>\r\n\r\n<li>Lock your arms at the top, hold for a second, and then start slowly lowering the weight. Tip Ideally, lowering the weights should take about twice as long as raising them.</li>\r\n\r\n<li>Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n<li>When you are done, place the dumbbells back on your thighs and then on the floor.  This is the safest manner to release the dumbbells.</li>\r\n</ol><p><strong>Variations:</strong> You can use several angles on the incline bench if the bench you are using is adjustable.</p>\r\n\r\n<p>Another variation of this exercise is to perform it with the palms of the hands facing each other.</p>\r\n\r\n<p>Also, you can perform the exercise with the palms facing each other and then twisting the wrist as you lift the dumbbells so that at the top of the movement the palms are facing away from the body.  I personally do not use this variation very often as it seems to be hard on my shoulders.</p>\n    \n',0,343,344,280,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/incline-dumbbell-press',2,'9.2',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/380/Male/m/380_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/380/Male/m/380_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/380/Female/m/380_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/380/Female/m/380_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (242,'Leg-Over Floor Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Lie on the floor with one kettlebell in place on your chest, holding it by the handle. Extend leg on working side over leg on non-working side.Your free arm can be extended out to your side for support.</li>\r\n<li> Press the kettlebll into a locked out position. </li>\r\n<li>Lower the weight until the elbow touches the ground, keeping the kettlebell above the elbow. Repeat for the desired number of repetitions.</li>\r\n</ol>\n',0,345,346,290,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/leg-over-floor-press',2,'0.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/543/Male/m/543_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/543/Male/m/543_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/543/Female/m/543_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/543/Female/m/543_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (243,'Machine Bench Press','        <p>\r\n        </p><p>\r\n</p><ol><li>Load an appropriate weight onto the pins and adjust the seat for your height. The handles should be near the bottom or middle of the pectorals at the beginning of the motion.</li>\r\n<li> Your chest and head should be up and your shoulder blades retracted. This will be your starting position.</li>\r\n<li> Press the handles forward by extending through the elbow. </li>\r\n<li> After a brief pause at the top, return the weight just above the start position, keeping tension on the muscles by not returning the weight to the stops until the set is complete.\r\n</li>\r\n</ol>\r\n',0,353,354,330,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/machine-bench-press',2,'0.0',4,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/889/Male/m/889_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/889/Male/m/889_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/889/Female/m/889_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/889/Female/m/889_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (247,'Neck Press','\n        <p>\n        </p><p></p><ol><li> Lie back on a flat bench.  Using a medium-width grip (a grip that creates a 90-degree angle in the middle of the movement between the forearms and the upper arms), lift the bar from the rack and hold it straight over your neck with your arms locked.  This will be your starting position.</li>\r\n\r\n	<li> As you breathe in, come down slowly until you feel the bar on your neck.</li>\r\n\r\n	<li> After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles.  Lock your arms and squeeze your chest in the contracted position, hold for a second and then start coming down slowly again.  <strong>Tip:</strong> It should take at least twice as long to go down than to come up).</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n	<li> When you are done, place the bar back in the rack.</li>\r\n</ol><p><strong>Caution:</strong></p> \r\n<p></p><ul><li> It is imperative that if you are new at this exercise, it is advised that you use a spotter.  If no spotter is available, then be conservative with the amount of weight used.</li>\r\n\r\n	<li> For obvious reasons you need to be in full control of the barbell at all times.</li>\r\n</ul>\n',0,355,356,340,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/neck-press',2,'8.7',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/274/Male/m/274_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/274/Male/m/274_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/274/Female/m/274_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/274/Female/m/274_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (248,'One Arm Dumbbell Bench Press','\n        <p>\n        </p><p></p><ol><li>Lie down on a flat bench with a dumbbell in one hand on top of your thigh.</li>\r\n\r\n<li>By using your thigh to help you get the dumbbell up, clean the dumbbell up so that you can hold it in front of you at shoulder width.  Use the hand you are not lifting with to help position the dumbbell over you properly.</li>\r\n\r\n<li>Once at shoulder width, rotate your wrist forward so that the palm of your hand is facing away from you.  This will be your starting position.</li>\r\n\r\n<li>Bring down the weights slowly to your side as you breathe in.  Keep full control of the dumbbell at all times.  <strong>Tip:</strong> Use the hand that you are not lifting with to help keep the dumbbell balance as you may struggle a bit at first.  Only use your non-lifting hand if it is needed.  Otherwise, keep it resting to the side.</li>\r\n\r\n<li>As you breathe out, push the dumbbells up using your pectoral muscles.  Lock your arms in the contracted position, squeeze your chest, hold for a second and then start coming down slowly.  <strong>Tip:</strong> It should take at least twice as long to go down than to come up.</li>\r\n\r\n<li>Repeat the movement for the prescribed amount of repetitions of your training program.</li>\r\n\r\n<li>Switch arms and repeat the movement.</li>\r\n</ol><p><strong>Caution:</strong> When you are done, do not drop the dumbbell next to you as this is dangerous to your rotator cuff in your shoulders and others working out around you.</p>\r\n\r\n<p>Just lift your legs from the floor bending at the knees, twist your wrist so that you can place the dumbbell on top of your thigh.  When the dumbbell is touching your thigh simultaneously push your upper torso up (while pressing the dumbbell on your thigh) and also perform a slight kick forward with your legs (keeping the dumbbell on top of the thigh).  By doing this combined movement, momentum will help you get back to a sitting position with the dumbbell still on top of your thigh.  At this moment you can place the dumbbell on the floor.</p>\r\n\n    \n',0,357,358,350,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-dumbbell-bench-press',2,'8.0',1,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/246/Male/m/246_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/246/Male/m/246_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/246/Female/m/246_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/246/Female/m/246_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (249,'One-Arm Flat Bench Dumbbell Flye','\n        <p>\n        </p><p></p><ol><li>Lie down on a flat bench with a dumbbell in one hand resting on top of your thigh. The palm of your hand with the dumbbell in it should be at a neutral grip.</li>\r\n\r\n<li>By using your thighs to help you get the dumbbell up, clean the dumbbell so that you can hold it in front of you with your lifting arm being fully extended.  Remember to maintain a neutral grip with this exercise.  Your non lifting hand should be to the side holding the flat bench for better support.  This will be your starting position.</li>\r\n\r\n<li>Your arm with the weight should have a slight bend on your elbow in order to prevent stress at the biceps tendon. Begin by lowering your arm with the weight in it out in a wide arc until you feel a stretch on your chest.  Breathe in as you perform this portion of the movement.  <strong>Tip:</strong> Keep in mind that throughout the movement, your lifting arm should remain stationary; the movement should only occur at the shoulder joint.</li>\r\n\r\n<li>Return your lifting arm back to the starting position as you squeeze your chest muscles and breathe out.  <strong>Tip:</strong> Make sure to use the same arc of motion used to lower the weights.</li>\r\n\r\n<li>Hold for a second at the contracted position and repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n<li>Switch arms and repeat the exercise.</li>\r\n</ol><p><strong>Variations:</strong> You may want to use a palms facing forward version for different stimulation.</p>\r\n\n    \n',0,359,360,360,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-flat-bench-dumbbell-flye',1,'6.6',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/164/Male/m/164_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/164/Male/m/164_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/164/Female/m/164_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/164/Female/m/164_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif');
INSERT INTO `exercise_type` (`type_id`,`name`,`description`,`form_type`,`tree_left`,`tree_right`,`tree_order`,`tree_level`,`tree_parent_id`,`link`,`mechanics_type`,`rating`,`force_type`,`equipment`,`type_img`,`guide_img`) VALUES 
 (250,'One-Arm Kettlebell Floor Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Lie on the floor holding a kettlebell with one hand, with your upper arm supported by the floor. The palm should be facing in.</li>\r\n<li> Press the kettlebell straight up toward the ceiling, rotating your wrist.</li>\r\n<li> Lower the kettlebell back to the starting position and repeat. </li>\r\n</ol>\n',0,361,362,370,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-kettlebell-floor-press',2,'0.0',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/515/Male/m/515_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/515/Male/m/515_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/515/Female/m/515_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/515/Female/m/515_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (251,'Plyo Kettlebell Pushups','\n        <p>\n        </p><p>\r\n</p><ol><li>Place a kettlebell on the floor. Place yourself in a pushup position, on your toes with one hand on the ground and one hand holding the kettlebell, with your elbows extended. This will be your starting position.</li>\r\n<li> Begin by lowering yourself as low as you can, keeping your back straight.</li>\r\n<li> Quickly and forcefully reverse direction, pushing yourself up to the other side of the kettlebell, switching hands as you do so. Continue the movement by descending and repeating the movement back and forth.</li>\r\n\n    </ol>\n',0,363,364,380,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/plyo-kettlebell-pushups',2,'8.4',1,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/644/Male/m/644_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/644/Male/m/644_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/644/Female/m/644_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/644/Female/m/644_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (252,'Push Up to Side Plank','\n        <p>\n        </p><p>\r\n</p><ol><li>Get into pushup position on the toes with your hands just outside of shoulder width.</li>\r\n<li> Perform a pushup by allowing the elbows to flex. As you descend, keep your body straight. </li>\r\n<li>Do one pushup and as you come up, shift your weight on the left side of the body, twist to the side while bringing the right arm up towards the ceiling in a side plank.</li>\r\n<li> Lower the arm back to the floor for another pushup and then twist to the other side.</li>\r\n<li> Repeat the series, alternating each side, for 10 or more reps.</li>\r\n</ol>\n',0,365,366,390,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/push-up-to-side-plank',2,'0.0',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/844/Male/m/844_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/844/Male/m/844_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/844/Male/m/844_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (253,'Push-Ups With Feet Elevated','\n        <p>\n        </p><p></p><ol><li> Lie on the floor face down and place your hands about 36 inches apart from each other holding your torso up at arms length.</li>\r\n\r\n	<li> Place your toes on top of a flat bench.  This will allow your body to be elevated.  <strong>Note:</strong> The higher the elevation of the flat bench, the higher the resistance of the exercise is.</li>\r\n\r\n	<li> Lower yourself until your chest almost touches the floor as you inhale.</li>\r\n\r\n	<li> Using your pectoral muscles, press your upper body back up to the starting position and squeeze your chest. Breathe out as you perform this step.</li>\r\n\r\n	<li> After a second pause at the contracted position, repeat the movement for the prescribed amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> Another way to perform this exercise is to use an exercise ball to elevate your body instead of a flat bench.  This adds a level of difficulty due to the instability provided.</p> \r\n\r\n<p><strong>See Also:</strong> <a href=\"http://www.bodybuilding.com/fun/exercises.php?Name=Pushups\">Push-Up</a></p>\n    \n',0,367,368,400,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/push-ups-with-feet-elevated',2,'8.3',1,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/103/Male/m/103_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/103/Male/m/103_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/103/Female/m/103_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/103/Female/m/103_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (254,'Push-Ups With Feet On An Exercise Ball','\n        <p>\n        </p><p></p><ol><li> Lie on the floor face down and place your hands about 36 inches apart from each other holding your torso up at arms length.</li>\r\n\r\n	<li> Place your toes on top of an exercise ball.  This will allow your body to be elevated. </li>\r\n\r\n	<li> Lower yourself until your chest almost touches the floor as you inhale.</li>\r\n\r\n	<li> Using your pectoral muscles, press your upper body back up to the starting position and squeeze your chest. Breathe out as you perform this step.</li>\r\n\r\n	<li> After a second pause at the contracted position, repeat the movement for the prescribed amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> Another way to perform this exercise is to use a flat bench to elevate your body instead of an exercise ball.</p>\r\n\r\n<p><strong>See Also:</strong> <a href=\"http://www.bodybuilding.com/fun/exercises.php?Name=Pushups\">Push-Up</a></p>\n    \n',0,369,370,410,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/push-ups-with-feet-on-an-exercise-ball',2,'8.4',1,7,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/126/Male/m/126_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/126/Male/m/126_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/126/Female/m/126_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/126/Female/m/126_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (255,'Pushups','\n        <p>\n        </p><p></p><ol><li>Lie on the floor face down and place your hands about 36 inches apart while holding your torso up at arms length.</li>\r\n\r\n<li>Next, lower yourself downward until your chest almost touches the floor as you inhale.</li>\r\n\r\n<li>Now breathe out and press your upper body back up to the starting position while squeezing your chest.</li>\r\n\r\n<li>After a brief pause at the top contracted position, you can begin to lower yourself downward again for as many repetitions as needed.</li>\r\n</ol><p><strong>Variations:</strong></p>\r\n\r\n<p>If you are new at this exercise and do not have the strength to perform it, you can either bend your legs at the knees to take off resistance or perform the exercise against the wall instead of the floor.</p>\r\n\r\n<p>For the most advanced lifters, you can place your feet at a high surface such as a bench in order to increase the resistance and to target the upper chest more.</p>\n    \n',0,371,372,420,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/pushups',2,'9.2',1,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/70/Male/m/70_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/70/Male/m/70_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/70/Female/m/70_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/70/Female/m/70_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (256,'Pushups (Close and Wide Hand Positions)','\n        <p>\n        </p><p></p><ol><li> Lie on the floor face down and body straight with your toes on the floor and the hands wider than shoulder width for a wide hand position and closer than shoulder width for a close hand position. Make sure you are holding your torso up at arms length.</li>\r\n\r\n	<li> Lower yourself until your chest almost touches the floor as you inhale.</li>\r\n\r\n	<li> Using your pectoral muscles, press your upper body back up to the starting position and squeeze your chest. Breathe out as you perform this step.</li>\r\n\r\n	<li> After a second pause at the contracted position, repeat the movement for the prescribed amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p> \r\n\r\n<p></p><ul><li> If you are new at this exercise and do not have the strength to perform it, you can either bend your legs at the knees to take off resistance or perform the exercise against the wall instead of the floor.</li>\r\n\r\n	<li> For the most advanced lifters, you can place your feet at a high surface such as a bench in order to increase the resistance and to target the upper chest more.</li>\r\n</ul><p><strong>See Also:</strong> <a href=\"http://www.bodybuilding.com/fun/exercises.php?Name=Pushups\">Pushups</a></p>\n    \n',0,373,374,430,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/pushups-close-and-wide-hand-positions',2,'8.9',1,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/81/Male/m/81_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/81/Male/m/81_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/81/Female/m/81_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/81/Female/m/81_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (257,'Smith Machine Bench Press','\n        <p>\n        </p><p></p><ol><li> Place a flat bench underneath the smith machine.  Now place the barbell at a height that you can reach when lying down and your arms are almost fully extended.  Once the weight you need is selected, lie down on the flat bench.  Using a pronated grip that is wider than shoulder width, unlock the bar from the rack and hold it straight over you with your arms locked.  This will be your starting position.</li>\r\n\r\n	<li> As you breathe in, come down slowly until you feel the bar on your middle chest.</li>\r\n\r\n	<li> After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles.  Lock your arms in the contracted position, hold for a second and then start coming down slowly again. <strong>Tip:</strong> It should take at least twice as long to go down than to come up.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n	<li> When you are done, lock the bar back in the rack.</li>\r\n</ol><p><strong>Caution:</strong> If you are new at this exercise, it is advised that you use a spotter.  If no spotter is available, then be conservative with the amount of weight used.</p>  \r\n\r\n<p>Same as the <a href=\"http://www.bodybuilding.com/fun/exercises.php?Name=Barbell+Bench+Press+-+Medium+Grip\">Barbell Bench Press</a> but with a Smith Machine.</p>\n    \n',0,375,376,440,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/smith-machine-bench-press',2,'8.5',1,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/159/Male/m/159_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/159/Male/m/159_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/159/Female/m/159_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/159/Female/m/159_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (258,'Smith Machine Incline Bench Press','\n        <p>\n        </p><p></p><ol><li> Place an incline bench underneath the smith machine.  Place the barbell at a height that you can reach when lying down and your arms are almost fully extended.  Once the weight you need is selected, lie down on the incline bench and make sure your upper chest is aligned with the barbell.  Using a pronated grip (palms facing forward) that is wider than shoulder width, unlock the bar from the rack and hold it straight over you with your arms locked.  This will be your starting position.</li>\r\n\r\n	<li> As you breathe in, come down slowly until you feel the bar on your upper chest.</li>\r\n\r\n	<li> After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles.  Lock your arms in the contracted position, hold for a second and then start coming down slowly again. <strong>Tip:</strong> It should take at least twice as long to go down than to come up.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n\r\n	<li> When you are done, place the bar back in the rack.</li>\r\n</ol><p><strong>Caution:</strong> If you are new at this exercise, it is advised that you use a spotter as this exercise can be a bit challenging.  If no spotter is available, then be conservative with the amount of weight used.</p>  \r\n\r\n<p>Same as the <a href=\"http://www.bodybuilding.com/fun/exercises.php?Name=Barbell+Incline+Bench+Press+-+Medium+Grip\">Barbell Incline Bench Press</a> but with a Smith Machine.</p>\n    \n',0,377,378,450,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/smith-machine-incline-bench-press',2,'7.7',1,10,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/188/Male/m/188_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/188/Male/m/188_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/188/Female/m/188_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/188/Female/m/188_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (259,'Standing Cable Chest Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Position dual pulleys to chest height and select an appropriate weight. Stand a foot or two in front of the cables, holding one in each hand. You can stagger your stance for better stability.</li>\r\n<li> Position the upper arm at a 90 degree angle with the shoulder blades together. This will be your starting position.</li>\r\n<li> Keeping the rest of the body stationary, extend through the elbows to press the handles forward, drawing them together in front of you.</li>\r\n<li> Pause at the top of the motion, and return to the starting position.\r\n</li>\r\n</ol>\n',0,379,380,460,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/standing-cable-chest-press',2,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/919/Male/m/919_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/919/Male/m/919_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/919/Female/m/919_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/919/Female/m/919_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (260,'Straight-Arm Dumbbell Pullover','\n        <p>\n        </p><p></p><ol><li> Place a dumbbell standing up on a flat bench.</li>\r\n\r\n	<li> Ensuring that the dumbbell stays securely placed at the top of the bench, lie perpendicular to the bench (torso across it as in forming a cross) with only your shoulders lying on the surface.  Hips should be below the bench and legs bent with feet firmly on the floor.  The head will be off the bench as well.</li>\r\n\r\n	<li> Grasp the dumbbell with both hands and hold it straight over your chest at arms length.  Both palms should be pressing against the underside one of the sides of the dumbbell.  This will be your starting position. <p><strong>Caution:</strong> Always ensure that the dumbbell used for this exercise is secure.  Using a dumbbell with loose plates can result in the dumbbell falling apart and falling on your face.</p></li>\r\n\r\n	<li> While keeping your arms straight, lower the weight slowly in an arc behind your head while breathing in until you feel a stretch on the chest.</li>\r\n\r\n	<li> At that point, bring the dumbbell back to the starting position using the arc through which the weight was lowered and exhale as you perform this movement.</li>\r\n\r\n	<li> Hold the weight on the initial position for a second and repeat the motion for the prescribed number of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> If you are new to this movement, have a spotter hand you the weight instead.  If not, please ensure that the dumbbell does not fall on you as you arrange your torso to perform the exercise on the bench.  \r\n\r\nAlso, as I already mentioned, ensure that the dumbbell used is in perfect working condition.  Old dumbbells in need of welding should never be used to perform this exercise.\r\n\r\n</p><p><strong>Variations:</strong></p> \r\n<p></p><ul><li> You can perform this exercise using a barbell or an e-z bar instead of dumbbells.</li>\r\n	<li> Also, if using dumbbells like Powerblocks&acirc;&#132;&cent;, just use a dumbbell on each hand with the palms of your hands facing each other.</li>\r\n</ul>\n',0,381,382,470,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/straight-arm-dumbbell-pullover',2,'8.4',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/39/Male/m/39_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/39/Male/m/39_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/39/Female/m/39_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/39/Female/m/39_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (261,'Wide-Grip Barbell Bench Press','\n        <p>\n        </p><p></p><ol><li> Lie back on a flat bench with feet firm on the floor.  Using a wide, pronated (palms forward) grip that is around 3 inches away from shoulder width (for each hand), lift the bar from the rack and hold it straight over you with your arms locked.  The bar will be perpendicular to the torso and the floor.  This will be your starting position.</li>\r\n\r\n	<li> As you breathe in, come down slowly until you feel the bar on your middle chest.</li>\r\n\r\n	<li> After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles.  Lock your arms and squeeze your chest in the contracted position, hold for a second and then start coming down slowly again.  <strong>Tip:</strong> It should take at least twice as long to go down than to come up.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong></p>\r\n \r\n<p></p><ul><li> If you are new at this exercise, it is advised that you use a spotter.  If no spotter is available, then be conservative with the amount of weight used.</li>\r\n\r\n	<li> Also, beware of letting the bar drift too far forward.  You want the bar to fall on your middle chest and nowhere else.</li>\r\n\r\n	<li> Don\'t bounce the weight off your chest.  You should be in full control of the barbell at all times.</li>\r\n</ul><p><strong>Variations:</strong> You can use dumbbells for this exercise as well as exercise bands.</p>\r\n\r\n<p>Same as the <a href=\"http://www.bodybuilding.com/fun/exercises.php?Name=Barbell+Bench+Press+-+Medium+Grip\">Barbell Bench Press</a> but with a different grip.</p>\n    \n',0,383,384,480,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/wide-grip-barbell-bench-press',2,'8.7',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/33/Male/m/33_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/33/Male/m/33_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/33/Female/m/33_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/33/Female/m/33_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (262,'Wide-Grip Decline Barbell Bench Press','\n        <p>\n        </p><p></p><ol><li> Lie back on a decline bench with the feet securely locked at the front of the bench.  Using a wide, pronated (palms forward) grip that is around 3 inches away from shoulder width (for each hand), lift the bar from the rack and hold it straight over you with your arms locked.  The bar will be perpendicular to the torso and the floor.  This will be your starting position.</li>\r\n\r\n	<li> As you breathe in, come down slowly until you feel the bar on your lower chest.</li>\r\n\r\n	<li> After a second pause, bring the bar back to the starting position as you breathe out and push the bar using your chest muscles.  Lock your arms and squeeze your chest in the contracted position, hold for a second and then start coming down slowly again.  <strong>Tip:</strong> It should take at least twice as long to go down than to come up.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong></p> \r\n\r\n<p></p><ul><li> If you are new at this exercise, it is advised that you use a spotter.  If no spotter is available, then be conservative with the amount of weight used.</li>\r\n\r\n	<li> Also, beware of letting the bar drift too far forward.  You want the bar to fall on your middle chest and nowhere else.</li>\r\n\r\n	<li> Don\'t bounce the weight off your chest.  You should be in full control of the barbell at all times.</li>\r\n</ul><p><strong>Variations:</strong> You can use dumbbells for this exercise as well as exercise bands.</p>\r\n\r\n<p>Same as the <a href=\"http://www.bodybuilding.com/fun/exercises.php?Name=Decline+Barbell+Bench+Press\">Decline Barbell Bench Press</a> but with a wider grip.</p>\n    \n',0,385,386,490,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/wide-grip-decline-barbell-bench-press',2,'8.5',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/35/Male/m/35_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/35/Male/m/35_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/35/Female/m/35_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/35/Female/m/35_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (263,'Wide-Grip Decline Barbell Pullover','\n        <p>\n        </p><p></p><ol><li> Lie down on a decline bench with both legs securely locked in position.  Reach for the barbell behind the head using a pronated grip (palms facing out).  Make sure to grab the barbell wider than shoulder width apart for this exercise.  Slowly lift the barbell up from the floor by using your arms.</li>\r\n\r\n	<li> When positioned properly, your arms should be fully extended and perpendicular to the floor.  This is the starting position.</li>\r\n\r\n	<li> Begin by moving the barbell back down in a semicircular motion as if you were going to place it on the floor, but instead, stop when the arms are parallel to the floor.  <strong>Tip:</strong> Keep the arms fully extended at all times.  The movement should only happen at the shoulder joint.  Inhale as you perform this portion of the movement.</li>\r\n\r\n	<li> Now bring the barbell up while exhaling until you are back at the starting position.  Remember to keep full control of the barbell at all times.</li>\r\n\r\n	<li> Repeat the movement for the prescribed amount of repetitions of your training program.</li>\r\n\r\n	<li> When finished with your set, slowly lower the barbell back down until it is level with your head and release it.</li>\r\n</ol><p><strong>Caution:</strong> It is a good idea to have a spotter for this exercise.</p>  \r\n\r\n<p><strong>Variations:</strong> You can also use an EZ bar or dumbbells to perform this movement.</p>\n    \n',0,387,388,500,2,54,'http://www.bodybuilding.com/exercises/detail/view/name/wide-grip-decline-barbell-pullover',2,'5.5',2,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/275/Male/m/275_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/275/Male/m/275_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/275/Female/m/275_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/275/Female/m/275_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/1.gif'),
 (266,'Ab Roller','\n        <p>\n        </p><p></p><ol><li>Hold the Ab Roller with both hands and kneel on the floor.</li>\r\n\r\n<li>Now place the ab roller on the floor in front of you so that you are on all your hands and knees (as in a kneeling push up position).  This will be your starting position.</li>\r\n\r\n<li>Slowly roll the ab roller straight forward, stretching your body into a straight position. Tip: Go down as far as you can without touching the floor with your body.  Breathe in during this portion of the movement.</li>\r\n \r\n<li>After a pause at the stretched position, start pulling yourself back to the starting position as you breathe out.  Tip: Go slowly and keep your abs tight at all times.</li>\r\n</ol><p><strong>Caution:</strong>   This exercise is not advised for people with lower back problems or hernias.</p>\r\n \r\n<p><strong>Variations:</strong> If you are advanced you can perform the exercise moving the ab roller to the sides in a diagonal fashion as opposed to straight forward.  This version places more emphasis on the obliques.</p>\n    \n',0,395,396,20,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/ab-roller',2,'8.9',2,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/110/Male/m/110_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/110/Male/m/110_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/110/Male/m/110_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/110/Male/m/110_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/110/Female/m/110_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/110/Female/m/110_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/110/Female/m/110_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/110/Female/m/110_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (267,'Advanced Kettlebell Windmill','\n        <p>\n        </p><p>\r\n</p><ol><li> Clean and press a kettlebell overhead with one arm.</li>\r\n<li> Keeping the kettlebell locked out at all times, push your butt out in the direction of the locked out kettlebell. Keep the non-working arm behind your back and turn your feet out at a forty-five degree angle from the arm with the kettlebell.</li>\r\n<li> Lower yourself as far as possible.</li>\r\n<li> Pause for a second and reverse the motion back to the starting position.</li>\r\n</ol>\n',0,397,398,30,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/advanced-kettlebell-windmill',1,'9.0',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/502/Male/m/502_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/502/Male/m/502_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/502/Female/m/502_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/502/Female/m/502_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (269,'Alternate Heel Touchers','\n        <p>\n        </p><p></p><ol><li>Lie on the floor with the knees bent and the feet on the floor around 18-24 inches apart.  Your arms should be extended by your side.  This will be your starting position.</li>\r\n\r\n<li>Crunch over your torso forward and up about 3-4 inches to the right side and touch your right heel as you hold the contraction for a second.  Exhale while performing this movement.</li>\r\n\r\n<li>Now go back slowly to the starting position as you inhale.</li>\r\n\r\n<li>Now crunch over your torso forward and up around 3-4 inches to the left side and touch your left heel as you hold the contraction for a second.  Exhale while performing this movement and then go back to the starting position as you inhale.  Now that both heels have been touched, that is considered 1 repetition.</li>\r\n\r\n<li>Continue alternating sides in this manner until all prescribed repetitions are done.</li>\r\n</ol><p><strong>Variations:</strong> None</p>\r\n\n    \n',0,401,402,50,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/alternate-heel-touchers',1,'7.8',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/105/Male/m/105_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/105/Male/m/105_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/105/Female/m/105_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/105/Female/m/105_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (270,'Barbell Ab Rollout','\n        <p>\n        </p><p></p><ol><li>For this exercise you will need to get into a pushup position, but instead of having your hands of the floor, you will be grabbing on to an Olympic barbell (loaded with 5-10 lbs on each side) instead.  This will be your starting position.</li>\r\n\r\n<li>While keeping a slight arch on your back, lift your hips and roll the barbell towards your feet as you exhale. Tip: As you perform the movement, your glutes should be coming up, you should be keeping the abs tight and should maintain your back posture at all times.  Also your arms should be staying perpendicular to the floor throughout the movement.  If you don\'t, you will work out your shoulders and back more than the abs.</li>\r\n\r\n<li>After a second contraction at the top, start to roll the barbell back forward to the starting position slowly as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong>  This is a challenging exercise for people with healthy backs.</p>\r\n\r\n<p><strong>Variation:</strong> This is an exercise that, just like the push-up, can also be done on the knees for less advanced athletes.</p>\n    \n',0,403,404,60,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-ab-rollout',2,'8.9',4,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/207/Male/m/207_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/207/Male/m/207_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/207/Female/m/207_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/207/Female/m/207_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (271,'Barbell Side Bend','\n        <p>\n        </p><p></p><ol><li>Stand up straight while holding a barbell placed on the back of your shoulders (slightly below the neck).  Your feet should be shoulder width apart. This will be your starting position.</li>\r\n\r\n<li>While keeping your back straight and your head up, bend only at the waist to the right as far as possible.  Breathe in as you bend to the side.  Then hold for a second and come back up to the starting position as you exhale. Tip: Keep the rest of the body stationary.</li>\r\n\r\n<li>Now repeat the movement but bending to the left instead.  Hold for a second and come back to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Use caution if you have lower back problems, or avoid this exerise altogether.</p>\r\n\r\n<p><strong>Variations:</strong> You can also do this exercise while seating on a bench or with dumbbells in your hands.</p>\r\n\n    \n',0,405,406,70,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/barbell-side-bend',1,'7.6',4,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/87/Male/m/87_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/87/Male/m/87_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/87/Male/m/87_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/87/Female/m/87_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/87/Female/m/87_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (272,'Bent Press','\n        <p>\n        </p><p>\r\n</p><ol><li>Clean a kettlebell to your shoulder.  Clean the kettlebell to your shoulders by extending through the legs and hips as you raise the kettlebell towards your shoulder. The wrist should rotate as you do so. This will be your starting position.</li>\r\n<li> Begin my leaning to the side opposite the kettlebell, continuing until you are able to touch the ground with your free hand, keeping your eyes on the kettlebell.  As you do so, press the weight vertically be extending through the elbow, keeping your arm perpendicular to the ground.</li>\r\n<li> Return to an upright position, with the kettlebell above your head. Return the kettlebell to the shoulder and repeat for the desired number of repetitions.</li>\r\n</ol>\n',0,407,408,80,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/bent-press',2,'6.2',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/196/Male/m/196_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/196/Male/m/196_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/196/Male/m/196_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/196/Female/m/196_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/196/Female/m/196_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/196/Female/m/196_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (273,'Bent-Knee Hip Raise','\n        <p>\n        </p><p></p><ol><li>Lay flat on the floor with your arms next to your sides.</li>\r\n\r\n<li>Now bend your knees at around a 75 degree angle and lift your feet off the floor by around 2 inches.</li>\r\n\r\n<li>Using your lower abs, bring your knees in towards you as you maintain the 75 degree angle bend in your legs.  Continue this movement until you raise your hips off of the floor by rolling your pelvis backward.  Breathe out as you perform this portion of the movement. Tip: At the end of the movement your knees will be over your chest.</li>\r\n\r\n<li>Squeeze your abs at the top of the movement for a second and then return to the starting position slowly as you breathe in. Tip: Maintain a controlled motion at all times.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can straighten your legs to make it harder or wear ankle weights.</p>\n    \n',0,409,410,90,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/bent-knee-hip-raise',2,'8.0',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/118/Male/m/118_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/118/Male/m/118_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/118/Female/m/118_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/118/Female/m/118_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (274,'Bosu Ball Cable Crunch With Side Bends','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nConnect a standard handle to each arm of a cable machine, and position them in the most downward position.</li>\r\n<li>\r\nGrab a Bosu Ball and position it in front and center of the cable machine.\r\n</li>\r\n<li>\r\nLie down on the Bosu Ball with the small of your back arched around the ball. Your rear end should be close to the floor without touching it.</li>\r\n<li>\r\nWith both hands, reach back and grab the handle of each cable.</li>\r\n<li>\r\nWith your feet positioned in a wide stance, extend your arms straight out in front of you and in between your knees. Your hands should be at knee level.</li>\r\n<li>\r\nKeep your arms straight and in-line with the upward angle of the cable. Elevate your torso in a crunching motion without dropping or bending your arms.</li>\r\n<li>\r\nMaintain the rigid position with your arms. Slowly descend back to the starting position with your back arched around the Bosu Ball and your abdominals elongated.</li>\r\n<li>\r\nRepeat the same series of movements to failure.\r\n</li>\r\n<li>\r\nOnce you reach failure, keep your abs tight and raise your torso into plank position so your back is elevated off the Bosu Ball.</li>\r\n<li>\r\nLower your arms down to your side; keep them straight. Start doing alternating side bends; reach for your heels! This finishing movement will focus on your obliques.\r\n</li>\r\n</ol>\r\nTip: Arch your back around the Bosu Ball before each rep to fully elongate your abdominals. This will provide a full range of motion and lengthen your muscle fibers, giving them a much fuller appearance.\r\n\n    \n',0,411,412,100,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/bosu-ball-cable-crunch-with-side-bends',1,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/932/Male/m/932_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/932/Male/m/932_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/932/Male/m/932_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/932/Female/m/932_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/932/Female/m/932_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/932/Female/m/932_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/932/Female/m/932_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (275,'Butt-Ups','\n        <p>\n        </p><p></p><ol><li>Begin a pushup position but with your elbows on the ground and resting on your forearms. Your arms should be bent at a 90 degree angle.</li>\r\n\r\n<li>Arch your back slightly out rather than keeping your back completely straight.</li>\r\n\r\n<li>Raise your glutes toward the ceiling, squeezing your abs tightly to close the distance between your ribcage and hips.  The end result will be that you&acirc;&#128;&#153;ll end up in a high bridge position. Exhale as you perform this portion of the movement.</li>\r\n\r\n<li>Lower back down slowly to your starting position as you breathe in. Tip: Don\'t let your back sag downwards.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> None</p>\r\n\n    \n',0,413,414,110,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/butt-ups',2,'8.5',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/127/Male/m/127_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/127/Male/m/127_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/127/Female/m/127_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/127/Female/m/127_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (276,'Cable Crunch','\n        <p>\n        </p><p></p><ol><li>Kneel below a high pulley that contains a rope attachment.</li>\r\n\r\n<li>Grasp cable rope attachment and lower the rope until your hands are placed next to your face.</li>\r\n\r\n<li>Flex your hips slightly and allow the weight to hyperextend the lower back. This will be your starting position.</li>\r\n\r\n<li>With the hips stationary, flex the waist as you contract the abs so that the elbows travel towards the middle of the thighs. Exhale as you perform this portion of the movement and hold the contraction for a second.</li>\r\n\r\n<li>Slowly return to the starting position as you inhale.  <strong>Tip:</strong> Make sure that you keep constant tension on the abs throughout the movement.  Also, do not choose a weight so heavy that the lower back handles the brunt of the work.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with a handle instead so that you can concentrate on each side of the abs separately by performing the exercise to the side.</p>\r\n\n    \n',0,415,416,120,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/cable-crunch',1,'8.5',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/163/Male/m/163_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/163/Male/m/163_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/163/Female/m/163_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/163/Female/m/163_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (277,'Cable Judo Flip','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nConnect a rope attachment to a tower, and move the cable to the lowest pulley position. Stand with your side to the cable with a wide stance, and grab the rope with both hands.</li>\r\n<li>\r\nTwist your body away from the pulley as you bring the rope over your shoulder like you&acirc;&#128;&#153;re performing a judo flip.</li>\r\n<li>\r\nShift your weight between your feet as you twist and crunch forward, pulling the cable downward.</li>\r\n<li>\r\nReturn to the starting position and repeat until failure.</li>\r\n<li>\r\nThen, reposition and repeat the same series of movements on the opposite side.</li>\r\n</ol>\r\nTip: Although this should be one continuous movement, think of it as two separate ab movements: the twist for obliques and the crunch for abs. This will help with the mind-muscle connection. Also, over exaggerate the end of the crunch by pausing for a moment and clinching your abs in an isometric hold before releasing.\r\n\n    \n',0,417,418,130,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/cable-judo-flip',2,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/939/Male/m/939_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/939/Male/m/939_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (278,'Cable Reverse Crunch','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nConnect an ankle strap attachment to a low pulley cable and position a mat on the floor in front of it.</li>\r\n<li>\r\nSit down with your feet toward the pulley and attach the cable to your ankles.</li>\r\n<li>\r\nLie down, elevate your legs and bend your knees at a 90-degree angle. Your legs and the cable should be aligned. If not, adjust the pulley up or down until they are.</li>\r\n<li>\r\nWith your hands behind your head, bring your knees inward to your torso and elevate your hips off the floor.</li>\r\n<li>\r\nPause for a moment and in a slow and controlled manner drop your hips and bring your legs back to the starting 90-degree angle. You should still have tension on your abs in the resting position.</li>\r\n<li>\r\nRepeat the same movement to failure.</li>\r\n</ol>\r\nTip: Don&acirc;&#128;&#153;t put pressure against your neck when your hands are behind your head. This position is only to keep your upper back slightly elevated so your upper abs engage. If you tweak your neck, then reposition your arms at your side.\r\n\n    \n',0,419,420,140,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/cable-reverse-crunch',1,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/938/Male/m/938_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/938/Male/m/938_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/938/Female/m/938_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/938/Female/m/938_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (279,'Cable Russian Twists','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nConnect a standard handle attachment, and position the cable to a middle pulley position.</li>\r\n<li>\r\nLie on a stability ball perpendicular to the cable and grab the handle with one hand. You should be approximately arm&acirc;&#128;&#153;s length away from the pulley, with the tension of the weight on the cable.</li>\r\n<li>\r\nGrab the handle with both hands and fully extend your arms above your chest. You hands should be directly in-line with the pulley. If not, adjust the pulley up or down until they are.</li>\r\n<li>\r\nKeep your hips elevated and abs engaged. Rotate your torso away from the pulley for a full-quarter rotation. Your body should be flat from head to knees.</li>\r\n<li>\r\nPause for a moment and in a slow and controlled manner reset to the starting position. You should still have side tension on the cable in the resting position.</li>\r\n<li>\r\nRepeat the same movement to failure.</li>\r\n<li>\r\nThen, reposition and repeat the same series of movements on the opposite side.</li>\r\n</ol>\r\nTip: It&acirc;&#128;&#153;s extremely important to keep your hips elevated during this exercise. If you do it correctly, your upper back will be on the ball, but your lower back and rear-end will be completely unsupported. Keeping your hips elevated will engage your core (lower back and abdominals), and make the exercise more effective.\r\n\n    \n',0,421,422,150,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/cable-russian-twists',2,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/940/Male/m/940_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/940/Male/m/940_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/940/Female/m/940_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/940/Female/m/940_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (280,'Cable Seated Crunch','\n        <p>\n        </p><p></p><ol><li> Seat on a flat bench with your back facing a high pulley.</li>\r\n\r\n	<li> Grasp the cable rope attachment with both hands (with the palms of the hands facing each other) and place your hands securely over both shoulders. <strong>Tip:</strong> Allow the weight to hyperextend the lower back slightly. This will be your starting position.</li>\r\n\r\n	<li> With the hips stationary, flex the waist so the elbows travel toward the hips. Breathe out as you perform this step.</li>\r\n\r\n	<li> As you inhale, go back to the initial position slowly.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> Exercise bands can be used for this exercise.</p>\n    \n',0,423,424,160,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/cable-seated-crunch',1,'7.9',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/316/Male/m/316_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/316/Male/m/316_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/316/Female/m/316_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/316/Female/m/316_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (281,'Cross-Body Crunch','\n        <p>\n        </p><p></p><ol><li> Lie flat on your back and bend your knees about 60 degrees.</li>\r\n\r\n	<li> Keep your feet flat on the floor and place your hands loosely behind your head. This will be your starting position.</li>\r\n\r\n	<li> Now curl up and bring your right elbow and shoulder across your body while bring your left knee in toward your left shoulder at the same time. Reach with your elbow and try to touch your knee. Exhale as you perform this movement. <strong>Tip:</strong> Try to bring your shoulder up towards your knee rather than just your elbow and remember that the key is to contract the abs as you perform the movement; not just to move the elbow.</li>\r\n\r\n	<li> Now go back down to the starting position as you inhale and repeat with the left elbow and the right knee.</li>\r\n\r\n	<li> Continue alternating in this manner until all prescribed repetitions are done.</li>\r\n</ol><p><strong>Variation:</strong> You can also do all of your repetitions for one side and then switch to the other side.</p>\n    \n',0,425,426,170,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/cross-body-crunch',2,'9.2',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/124/Male/m/124_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/124/Male/m/124_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/124/Female/m/124_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/124/Female/m/124_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (282,'Crunch - Hands Overhead','\n        <p>\n        </p><p></p><ol><li> Lie on the floor with your back flat and knees bent with around a 60-degree angle between the hamstrings and the calves.</li>\r\n\r\n	<li> Keep your feet flat on the floor and stretch your arms overhead with your palms crossed. This will be your starting position.</li>\r\n\r\n	<li> Curl your upper body forward and bring your shoulder blades just off the floor. At all times, keep your arms aligned with your head, neck and shoulder. Don\'t move them forward from that position.  Exhale as you perform this portion of the movement and hold the contraction for a second.</li>\r\n\r\n	<li> Slowly lower down to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> For the most advanced lifters, a weighted plate can be held in your hands.</p>\n    \n',0,427,428,180,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/crunch-hands-overhead',1,'8.4',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/113/Male/m/113_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/113/Male/m/113_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/113/Female/m/113_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/113/Female/m/113_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (283,'Crunch - Legs On Exercise Ball','\n        <p>\n        </p><p></p><ol><li> Lie flat on your back with your feet resting on an exercise ball and your knees bent at a 90 degree angle.</li>\r\n\r\n	<li> Place your feet three to four inches apart and point your toes inward so they touch.</li>\r\n\r\n	<li> Place your hands lightly on either side of your head keeping your elbows in. <strong>Tip:</strong> Don\'t lock your fingers behind your head.</li>\r\n\r\n	<li> Push the small of your back down in the floor in order to better isolate your abdominal muscles. This will be your starting position.</li>\r\n\r\n	<li> Begin to roll your shoulders off the floor and continue to push down as hard as you can with your lower back. Your shoulders should come up off the floor only about four inches, and your lower back should remain on the floor.  Breathe out as you execute this portion of the movement.  Squeeze your abdominals hard at the top of the contraction and hold for a second.  <strong>Tip:</strong> Focus on a slow, controlled movement.  Refrain from using momentum at any time.</li>\r\n\r\n	<li> Slowly go back down to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> For the most advanced lifters, a weighted plate can be held in your hands.</p>\n    \n',0,429,430,190,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/crunch-legs-on-exercise-ball',1,'7.1',4,7,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/116/Male/m/116_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/116/Male/m/116_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/116/Female/m/116_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/116/Female/m/116_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (284,'Crunches','\n        <p>\n        </p><p></p><ol><li> Lie flat on your back with your feet flat on the ground, or resting on a bench with your knees bent at a 90 degree angle. If you are resting your feet on a bench, place them three to four inches apart and point your toes inward so they touch.</li>\r\n\r\n	<li> Now place your hands lightly on either side of your head keeping your elbows in. <strong>Tip:</strong> Don\'t lock your fingers behind your head.</li>\r\n\r\n	<li> While pushing the small of your back down in the floor to better isolate your abdominal muscles, begin to roll your shoulders off the floor.</li>\r\n\r\n	<li> Continue to push down as hard as you can with your lower back as you contract your abdominals and exhale. Your shoulders should come up off the floor only about four inches, and your lower back should remain on the floor. At the top of the movement, contract your abdominals hard and keep the contraction for a second.  <strong>Tip:</strong> Focus on slow, controlled movement - don\'t cheat yourself by using momentum.</li>\r\n\r\n	<li> After the one second contraction, begin to come down slowly again to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> There are many variations for the crunch.  You can perform the exercise with weights, or on top of an exercise ball or on a decline bench.</p>\n    \n',0,431,432,200,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/crunches',1,'8.6',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/102/Male/m/102_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/102/Male/m/102_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/102/Female/m/102_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/102/Female/m/102_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (285,'Decline Crunch','\n        <p>\n        </p><p></p><ol><li> Secure your legs at the end of the decline bench and lie down.</li>\r\n\r\n	<li> Now place your hands lightly on either side of your head keeping your elbows in. <strong>Tip:</strong> Don\'t lock your fingers behind your head.</li>\r\n\r\n	<li> While pushing the small of your back down in the bench to better isolate your abdominal muscles, begin to roll your shoulders off it.</li>\r\n\r\n	<li> Continue to push down as hard as you can with your lower back as you contract your abdominals and exhale. Your shoulders should come up off the bench only about four inches, and your lower back should remain on the bench. At the top of the movement, contract your abdominals hard and keep the contraction for a second.  <strong>Tip:</strong> Focus on slow, controlled movement - don\'t cheat yourself by using momentum.</li>\r\n\r\n	<li> After the one second contraction, begin to come down slowly again to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> There are many variations for the crunch.  You can perform the exercise with weights, or on top of an exercise ball or on a flat bench.</p>\n    \n',0,433,434,210,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/decline-crunch',1,'9.0',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/193/Male/m/193_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/193/Male/m/193_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/193/Female/m/193_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/193/Female/m/193_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (286,'Decline Oblique Crunch','\n        <p>\n        </p><p></p><ol><li> Secure your legs at the end of the decline bench and slowly lay down on the bench.</li>\r\n\r\n	<li> Raise your upper body off the bench until your torso is about 35-45 degrees if measured from the floor.</li>\r\n\r\n	<li> Put one hand beside your head and the other on your thigh.  This will be your starting position.</li>\r\n\r\n	<li> Raise your upper body slowly from the starting position while turning your torso to the left. Continue crunching up as you exhale until your right elbow touches your left knee. Hold this contracted position for a second.  <strong>Tip:</strong> Focus on keeping your abs tight and keeping the movement slow and controlled.</li>\r\n\r\n	<li> Lower your body back down slowly to the starting position as you inhale.</li>\r\n\r\n	<li> After completing one set on the right for the recommended amount of repetitions, switch to your left side. <strong>Tip:</strong> Focus on really twisting your torso and feeling the contraction when you are in the up position.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise on a flat surface or you can also alternate from side to side in each repetition.</p>\n    \n',0,435,436,220,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/decline-oblique-crunch',2,'8.4',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/211/Male/m/211_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/211/Male/m/211_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/211/Female/m/211_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/211/Female/m/211_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (287,'Decline Reverse Crunch','\n        <p>\n        </p><p></p><ol><li>Lie on your back on a decline bench and hold on to the top of the bench with both hands. Don\'t let your body slip down from this position.</li>\r\n\r\n<li>Hold your legs parallel to the floor using your abs to hold them there while keeping your knees and feet together. Tip: Your legs should be fully extended with a slight bend on the knee.  This will be your starting position.</li>\r\n\r\n<li>While exhaling, move your legs towards the torso as you roll your pelvis backwards and you raise your hips off the bench.  At the end of this movement your knees will be touching your chest.</li>\r\n\r\n<li>Hold the contraction for a second and move your legs back to the starting position while inhaling.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p>\r\n<strong>Variations:</strong> You can do the movement on a flat surface and as you get more advanced you can use ankle weights.\r\n</p>\n    \n',0,437,438,230,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/decline-reverse-crunch',2,'9.0',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/194/Male/m/194_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/194/Male/m/194_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/194/Female/m/194_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/194/Female/m/194_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (288,'Double Kettlebell Windmill','\n        <p>\n         </p><p>\r\n</p><ol><li>Place a kettlebell in front of your front foot and clean and press a kettlebell overhead with your opposite arm. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulders. Rotate your wrist as you do so, so that the palm faces forward.</li>\r\n<li> Keeping the kettlebell locked out at all times, push your butt out in the direction of the locked out kettlebell. Turn your feet out at a forty-five degree angle from the arm with the locked out kettlebell. </li>\r\n<li>Bending at the hip to one side, sticking your butt out, slowly lean until you can retrieve the kettlebell from the floor. Keep your eyes on the kettlebell that you hold over your head at all times. </li>\r\n<li>Pause for a second after retrieving the kettlebell from the ground and reverse the motion back to the starting position.</li>\r\n</ol>\n',0,439,440,240,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/double-kettlebell-windmill',3,'2.3',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/508/Male/m/508_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/508/Male/m/508_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/508/Female/m/508_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/508/Female/m/508_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (289,'Dumbbell Side Bend','\n        <p>\n        </p><p></p><ol><li>Stand up straight while holding a dumbbell on the left hand (palms facing the torso) as you have the right hand holding your waist.  Your feet should be placed at shoulder width.  This will be your starting position.</li>\r\n\r\n<li>While keeping your back straight and your head up, bend only at the waist to the right as far as possible.  Breathe in as you bend to the side.  Then hold for a second and come back up to the starting position as you exhale. <strong>Tip:</strong> Keep the rest of the body stationary.</li>\r\n\r\n<li>Now repeat the movement but bending to the left instead.  Hold for a second and come back to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions and then change hands.</li>\r\n</ol><p>\r\n<strong>Caution:</strong> Refrain from using this exercise if your obliques tend to grow easily as wide obliques take away from your symmetry.\r\n</p>\r\n<p>\r\n<strong>Variations:</strong> You can also do this exercise while seating on a bench or with a barbell.\r\n</p>\n    \n',0,441,442,250,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/dumbbell-side-bend',1,'8.0',2,5,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/88/Male/m/88_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/88/Male/m/88_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/88/Female/m/88_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/88/Female/m/88_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (290,'Exercise Ball Crunch','\n        <p>\n        </p><p></p><ol><li> Lie on an exercise ball with your lower back curvature pressed against the spherical surface of the ball.  Your feet should be bent at the knee and pressed firmly against the floor.  The upper torso should be hanging off the top of the ball.  The arms should either be kept alongside the body or crossed on top of your chest as these positions avoid neck strains (as opposed to the hands behind the back of the head position).</li>\r\n\r\n	<li> Lower your torso into a stretch position keeping the neck stationary at all times.  This will be your starting position.</li>\r\n\r\n	<li> With the hips stationary, flex the waist by contracting the abdominals and curl the shoulders and trunk upward until you feel a nice contraction on your abdominals.  The arms should simply slide up the side of your legs if you have them at the side or just stay on top of your chest if you have them crossed.  The lower back should always stay in contact with the ball.  Exhale as you perform this movement and hold the contraction for a second.</li>\r\n\r\n	<li> As you inhale, go back to the starting position.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Perform this exercise slowly and deliberately as it takes some getting used to.  Also, do not be hasty and try to use weights on the first time; you\'ll have enough on your hands learning how to balance yourself.  Also, if balance is an issue I recommend having a spotter next to you and also placing each of your feet under a 100-lb dumbbell for added stability.  As you get more advanced you can hold a dumbbell or a weight plate (held at arms length) on top of your chest.  However, you have to be very careful when adding weight to this exercise, because if you add too much too quickly you could get a hernia.</p>  \r\n\r\n<p><strong>Variations:</strong> You can perform this exercise with a low pulley behind you with a rope attached on its end.  In this manner you can go ahead and add resistance easier.  For this variation, you will need to hold on to the sides of the rope throughout the movement.  I like to bring my arms forward to the point that the upper arms are almost parallel to my torso and the lower arms are facing back holding the rope.</p>\n    \n',0,443,444,260,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/exercise-ball-crunch',1,'8.3',2,7,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/117/Male/m/117_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/117/Male/m/117_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/117/Female/m/117_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/117/Female/m/117_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (291,'Exercise Ball Pull-In','\n        <p>\n        </p><p></p><ol><li>Place an exercise ball nearby and lay on the floor in front of it with your hands on the floor shoulder width apart in a push-up position.</li>\r\n\r\n<li>Now place your lower shins on top of an exercise ball. <strong>Tip:</strong> At this point your legs should be fully extended with the shins on top of the ball and the upper body should be in a push-up type of position being supported by your two extended arms in front of you. This will be your starting position.</li>\r\n\r\n<li>While keeping your back completely straight and the upper body stationary, pull your knees in towards your chest as you exhale, allowing the ball to roll forward under your ankles. Squeeze your abs and hold that position for a second.</li>\r\n\r\n<li>Now slowly straighten your legs, rolling the ball back to the starting position as you inhale.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol>\n',0,445,446,270,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/exercise-ball-pull-in',2,'8.7',2,7,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/121/Male/m/121_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/121/Male/m/121_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/121/Female/m/121_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/121/Female/m/121_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif');
INSERT INTO `exercise_type` (`type_id`,`name`,`description`,`form_type`,`tree_left`,`tree_right`,`tree_order`,`tree_level`,`tree_parent_id`,`link`,`mechanics_type`,`rating`,`force_type`,`equipment`,`type_img`,`guide_img`) VALUES 
 (292,'Flat Bench Leg Pull-In','\n        <p>\n        </p><p></p><ol><li>Lie on an exercise mat or a flat bench with your legs off the end.</li>\r\n\r\n<li>Place your hands either under your glutes with your palms down or by the sides holding on to the bench (or with palms down by the side on an exercise mat).  Also extend your legs straight out. This will be your starting position.</li>\r\n\r\n<li>Bend your knees and pull your upper thighs into your midsection as you breathe out.  Continue this movement until your knees are near your chest.  Hold the contracted position for a second.</li>\r\n\r\n<li>As you breathe in, slowly return to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> As you get more advanced, you can hold a dumbbell between your legs.  You can also perform this exercise on a decline bench.</p>\r\n\n    \n',0,447,448,280,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/flat-bench-leg-pull-in',2,'7.7',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/94/Male/m/94_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/94/Male/m/94_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/94/Female/m/94_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/94/Female/m/94_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (293,'Flat Bench Lying Leg Raise','\n        <p>\n        </p><p></p><ol><li>Lie with your back flat on a bench and your legs extended in front of you off the end.</li>\r\n\r\n<li>Place your hands either under your glutes with your palms down or by the sides holding on to the bench. This will be your starting position.</li>\r\n\r\n<li>As you keep your legs extended, straight as possible with your knees slightly bent but locked raise your legs until they make a 90-degree angle with the floor.  Exhale as you perform this portion of the movement and hold the contraction at the top for a second.</li>\r\n\r\n<li>Now, as you inhale, slowly lower your legs back down to the starting position.</li>\r\n</ol><p><strong>Variations:</strong> You can also perform this exercise on the floor on top of an exercise mat.  You can also add weight by holding a dumbbell in between your feet as you get more advanced.</p>\r\n\n    \n',0,449,450,290,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/flat-bench-lying-leg-raise',1,'8.3',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/90/Male/m/90_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/90/Male/m/90_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/90/Female/m/90_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/90/Female/m/90_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (294,'Frog Sit-Ups','\n        <p>\n        </p><p></p><ol><li>Lie with your back flat on the floor (or exercise mat) and your legs extended in front of you.</li>\r\n\r\n<li>Now bend at the knees and place your outer thighs by the floor (or mat) as you make the soles of your feet touch each other.</li>\r\n\r\n<li>Now try pushing both soles and bringing them up as near you as possible while you keep the outer thighs on the floor (or at least almost touching it).  <strong>Tip:</strong> In this position your legs should create a diamond shape.</li>\r\n\r\n<li>Now, cross your arms in front of you by touching the opposite shoulders.  This will be your starting position.</li>\r\n\r\n<li>As you exhale flatten your lower back to the floor while curling the torso upwards. Tip: This will be like performing the first 1/4 movement of a sit up. Hold at the top position for a second.</li>\r\n\r\n<li>As you inhale, slowly lower back to the starting position.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol>\n',0,451,452,300,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/frog-sit-ups',1,'7.3',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/295/Male/m/295_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/295/Male/m/295_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/295/Female/m/295_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/295/Female/m/295_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (295,'Gorilla Chin/Crunch','\n        <p>\n        </p><p></p><ol><li> Hang from a chin-up bar using an underhand grip (palms facing you) that is slightly wider than shoulder width.</li>\r\n\r\n	<li> Now bend your knees at a 90 degree angle so that the calves are parallel to the floor while the thighs remain perpendicular to it.  This will be your starting position.</li>\r\n\r\n	<li> As you exhale, pull yourself up while crunching your knees up at the same time until your knees are at chest level.  You will stop going up as soon as your nose is at the same level as the bar.  <strong>Tip:</strong> When you get to this point you should also be finishing the crunch at the same time.</li>\r\n\r\n	<li> Slowly start to inhale as you return to the starting position.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can also add resistance by holding a dumbbell or medicine ball between your feet but this should only be done by the most advanced athletes.  Alternatively, when you are very advanced you can also try the one-arm version where you grasp your wrist with your free hand and you work the obliques more.</p>\n    \n',0,453,454,310,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/gorilla-chincrunch',2,'9.0',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/183/Male/m/183_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/183/Male/m/183_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/183/Female/m/183_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/183/Female/m/183_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (296,'Hanging Leg Raise','\n        <p>\n        </p><p></p><ol><li>Hang from a chin-up bar with both arms extended at arms length in top of you using either a wide grip or a medium grip. The legs should be straight down with the pelvis rolled slightly backwards.   This will be your starting position.</li>\r\n\r\n<li>Raise your legs until the torso makes a 90-degree angle with the legs.  Exhale as you perform this movement and hold the contraction for a second or so.</li>\r\n\r\n<li>Go back slowly to the starting position as you breathe in.</li>\r\n\r\n<li>Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> Perform this exercise slowly and deliberately as it takes some getting used to.  Also, do not be hasty and try to use weights on the first time; you\'ll have enough in your hands by holding your weight and also learning how to balance yourself so that you avoid swinging your torso.  As you get more advanced you can hold a dumbbell in between your feet.  However, you have to be very careful when adding weight to this exercise as if you add too much too quickly you could get a hernia.</p>\r\n\r\n<p><strong>Variations:</strong> This exercise can also be performed using a vertical bench that makes the exercise easier by supporting your upper back in place and by allowing you to hold yourself by placing your elbows and arms on the side pads.</p>\r\n\n    \n',0,455,456,320,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/hanging-leg-raise',1,'9.1',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/222/Male/m/222_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/222/Male/m/222_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/222/Female/m/222_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/222/Female/m/222_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (297,'Hanging Pike','\n        <p>\n        </p><p></p><ol><li> Hang from a chin-up bar with your legs and feet together using an overhand grip (palms facing away from you) that is slightly wider than shoulder width. <strong>Tip:</strong> You may use wrist wraps in order to facilitate holding on to the bar.</li>\r\n\r\n	<li> Now bend your knees at a 90 degree angle and bring the upper legs forward so that the calves are perpendicular to the floor while the thighs remain parallel to it.  This will be your starting position.</li>\r\n\r\n	<li> Pull your legs up as you exhale until you almost touch your shins with the bar above you. <strong>Tip:</strong> Try to straighten your legs as much as possible while at the top.</li>\r\n\r\n	<li> Lower your legs as slowly as possible until you reach the starting position. <strong>Tip:</strong> Avoid swinging and using momentum at all times.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can perform this exercise with ankle weights in order to make it more challenging.</p>\n    \n',0,457,458,330,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/hanging-pike',2,'9.2',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/233/Male/m/233_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/233/Male/m/233_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/233/Female/m/233_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/233/Female/m/233_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (298,'Jackknife Sit-Up','\n        <p>\n        </p><p></p><ol><li> Lie flat on the floor (or exercise mat) on your back with your arms extended straight back behind your head and your legs extended also. This will be your starting position.</li>\r\n\r\n	<li> As you exhale, bend at the waist while simultaneously raising your legs and arms to meet in a jackknife position. <strong>Tip:</strong> The legs should be extended and lifted at approximately a 35-45 degree angle from the floor and the arms should be extended and parallel to your legs.  The upper torso should be off the floor.</li>\r\n\r\n	<li> While inhaling, lower your arms and legs back to the starting position.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> If you are really advanced you could use a medicine ball for added resistance.</p>\n    \n',0,459,460,340,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/jackknife-sit-up',2,'8.7',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/91/Male/m/91_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/91/Male/m/91_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/91/Female/m/91_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/91/Female/m/91_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (299,'Janda Sit-Up','\n        <p>\n        </p><p><strong>Note:</strong> This exercise was created by Czech exercise physiologist, Dr. Vladimir Janda and is one of the most challenging sit-up variations as it completely isolates the rectus abdominals by eliminating the hip flexors.</p> \r\n\r\n<p></p><ol><li> Position your body on the floor in the basic sit-up position; knees to a ninety degree angle with feet flat on the floor and arms either crossed over your chest or to the sides.  This will be your starting position.</li>\r\n	<li> As you strongly tighten your glutes and hamstrings, fill your lungs with air and in a slow (three to six second count) ascent, slowly exhale.  <strong>Tip:</strong> It is important to tighten the glutes and hamstrings as this will cause the hip flexors to be inactivated in a process called reciprocal inhibition, which basically means that opposite muscles to the contracted ones will relax.</li>\r\n	<li> As you inhale, slowly go back in a controlled manner to the starting position.</li>\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> The exercise can be done using a dedicated abdominal bench apparatus, having a workout partner exert pulling pressure on your calves (while you maintain your feet on the ground) or wrapping your legs over barbell and pulling back.</p>\n    \n',0,461,462,350,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/janda-sit-up',1,'7.0',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/202/Male/m/202_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/202/Male/m/202_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/202/Female/m/202_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/202/Female/m/202_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (300,'Kettlebell Figure 8','\n        <p>\n         </p><p>\r\n</p><ol><li>Place one kettlebell between your legs and take a wider than shoulder width stance. Bend over by pushing your butt out and keeping your back flat.</li>\r\n<li> Pick up a kettlebell and pass it to your other hand between your legs. The receiving hand should reach from behind the legs. Go back and forth for several repetitions. </li>\r\n</ol>\n',0,463,464,360,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-figure-8',3,'7.1',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/548/Male/m/548_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/548/Male/m/548_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/548/Male/m/548_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/548/Male/m/548_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/548/Female/m/548_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/548/Female/m/548_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/548/Female/m/548_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/548/Female/m/548_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (301,'Kettlebell Pass Between The Legs','\n        <p>\n        </p><p>\r\n</p><ol><li> Place one kettlebell between your legs and take a comfortable stance. Bend over by pushing your butt out and keeping your back flat.</li>\r\n<li> Pick up a kettlebell and pass it to your other hand between your legs, in the fashion of a \"W\". Go back and forth for several repetitions.</li>\r\n</ol>\n',0,465,466,370,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-pass-between-the-legs',2,'5.5',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/524/Male/m/524_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/524/Male/m/524_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/524/Male/m/524_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/524/Male/m/524_4.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/524/Female/m/524_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/524/Female/m/524_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/524/Female/m/524_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/524/Female/m/524_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (302,'Kettlebell Windmill','\n        <p>\n        </p><p>\r\n</p><ol><li> Place a kettlebell in front of your lead foot and clean and press it overhead with your opposite arm. Clean the kettlebell to your shoulder by extending through the legs and hips as you pull the kettlebell towards your shoulders. Rotate your wrist as you do so, so that the palm faces forward. Press it overhead by extending the elbow.</li>\r\n<li> Keeping the kettlebell locked out at all times, push your butt out in the direction of the locked out kettlebell. Turn your feet out at a forty-five degree angle from the arm with the locked out kettlebell. Bending at the hip to one side, sticking your butt out, slowly lean until you can touch the floor with your free hand. Keep your eyes on the kettlebell that you hold over your head at all times. </li>\r\n<li>Pause for a second after reaching the ground and reverse the motion back to the starting position.</li>\r\n</ol>\n',0,467,468,380,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/kettlebell-windmill',2,'5.3',4,9,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/533/Male/m/533_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/533/Male/m/533_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/533/Female/m/533_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/533/Female/m/533_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (303,'Knee/Hip Raise On Parallel Bars','\n        <p>\n        </p><p></p><ol><li> Position your body on the vertical leg raise bench so that your forearms are resting on the pads next to the torso and holding on to the handles.  Your arms will be bent at a 90 degree angle.</li>\r\n\r\n	<li> The torso should be straight with the lower back pressed against the pad of the machine and the legs extended pointing towards the floor.  This will be your starting position.</li>\r\n\r\n	<li> Now as you breathe out, lift your legs up as you keep them extended.  Continue this movement until your legs are roughly parallel to the floor and then hold the contraction for a second.  <strong>Tip:</strong> Do not use any momentum or swinging as you perform this exercise.</li>\r\n\r\n	<li> Slowly go back to the starting position as you breathe in.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> As you become more advanced you can start to rotate your pelvis forward at the top of the movement to really engage the lower abs. You may also straighten your legs to increase the difficulty of this movement.</p>\n    \n',0,469,470,390,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/kneehip-raise-on-parallel-bars',1,'8.0',2,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/340/Male/m/340_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/340/Male/m/340_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/340/Female/m/340_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/340/Female/m/340_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (304,'Kneeling Cable Crunch With Alternating Oblique Twists','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nConnect a rope attachment to a high pulley cable and position a mat on the floor in front of it.</li>\r\n<li>\r\nGrab the rope with both hands and kneel approximately two feet back from the tower.</li>\r\n<li>\r\nPosition the rope behind your head with your hands by your ears.</li>\r\n<li>\r\nKeep your hands in the same place, contract your abs and pull downward on the rope in a crunching movement until your elbows reach your knees.</li>\r\n<li>\r\nPause briefly at the bottom and rise up in a slow and controlled manner until you reach the starting position.</li>\r\n<li>\r\nRepeat the same downward movement until you&acirc;&#128;&#153;re halfway down, at which time you&acirc;&#128;&#153;ll begin rotating one of your elbows to the opposite knee.</li>\r\n<li>\r\nAgain, pause briefly at the bottom and rise up in a slow and controlled manner until you reach the starting position.</li>\r\n<li>\r\nRepeat the same movement as before, but alternate the other elbow to the opposite knee.</li>\r\n<li>\r\nContinue this series of movements to failure.</li>\r\n</ol>\r\nTip: Keep your elbows in tight when doing the normal crunching movement, but extend them outward when doing the oblique twist. This technique will open your body for a greater rotation, as well as allow your elbow to drive backward with more force. \r\n\n    \n',0,471,472,400,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/kneeling-cable-crunch-with-alternating-oblique-twists',1,'0.0',2,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/937/Male/m/937_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/937/Male/m/937_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/937/Female/m/937_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/937/Female/m/937_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/937/Female/m/937_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/937/Female/m/937_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (305,'Leg Pull-In','\n        <p>\n        </p><p></p><ol><li> Lie on an exercise mat with your legs extended and your hands either palms facing down next to you or under your glutes.  <strong>Tip:</strong> My preference is with the hands next to me.  This will be your starting position.</li>\r\n\r\n	<li> Bend your knees and pull your upper thighs into your midsection as you breathe out.  Continue the motion until your knees are around chest level. Contract your abs as you execute this movement and hold for a second at the top. <strong>Tip:</strong> As you perform the motion, the lower legs (calves) should always remain parallel to the floor.</li>\r\n\r\n	<li> Return to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can hold a dumbbell between your feet to add resistance or you can also use an ankle attachment to add weight via a low pulley machine.  Alternatively, you may also use exercise bands.</p>\n    \n',0,473,474,410,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/leg-pull-in',2,'7.4',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/95/Male/m/95_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/95/Male/m/95_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/95/Female/m/95_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/95/Female/m/95_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (306,'Oblique Crunches','\n        <p>\n        </p><p></p><ol><li>Lie flat on the floor with your lower back pressed to the ground. For this exercise, you will need to put one hand beside your head and the other to the side against the floor.</li>\r\n\r\n<li>Make sure your feet are elevated and resting on a flat surface.  </li>\r\n\r\n<li>Now lift the shoulder in which your hand is touching your head.</li>\r\n\r\n<li>Simply elevate your shoulder and body upward until you touch your knee.  For example, if you have your right hand besides your head, then you want to elevate your body upwards until your right elbow touches your left knee.  The same variation can be applied doing the inverse and using your left elbow to touch your right knee.</li>\r\n\r\n<li>After your knee touches your elbow, lower your body until you have reached the starting position.</li>\r\n\r\n<li>Remember to breathe in during the eccentric (lowering) part of the exercise and to breathe out during the concentric (upward) part of the exercise.</li>\r\n\r\n<li>Continue alternating in this manner until all of the recommended repetitions for each side have been completed.</li>\r\n</ol><p><strong>Note:</strong> While you cannot add resistance to this exercise you can concentrate on perfect execution and slow speed.</p>\r\n\n    \n',0,475,476,420,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/oblique-crunches',1,'8.6',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/104/Male/m/104_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/104/Male/m/104_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/104/Female/m/104_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/104/Female/m/104_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (307,'Oblique Crunches - On The Floor','\n        <p>\n        </p><p></p><ol><li>Start out by lying on your right side with your legs lying on top of each other.  Make sure your knees are bent a little bit.</li>\r\n\r\n<li>Place your left hand behind your head.</li>\r\n\r\n<li>Once you are in this set position, begin by moving your left elbow up as you would perform a normal crunch except this time the main emphasis is on your obliques.</li>\r\n\r\n<li>Crunch as high as you can, hold the contraction for a second and then slowly drop back down into the starting position.</li>\r\n\r\n<li>Remember to breathe in during the eccentric (lowering) part of the exercise and to breathe out during the concentric (elevation) part of the exercise.</li>\r\n</ol><p><strong>Note:</strong> While you cannot add resistance to this exercise you can concentrate on perfect execution and slow speed.</p>\r\n\n    \n',0,477,478,430,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/oblique-crunches-on-the-floor',1,'7.8',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/122/Male/m/122_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/122/Male/m/122_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/122/Female/m/122_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/122/Female/m/122_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (308,'One-Arm High-Pulley Cable Side Bends','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nConnect a standard handle to a tower. Move cable to highest pulley position.</li>\r\n<li>\r\nStand with side to cable. With one hand, reach up and grab handle with underhand grip.</li>\r\n<li>\r\nPull down cable until elbow touches your side and the handle is by your shoulder.</li>\r\n<li>\r\nPosition feet hip-width apart. Place free hand on hip to help gauge pivot point.</li>\r\n<li>\r\nKeep arm in static position. Contract oblique to bring the weight down in a side crunch.</li>\r\n<li>\r\nOnce you reach maximum contraction, slowly release the weight to the starting position. The weight stack should never be unloaded in a resting position. The aim is constant tension during the set.</li>\r\n<li>\r\nRepeat to failure.</li>\r\n<li>\r\nThen, reposition and repeat the same series of movements on the opposite side.</li>\r\n</ol>\r\nTip: Keep your arm tucked in tight to your side; don&acirc;&#128;&#153;t move it. This technique will ensure the weight is isolated directly to the obliques and not your biceps or shoulder.\r\n\n    \n',0,479,480,440,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/one-arm-high-pulley-cable-side-bends-',1,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/933/Male/m/933_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/933/Male/m/933_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/933/Female/m/933_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/933/Female/m/933_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (309,'Pallof Press With Rotation','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nConnect a standard handle to a tower, and position the cable to shoulder height.</li>\r\n<li>\r\nWith your side to the cable, grab the handle with one hand and step away from the tower. You should be approximately arm&acirc;&#128;&#153;s length away from the pulley, with the tension of the weight on the cable. Align outstretched arm with cable.</li>\r\n<li>\r\nWith your feet positioned hip-width apart, pull the cable into your chest and grab the handle with your other hand. Both hands should be on the handle at this time.</li>\r\n<li>\r\nFacing forward, press the cable away from your chest. You core should be tight and engaged.\r\n</li>\r\n<li>\r\nKeeping your hips straight, twist your torso away from the pulley until you get a full quarter rotation.</li>\r\n<li>\r\nMaintain your rigid stance and straight arms. Return to the neutral position in a slow and controlled manner. Your arms should be extended in front of you.</li>\r\n<li>\r\nWith the side tension still engaging your core, bring your hands to your chest and immediately press outward to a fully extended position. This constitutes one rep. </li>\r\n<li>\r\nRepeat to failure.</li>\r\n<li>\r\nThen, reposition and repeat the same series of movements on the opposite side.</li>\r\n</ol>\r\nTip: The closer you keep your feet together, the greater the core activation. A wide base puts the pressure on your legs instead of your core.\r\n\r\n\n    \n',0,481,482,450,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/pallof-press-with-rotation',2,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/934/Male/m/934_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/934/Male/m/934_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/934/Male/m/934_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/934/Female/m/934_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/934/Female/m/934_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/934/Female/m/934_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/934/Female/m/934_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (310,'Plank','\n        <p>\n        </p><p>\r\n</p><ol><li> Get into a prone position on the floor, supporting your weight on your toes and your forearms. Your arms are bent and directly below the shoulder.</li>\r\n<li> Keep  your body straight at all times, and hold this position as long as possible. To increase difficulty, an arm or leg can be raised.\r\n</li>\r\n</ol>\n',0,483,484,460,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/plank',1,'9.0',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/908/Male/m/908_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/908/Male/m/908_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/908/Female/m/908_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/908/Female/m/908_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (311,'Plate Twist','\n        <p>\n        </p><p></p><ol><li> Lie down on the floor or an exercise mat with your legs fully extended and your upper body upright.  Grab the plate by its sides with both hands out in front of your abdominals with your arms slightly bent.</li>\r\n\r\n	<li> Slowly cross your legs near your ankles and lift them up off the ground.  Your knees should also be bent slightly.  <strong>Note:</strong> Move your upper body back slightly to help keep you balanced turning this exercise.  This is the starting position.</li>\r\n\r\n	<li> Move the plate to the left side and touch the floor with it.  Breathe out as you perform that movement.</li>\r\n\r\n	<li> Come back to the starting position as you breathe in and then repeat the movement but this time to the right side of the body. <strong>Tip:</strong> Use a slow controlled movement at all times.  Jerking motions can injure the back.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol>\n',0,485,486,470,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/plate-twist',2,'8.5',4,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/106/Male/m/106_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/106/Male/m/106_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/106/Male/m/106_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/106/Female/m/106_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/106/Female/m/106_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/106/Female/m/106_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (312,'Press Sit-Up','\n        <p>\n        </p><p></p><ol><li> To begin, lie down on a bench with a barbell resting on your chest.  Position your legs so they are secure on the extension of the abdominal bench.  This is the starting position.</li>\r\n\r\n	<li> While inhaling, tighten your abdominals and glutes.  Simultaneously curl your torso as you do when performing a sit-up and press the barbell to an overhead position while exhaling. <strong>Tip:</strong> Use your arms to push the barbell out as you perform this exercise while still focusing on the abdominal muscles.</li>\r\n\r\n	<li> Lower your upper body back down to the starting position while bringing the barbell back down to your torso.  Remember to breathe in while lowering the body.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Caution:</strong> It is best to have a spotter while performing this exercise so that it is easier to get the barbell and also get rid of it.  Also, always start with an empty bar and do not use jerking motions at any time.</p>\r\n\r\n<p><strong>Variations:</strong> You can also use a decline bench when you are more advanced.</p>\n    \n',0,487,488,480,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/press-sit-up',2,'8.3',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/203/Male/m/203_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/203/Male/m/203_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/203/Female/m/203_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/203/Female/m/203_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (313,'Reverse Crunch','\n        <p>\n        </p><p></p><ol><li> Lie down on the floor with your legs fully extended and arms to the side of your torso with the palms on the floor.  Your arms should be stationary for the entire exercise.</li>\r\n\r\n	<li> Move your legs up so that your thighs are perpendicular to the floor and feet are together and parallel to the floor.  This is the starting position.</li>\r\n\r\n	<li> While inhaling, move your legs towards the torso as you roll your pelvis backwards and you raise your hips off the floor.  At the end of this movement your knees will be touching your chest.</li>\r\n\r\n	<li> Hold the contraction for a second and move your legs back to the starting position while exhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol>\n',0,489,490,490,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/reverse-crunch',1,'8.4',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/119/Male/m/119_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/119/Male/m/119_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/119/Female/m/119_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/119/Female/m/119_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (314,'Rope Crunch','\n        <p>\n        </p><p>\r\n</p><ol><li>Kneel 1-2 feet in front of a cable system with a rope attached.</li>\r\n<li> After selecting an appropriate weight, grasp the rope with both hands reaching overhead. Your torso should be upright in the starting position.</li>\r\n<li> To begin, flex at the spine, attempting to bring your rib cage to your legs as you pull the cable down. </li>\r\n<li>Pause at the bottom of the motion, and then slowly return to the starting position.</li>\r\n<li> These can be done with twists or to the side to hit the obliques.\r\n</li>\r\n</ol>\n',0,491,492,500,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/rope-crunch',1,'9.4',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/888/Male/m/888_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/888/Male/m/888_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/888/Female/m/888_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/888/Female/m/888_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (315,'Russian Twist','\n        <p>\n        </p><p></p><ol><li> Lie down on the floor placing your feet either under something that will not move or by having a partner hold them.  Your legs should be bent at the knees.</li>\r\n\r\n	<li> Elevate your upper body so that it creates an imaginary V-shape with your thighs.  Your arms should be fully extended in front of you perpendicular to your torso and with the hands clasped.  This is the starting position.</li>\r\n\r\n	<li> Twist your torso to the right side until your arms are parallel with the floor while breathing out.</li>\r\n\r\n	<li> Hold the contraction for a second and move back to the starting position while breathing out. Now move to the opposite side performing the same techniques you applied to the right side.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> As you get more advanced, you can hold a weight with both arms for resistance.</p>\n    \n',0,493,494,510,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/russian-twist',2,'8.2',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/208/Male/m/208_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/208/Male/m/208_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/208/Female/m/208_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/208/Female/m/208_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (316,'Seated Barbell Twist','\n        <p>\n        </p><p></p><ol><li> Start out by sitting at the end of a flat bench with a barbell placed on top of your thighs.  Your feet should be shoulder width apart from each other.</li>\r\n\r\n	<li> Grip the bar with your palms facing down and make sure your hands are wider than shoulder width apart from each other.  Begin to lift the barbell up over your head until your arms are fully extended.</li>\r\n\r\n	<li> Now lower the barbell behind your head until it is resting along the base of your neck.  This is the starting position.</li>\r\n\r\n	<li> While keeping your feet and head stationary, move your waist from side to side so that your oblique muscles feel the contraction.  Only move from side to side as far as your waist will allow you to go.  Stretching or moving too far can cause an injury to occur. <strong>Tip:</strong> Use a slow and controlled motion.</li>\r\n\r\n	<li> Remember to breathe out while twisting your body to the side and in when moving back to the starting position.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol>\n',0,495,496,520,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/seated-barbell-twist',1,'7.0',1,2,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/89/Male/m/89_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/89/Male/m/89_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/89/Female/m/89_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/89/Female/m/89_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (317,'Seated Flat Bench Leg Pull-In','\n        <p>\n        </p><p></p><ol><li> Sit on a bench with the legs stretched out in front of you slightly below parallel and your arms holding on to the sides of the bench.  Your torso should be leaning backwards around a 45-degree angle from the bench.  This will be your starting position.</li>\r\n\r\n	<li> Bring the knees in toward you as you move your torso closer to them at the same time.  Breathe out as you perform this movement.</li>\r\n\r\n	<li> After a second pause, go back to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can also perform this exercise on a mat on the floor just by placing your arms to the sides.  In this case, the legs will be stretched and elevated slightly over the floor.  Also, as you become more advanced you can hold a dumbbell in between your feet or attach a pulley to them for added resistance.  However, you have to be very careful when adding weight to this exercise as if you add too much too quickly you could get a hernia.</p>\n    \n',0,497,498,530,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/seated-flat-bench-leg-pull-in',2,'8.2',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/93/Male/m/93_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/93/Male/m/93_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/93/Female/m/93_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/93/Female/m/93_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (318,'Seated Leg Tucks','\n        <p>\n        </p><p></p><ol><li> Sit on a bench with the legs stretched out in front of you slightly below parallel and your arms holding on to the sides of the bench.  Your torso should be leaning backwards around a 45-degree angle from the bench.  This will be your starting position.</li>\r\n\r\n	<li> Bring the knees in toward you as you move your torso closer to them at the same time.  Breathe out as you perform this movement.</li>\r\n\r\n	<li> After a second pause, go back to the starting position as you inhale.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can also perform this exercise on a mat on the floor just by placing your arms to the sides.  In this case, the legs will be stretched and elevated slightly over the floor.  Also, as you become more advanced you can hold a dumbbell in between your feet or attach a pulley to them for added resistance.  However, you have to be very careful when adding weight to this exercise as if you add too much too quickly you could get a hernia.</p>\n    \n',0,499,500,540,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/seated-leg-tucks',1,'6.2',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/290/Male/m/290_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/290/Male/m/290_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/290/Female/m/290_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/290/Female/m/290_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (319,'Side Bridge','\n        <p>\n        </p><p>Works your obliques and helps stabilize your spine. Lie on your side and support your body between your forearm and knee to your feet. Hold position for two to four seconds.</p>\r\n\r\n<p>Repeat on the other side. Build up to at least 60 seconds on each side of your body!</p>\n    \n',0,501,502,550,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/side-bridge',3,'7.6',3,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/249/Male/m/249_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/249/Male/m/249_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/249/Female/m/249_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/249/Female/m/249_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (320,'Side Jackknife','\n        <p>\n        </p><p>Works your obliques. Lying on your right side and keeping your left leg over your right one, place your right hand in a comfortable spot and clasp your left hand behind your head.</p>\r\n\r\n<p>Bring your torso and left leg toward each other as you pull with your obliques. Squeeze for a moment and return to the starting position. You can use ankle weights to make it tougher!</p>\n    \n',0,503,504,560,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/side-jackknife',2,'6.4',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/123/Male/m/123_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/123/Male/m/123_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/123/Female/m/123_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/123/Female/m/123_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (321,'Sit-Up','\n        <p>\n        </p><p></p><ol><li> Lie down on the floor placing your feet either under something that will not move or by having a partner hold them.  Your legs should be bent at the knees.</li>\r\n\r\n	<li> Place your hands behind your head and lock them together by clasping your fingers.  This is the starting position.</li>\r\n\r\n	<li> Elevate your upper body so that it creates an imaginary V-shape with your thighs. Breathe out when performing this part of the exercise.</li>\r\n\r\n	<li> Once you feel the contraction for a second, lower your upper body back down to the starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong></p>\r\n\r\n<p></p><ul><li>This exercise can be performed with a weighted plate being held by both arms resting on the chest.  The way to perform this exercise is to cross your arms by making an X and grabbing the weighted plate.  <strong>Note:</strong> Your hands will no longer be behind your head.</li>\r\n\r\n	<li>This variation may be difficult to perform at first so start out using little to no weights until you feel comfortable with the movements.</li>\r\n</ul>\n',0,505,506,570,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/sit-up',1,'7.7',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/217/Male/m/217_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/217/Male/m/217_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/217/Female/m/217_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/217/Female/m/217_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (322,'Standing Cable Lift','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nConnect a standard handle on a tower, and move the cable to the lowest pulley position.</li>\r\n<li>\r\nWith your side to the cable, grab the handle with one hand and step away from the tower. You should be approximately arm&acirc;&#128;&#153;s length away from the pulley, with the tension of the weight on the cable. Your outstretched arm should be aligned with the cable.</li>\r\n<li>\r\nWith your feet positioned shoulder width apart, squat down and grab the handle with both hands. Your arms should still be fully extended.</li>\r\n<li>\r\nIn one motion, pull the handle up and across your body until your arms are in a fully-extended position above your head.</li>\r\n<li>\r\nKeep your back straight and your arms close to your body as you pivot your back foot and straighten your legs to get a full range of motion.</li>\r\n<li>\r\nRetract your arms and then your body. Return to the neutral position in a slow and controlled manner.</li>\r\n<li>\r\nRepeat to failure.</li>\r\n<li>\r\nThen, reposition and repeat the same series of movements on the opposite side.</li>\r\n</ol>\r\nTip: You will twist your entire body with this exercise, but focus on getting maximal torso rotation and a strong clinch at the end of the movement. To ensure a good mind-muscle connection, keep your abs tense at all times.\r\n\n    \n',0,507,508,580,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/standing-cable-lift',2,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/936/Male/m/936_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/936/Male/m/936_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (323,'Standing Cable Wood Chop','\n        <p>\n        </p><p>\r\n</p><ol><li>\r\nConnect a standard handle to a tower, and move the cable to the highest pulley position.</li>\r\n<li>\r\nWith your side to the cable, grab the handle with one hand and step away from the tower. You should be approximately arm&acirc;&#128;&#153;s length away from the pulley, with the tension of the weight on the cable. Your outstretched arm should be aligned with the cable.</li>\r\n<li>\r\nWith your feet positioned shoulder width apart, reach upward with your other hand and grab the handle with both hands. Your arms should still be fully extended.</li>\r\n<li>\r\nIn one motion, pull the handle down and across your body to your front knee while rotating your torso.</li>\r\n<li>\r\nKeep your back and arms straight and core tight while you pivot your back foot and bend your knees to get a full range of motion.</li>\r\n<li>\r\nMaintain your stance and straight arms. Return to the neutral position in a slow and controlled manner.</li>\r\n<li>\r\nRepeat to failure.</li>\r\n<li>\r\nThen, reposition and repeat the same series of movements on the opposite side.</li>\r\n</ol>\r\nTip: You will twist your entire body with this exercise, but really focus on getting maximal torso rotation and a strong clinch at the end of the movement. To ensure a good mind-muscle connection, keep your abs tense at all times.\r\n\n    \n',0,509,510,590,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/standing-cable-wood-chop',2,'0.0',4,4,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/935/Male/m/935_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/935/Male/m/935_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/935/Female/m/935_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/935/Female/m/935_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (324,'Tuck Crunch','\n        <p>\n        </p><p></p><ol><li> To begin, lie down on the floor or an exercise mat with your back pressed against the floor.  Your arms should be lying across your sides with the palms facing down.</li>\r\n\r\n	<li> Your legs should be crossed by wrapping one ankle around the other.  Slowly elevate your legs up in the air until your thighs are perpendicular to the floor with a slight bend at the knees.  <strong>Note:</strong> Your knees and toes should be parallel to the floor as opposed to the thighs.</li>\r\n\r\n	<li> Move your arms from the floor and cross them so they are resting on your chest.  This is the starting position.</li>\r\n\r\n	<li> While keeping your lower back pressed against the floor, slowly lift your torso.  Remember to exhale while perform this part of the exercise.</li>\r\n\r\n	<li> Slowly begin to lower your torso back down to the starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> This exercise can be performed with a weighted plate resting across your chest with your arms holding it.  This can be a bit challenging for those who have never performed this exercise with weights. Always try the exercise without weights before moving to weighted plates.</p>\r\n\r\n<p>You can also perform this exercise with your hands clasped behind your head.  This is a great way to add variety to your routine.</p>\n    \n',0,511,512,600,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/tuck-crunch',1,'7.2',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/115/Male/m/115_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/115/Male/m/115_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/115/Female/m/115_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/115/Female/m/115_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (325,'Weighted Ball Side Bend','\n        <p>\n        </p><p></p><ol><li> To begin, lie down on an exercise ball with your left side of the torso (waist, hips and shoulder) pressed against the ball.</li>\r\n\r\n	<li> Your feet should be on the floor while your legs are crossed and hanging from the ball.  Hold a weighted plate with your right hand directly to the right side of your head.  <strong>Tip:</strong> Make sure the smooth side of the plate is resting against your head.</li>\r\n\r\n	<li>  Place your left arm across your torso so that your palm is on your obliques.  There should be a right angle between your left forearm and upper arm.  This is the starting position.</li>\r\n\r\n	<li> Raise the side of your torso up by laterally flexing at the waist while exhaling.</li>\r\n\r\n	<li> Hold the contraction for a second and slowly lower yourself back down to the starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n\r\n	<li> Switch sides and repeat the exercise.</li>\r\n</ol><p><strong>Caution:</strong> If new to this exercise it is best to perform it without any weights until you develop good form.</p>\n    \n',0,513,514,610,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/weighted-ball-side-bend',1,'5.7',2,7,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/333/Male/m/333_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/333/Male/m/333_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/333/Female/m/333_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/333/Female/m/333_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (326,'Weighted Crunches','\n        <p>\n        </p><p>\r\n</p><ol><li>Lie flat on your back with your feet flat on the ground or resting on a bench with your knees bent at a 90 degree angle. </li>\r\n<li> Hold a weight to your chest, or you may hold it extended above your torso. This will be your starting position.</li>\r\n<li>  Now, exhale and slowly begin to roll your shoulders off the floor.  Your shoulders should come up off the floor about 4 inches while your lower back remains on the floor. </li>\r\n<li> At the top of the movement, flex your abdominals and hold for a brief pause. </li>\r\n<li> Then inhale and slowly lower yourself back down to the starting position.\r\n</li>\r\n</ol>\n',0,515,516,620,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/weighted-crunches',1,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/926/Male/m/926_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/926/Male/m/926_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/926/Female/m/926_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/926/Female/m/926_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (327,'Weighted Sit-Ups - With Bands','\n        <p>\n        </p><p></p><ol><li> Start out by strapping the bands around the base of the decline bench.  Place the handles towards the inside of the decline bench so that when lying down, you can reach for both of them.</li>\r\n\r\n	<li> Position your legs through the decline machine until they are secured.  Now reach for the exercise bands with both hands. Use a pronated (palms forward) grip to grasp the handles.  Position them near your collar bone and rotate your wrist to a neutral grip (palms facing the torso). <strong>Note:</strong> Your arms should remain stationary throughout the exercise.  This is the starting position.</li>\r\n\r\n	<li> Move your torso upward until your upper body is perpendicular to the floor while exhaling.  Hold the contraction for a second and lower your upper body back down to the starting position while inhaling.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variations:</strong> You can also use a stationary post and wrap the exercise band around it to perform this exercise.  Simply lie down on the floor and use the same techniques as described above except this time you will not be on a decline bench.  <strong>Note:</strong> If you are going to perform the exercise in this manner, it is best to have a partner hold your feet down.</p>\n    \n',0,517,518,630,2,55,'http://www.bodybuilding.com/exercises/detail/view/name/weighted-sit-ups-with-bands',1,'7.8',2,13,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/262/Male/m/262_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/262/Male/m/262_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/262/Female/m/262_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/262/Female/m/262_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (328,'Abs','',0,646,653,8,1,66,'',0,'0.0',0,0,'',''),
 (329,'Abs','',0,592,609,8,1,24,'',0,'0.0',0,0,'',''),
 (330,'Medicine Ball Full Twist','\n        <p>\n        </p><p>\r\n</p><ol><li>For this exercise you will need a medicine ball and a partner. Stand back to back with your partner, spaced 2-3 feet apart. This will be your starting position.</li>\r\n<li> Hold the ball in front of the trunk. Open the hips and turn the shoulders at the same time as your partner. </li>\r\n<li>For full rotation, you and your partner should twist in the same direction, i.e. counter-clockwise.</li>\r\n<li> Pass the ball to your partner, and both of you can now twist in the opposite direction to repeat the procedure.\r\n</li>\r\n</ol>\n',0,647,648,10,2,328,'http://www.bodybuilding.com/exercises/detail/view/name/medicine-ball-full-twist',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/802/Male/m/802_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/802/Male/m/802_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/802/Male/m/802_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/802/Female/m/802_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/802/Female/m/802_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/802/Female/m/802_3.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (331,'Supine One-Arm Overhead Throw','\n        <p>\n        </p><p>\r\n</p><ol><li>Lay on the ground on your back with your knees bent. Hold the ball with one hand, extending the arm fully behind your head. This will be your starting position.</li>\r\n<li> Initiate the movement at the shoulder, throwing the ball directly forward of you as you sit up, attempting to go for maximum distance. </li>\r\n<li>The ball can be thrown to a partner or bounced off of a wall.\r\n</li>\r\n</ol>\n',0,649,650,20,2,328,'http://www.bodybuilding.com/exercises/detail/view/name/supine-one-arm-overhead-throw',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/839/Male/m/839_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/839/Male/m/839_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/839/Female/m/839_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/839/Female/m/839_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (332,'Supine Two-Arm Overhead Throw','\n        <p>\n        </p><p>\r\n</p><ol><li>Lay on the ground on your back with your knees bent.</li>\r\n<li> Hold the ball with both hands, extending the arms fully behind your head. This will be your starting position.</li>\r\n<li> Initiate the movement at the shoulder, throwing the ball directly forward of you as you sit up, attempting to go for maximum distance. </li>\r\n<li>The ball can be thrown to a partner or bounced off of a wall.\r\n</li>\r\n</ol>\n',0,651,652,30,2,328,'http://www.bodybuilding.com/exercises/detail/view/name/supine-two-arm-overhead-throw',2,'0.0',4,11,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/840/Male/m/840_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/840/Male/m/840_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/840/Male/m/840_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/840/Female/m/840_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/840/Female/m/840_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (333,'Lower Back Curl','\n        <p>\n        </p><p>\r\n</p><ol><li>Lie on your stomach with your arms out to your sides. This will be your starting position.</li>\r\n<li> Using your lower back muscles, extend your spine lifting your chest off of the ground. Do not use your arms to push yourself up. Keep your head up during the movement. Repeat for 10-20 repetitions.</li>\r\n</ol>\n',0,593,594,10,2,329,'http://www.bodybuilding.com/exercises/detail/view/name/lower-back-curl',3,'5.8',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/602/Male/m/602_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/602/Male/m/602_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/602/Female/m/602_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/602/Female/m/602_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (334,'Overhead Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Standing straight up, lace your fingers together and open your palms to the ceiling. Keep your shoulders down as you extend your arms up.</li>\r\n<li> To create a full torso stretch, pull your tailbone down and stabilize your torso as you do this. Stretch the muscles on both the front and the back of the torso.</li>\r\n</ol>\n',0,595,596,20,2,329,'http://www.bodybuilding.com/exercises/detail/view/name/overhead-stretch',2,'4.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/432/Male/m/432_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/432/Male/m/432_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/432/Female/m/432_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/432/Female/m/432_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (335,'Scissor Kick','\n        <p>\n        </p><p></p><ol><li> To begin, lie down with your back pressed against the floor or on an exercise mat (optional).  Your arms should be fully extended to the sides with your palms facing down.  <strong>Note:</strong> The arms should be stationary the entire time.</li>\r\n\r\n	<li> With a slight bend at the knees, lift your legs up so that your heels are about 6 inches off the ground.  This is the starting position.</li>\r\n\r\n	<li> Now lift your left leg up to about a 45 degree angle while your right leg is lowered until the heel is about 2-3 inches from the ground.</li>\r\n\r\n	<li> Switch movements by raising your right leg up and lowering your left leg.  Remember to breathe while performing this exercise.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol><p><strong>Variation:</strong> As you get more advanced, you can wear ankle weights for resistance.</p>\n    \n',0,597,598,30,2,329,'http://www.bodybuilding.com/exercises/detail/view/name/scissor-kick',1,'7.3',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/120/Male/m/120_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/120/Male/m/120_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/120/Female/m/120_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/120/Female/m/120_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (336,'Seated Overhead Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Sit up straight on an exercise mat.</li>\r\n<li> Touch the soles of your feet together with your feet six to eight inches in front of your hips. </li>\r\n<li>Place one hand on the floor beside you and your other hand behind your head.</li>\r\n<li> Lift your elbow to the ceiling as you incline your torso to the other side. Hold for 10 to 20 seconds, then switch sides.</li>\r\n</ol>\n',0,599,600,40,2,329,'http://www.bodybuilding.com/exercises/detail/view/name/seated-overhead-stretch',1,'0.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/406/Male/m/406_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/406/Male/m/406_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/406/Female/m/406_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/406/Female/m/406_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/406/Female/m/406_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/406/Female/m/406_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif');
INSERT INTO `exercise_type` (`type_id`,`name`,`description`,`form_type`,`tree_left`,`tree_right`,`tree_order`,`tree_level`,`tree_parent_id`,`link`,`mechanics_type`,`rating`,`force_type`,`equipment`,`type_img`,`guide_img`) VALUES 
 (337,'Standing Lateral Stretch','\n        <p>\n        </p><p>\r\n</p><ol><li>Take a slightly wider than hip distance stance with your knees slightly bent.</li>\r\n<li> Place your right hand on your right hip to support the spine.</li>\r\n<li> Raise your left arm in a vertical line and place your left hand behind your head. Keep it there as you incline your torso to the right.</li>\r\n<li> Keep your weight evenly distributed between both legs (don\'t lean into your left hip). Switch sides.</li>\r\n</ol>\n',0,601,602,50,2,329,'http://www.bodybuilding.com/exercises/detail/view/name/standing-lateral-stretch',3,'0.0',4,12,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/411/Male/m/411_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/411/Male/m/411_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/411/Female/m/411_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/411/Female/m/411_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/411/Female/m/411_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/411/Female/m/411_4.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (338,'Stomach Vacuum','\n        <p>\n        </p><p></p><ol><li> To begin, stand straight with your feet shoulder width apart from each other.  Place your hands on your hips.  This is the starting position.</li>\r\n\r\n	<li> Now slowly inhale as much air as possible and then start to exhale as much as possible while bringing your stomach in as much as possible and hold this position.  Try to visualize your navel touching your backbone.</li>\r\n\r\n	<li> One isometric contraction is around 20 seconds. During the 20 second hold, try to breathe normally.  Then inhale and bring your stomach back to the starting position.</li>\r\n\r\n	<li> Once you have practiced this exercise, try to perform this exercise for longer than 20 seconds. <strong>Tip:</strong> You can work your way up to 40-60 seconds.</li>\r\n\r\n	<li> Repeat for the recommended amount of sets.</li>\r\n</ol>\n',0,603,604,60,2,329,'http://www.bodybuilding.com/exercises/detail/view/name/stomach-vacuum',1,'7.4',4,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/243/Male/m/243_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/243/Male/m/243_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/243/Female/m/243_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/243/Female/m/243_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (339,'Toe Touchers','\n        <p>\n        </p><p></p><ol><li> To begin, lie down on the floor or an exercise mat with your back pressed against the floor.  Your arms should be lying across your sides with the palms facing down.</li>\r\n\r\n	<li> Your legs should be touching each other.  Slowly elevate your legs up in the air until they are almost perpendicular to the floor with a slight bend at the knees.  Your feet should be parallel to the floor.</li>\r\n\r\n	<li> Move your arms so that they are fully extended at a 45 degree angle from the floor.  This is the starting position.</li>\r\n\r\n	<li> While keeping your lower back pressed against the floor, slowly lift your torso and use your hands to try and touch your toes.  Remember to exhale while perform this part of the exercise.</li>\r\n\r\n	<li> Slowly begin to lower your torso and arms back down to the starting position while inhaling.  Remember to keep your arms straight out pointing towards your toes.</li>\r\n\r\n	<li> Repeat for the recommended amount of repetitions.</li>\r\n</ol>\n',0,605,606,70,2,329,'http://www.bodybuilding.com/exercises/detail/view/name/toe-touchers',1,'6.2',2,3,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/107/Male/m/107_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/107/Male/m/107_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/107/Female/m/107_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/107/Female/m/107_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif'),
 (340,'Torso Rotation','\n        <p>\n        </p><p>\r\n</p><ol><li>Stand upright holding an exercise ball with both hands. Extend your arms so the ball is straight out in front of you. This will be your starting position.</li>\r\n<li> Rotate your torso to one side, keeping your eyes on the ball as you move. Now, rotate back to the opposite direction. Repeat for 10-20 repetitions.</li>\r\n</ol>\n',0,607,608,80,2,329,'http://www.bodybuilding.com/exercises/detail/view/name/torso-rotation',3,'5.5',4,7,'http://www.bodybuilding.com/exercises/exerciseImages/sequences/640/Male/m/640_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/640/Male/m/640_2.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/640/Male/m/640_3.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/640/Female/m/640_1.jpg,http://www.bodybuilding.com/exercises/exerciseImages/sequences/640/Female/m/640_2.jpg','http://assets.bodybuilding.com/images/trackers/exercise/heatmap/13.gif');
